B.Su=A.a(s(["El historiador debe relatar todos los hechos del pasado sin excepci\xf3n.","Los historiadores cuentan historias que son como itinerarios que han decidido seguir a trav\xe9s del campo objetivo de acontecimientos.","La historia es una ciencia exacta que no admite interpretaciones.",""]),t.s)
B.a1D=new A.c("1","Seg\xfan el Documento de Trabajo 1, la pr\xe1ctica historiadora, para Paul Veyne, exige una elecci\xf3n previa para que no se disperse en singularidades. Esto implica que:",B.Su,"B","Veyne (1984) plantea que la investigaci\xf3n en historia 'exige una elecci\xf3n previa para que no se disperse en singularidades'. Afirma que 'los historiadores cuentan historias que son como itinerarios que han decidido seguir a trav\xe9s del campo objetivo de acontecimientos'.")
B.Mf=A.a(s(["Que la genealog\xeda rechaza cualquier forma de conocimiento erudito.","Que busca hacer jugar los saberes locales y sometidos en contra de los discursos cient\xedficos institucionalizados y centralizadores.","Que la genealog\xeda es una forma de historia que busca establecer leyes universales como las ciencias naturales.",""]),t.s)
B.a8_=new A.c("1","El Documento de Trabajo 1 menciona que, para Foucault, la genealog\xeda es una 'anticiencia'. \xbfQu\xe9 significa esto?",B.Mf,"B","Foucault (2000) afirma que el proyecto geneal\xf3gico 'trata de hacer jugar esos saberes locales contra aquellos saberes legitimados que en nombre del conocimiento verdadero intentan filtrarlos y ordenarlos en funci\xf3n de los valores de la ciencia'. Concluye: 'Las genealog\xedas son, muy precisamente, anticiencias'.")
B.MV=A.a(s(["La idea de coherencia y continuidad de los hechos hist\xf3ricos.","La idea de semejanza e identidad originaria de los acontecimientos hist\xf3ricos.","La proliferaci\xf3n y dispersi\xf3n de los acontecimientos.",""]),t.s)
B.a1o=new A.c("1","Inspirado en Nietzsche, Foucault retoma la noci\xf3n de procedencia, la cual alude a:",B.MV,"C","El Documento de Trabajo 1, citando a Foucault, explica que la 'procedencia' no remite a la semejanza o identidad primigenia, sino a los 'innumerables comienzos, la proliferaci\xf3n de acontecimientos, la dispersi\xf3n e imperfecciones del pasado', y que 'agita lo que se percib\xeda inm\xf3vil, fragmenta lo que se pensaba unido'.")
B.Ov=A.a(s(["Entidades naturales descubiertas por la ciencia.","Construcciones humanas producidas por agentes sociales en condiciones hist\xf3ricas espec\xedficas.","Conceptos universales e inmutables a trav\xe9s de las culturas.",""]),t.s)
B.YG=new A.c("1","Para Danziger, los objetos de la psicolog\xeda (inteligencia, personalidad, etc.) deben ser analizados como:",B.Ov,"B","Danziger (1984), citado en el Documento de Trabajo 1, contrapone la idea de que los conceptos, teor\xedas y objetos de la psicolog\xeda son: 'construcciones humanas producidas por agentes sociales en condiciones hist\xf3ricas espec\xedficas', por lo que deben ser estudiados en relaci\xf3n a las actividades constructivas de las cuales son producto.")
B.OM=A.a(s(["Saberes hegem\xf3nicos.","Saberes sometidos.","Saberes universales.",""]),t.s)
B.a5c=new A.c("1","Para Foucault, los saberes no conceptuales, inferiores jer\xe1rquicamente o insuficientes en cuanto al nivel de cientificidad, tambi\xe9n llamados saberes locales, son denominados:",B.OM,"B","El Documento de Trabajo 1 explica que Foucault incluye en lo que llama 'saberes sometidos', los 'saberes no conceptuales, inferiores jer\xe1rquicamente o insuficientes en cuanto al nivel de cientificidad requeridos; a partir de la aparici\xf3n de esos saberes, tambi\xe9n llamados saberes de la gente o locales, Foucault desarrolla la cr\xedtica'.")
B.JK=A.a(s(["Un conjunto homog\xe9neo de discursos te\xf3ricos.","Una instituci\xf3n espec\xedfica como la c\xe1rcel o la escuela.","Una red heterog\xe9nea de elementos (leyes, espacios, discursos, instituciones) que tiene una funci\xf3n estrat\xe9gica en un momento dado.",""]),t.s)
B.Zz=new A.c("1","\xbfQu\xe9 es un 'dispositivo' en la perspectiva de Foucault?",B.JK,"C","El Documento de Trabajo 1 explica que la noci\xf3n de dispositivo aborda 'la heterogeneidad de los elementos que se estructuran formando una red', incluyendo 'desde espacios arquitect\xf3nicos a leyes, de instituciones a proposiciones morales', y que su naturaleza es estrat\xe9gica.")
B.Ln=A.a(s(["Centrarse en la subjetividad y la interpretaci\xf3n del historiador.","La b\xfasqueda de leyes que rijan el desarrollo de la especie humana, de forma similar a las ciencias naturales.","Rechazar cualquier intento de encontrar causalidades en los eventos hist\xf3ricos.",""]),t.s)
B.a7l=new A.c("1","Seg\xfan el Documento de Trabajo 1, \xbfqu\xe9 propone el positivismo para la ciencia hist\xf3rica?",B.Ln,"B","El documento explica que para la historia positivista, 'la historia era la ciencia de los desarrollos de la raz\xf3n' y su objetivo era, 'al igual que las ciencias de la naturaleza, la b\xfasqueda de leyes que rigieran el desarrollo de la especie humana'.")
B.RW=A.a(s(["Al conjunto de todos los libros de historia escritos.","Al lugar social, pol\xedtico y econ\xf3mico desde donde se produce el conocimiento hist\xf3rico, el cual determina sus m\xe9todos e intereses.","A la idea de que la historia debe ser una instituci\xf3n separada del Estado.",""]),t.s)
B.a9v=new A.c("1","\xbfA qu\xe9 se refiere Michel de Certeau con 'la instituci\xf3n hist\xf3rica'?",B.RW,"B","El Documento de Trabajo 1 cita a De Certeau (1999), quien afirma que toda producci\xf3n historiogr\xe1fica 'se enlaza a un lugar de producci\xf3n cultural, pol\xedtico, econ\xf3mico y social... Precisamente en funci\xf3n de este lugar los m\xe9todos se establecen, una topograf\xeda de intereses se precisa'.")
B.KU=A.a(s(["La disciplina, tomando como objeto el cuerpo anat\xf3mico.","La seguridad, aplic\xe1ndose sobre la poblaci\xf3n como conjunto biol\xf3gico.","La soberan\xeda, decidiendo sobre la muerte de los individuos.",""]),t.s)
B.a9T=new A.c("3","La biopol\xedtica, seg\xfan Foucault, es una tecnolog\xeda de poder cuya t\xe9cnica principal es:",B.KU,"B","El Documento de Trabajo 3 explica que la biopol\xedtica es una 'tecnolog\xeda regularizadora' que 'aspira a la seguridad del conjunto' y aborda 'acontecimientos aleatorios que se producen en una poblaci\xf3n', a diferencia de la disciplina que se centra en el cuerpo individual.")
