B.Pi=A.a(s(["Fomenta la colaboraci\xf3n y el pensamiento cr\xedtico por sobre la cantidad de publicaciones.","La presi\xf3n por publicar en revistas de alto impacto puede reforzar la tendencia a seguir temas y problemas de investigaci\xf3n planteados en contextos cient\xedficos centrales.","Ha eliminado por completo la competencia entre pares acad\xe9micos.",""]),t.s)
B.a66=new A.c("9","Seg\xfan el Documento de Trabajo 9, una de las cr\xedticas al modelo actual de producci\xf3n acad\xe9mica en la regi\xf3n es que:",B.Pi,"B","El documento, citando a Gallegos et al. (2014), advierte que 'se podr\xeda estar reforzando la tendencia a seguir los temas y problemas de investigaci\xf3n planteados en determinados contextos cient\xedficos, ya que para publicar en revistas de alto impacto los conocimientos producidos generalmente deben responder a la corriente principal'.")
B.Ru=A.a(s(["El cierre de todos los programas de posgrado.","La creaci\xf3n de Institutos para reemplazar la antigua estructura de '\xc1reas'.","La vuelta al plan de estudios de la EUP de 1977.",""]),t.s)
B.a7w=new A.c("8","Una de las transformaciones acad\xe9micas clave en la Facultad de Psicolog\xeda entre 2007 y 2010 fue:",B.Ru,"B","El Documento de Trabajo 8 menciona que 'En 2010 la Facultad de Psicolog\xeda concret\xf3 el pasaje a una nueva forma de organizaci\xf3n acad\xe9mica, mediante el dise\xf1o e instalaci\xf3n de Institutos', nombrando los cinco institutos creados: Fundamentos y M\xe9todos en Psicolog\xeda; Psicolog\xeda Cl\xednica; Psicolog\xeda, Educaci\xf3n y Desarrollo Humano; Psicolog\xeda de la Salud y Psicolog\xeda Social.")
B.Tl=A.a(s(["El aumento de la carrera a seis a\xf1os y la eliminaci\xf3n de las materias optativas.","La reducci\xf3n de la carrera a cuatro a\xf1os, la adopci\xf3n del sistema de cr\xe9ditos y la obligatoriedad de un trabajo final de grado.","La eliminaci\xf3n total de la formaci\xf3n en metodolog\xedas de investigaci\xf3n.",""]),t.s)
B.a6q=new A.c("9","El nuevo plan de estudios de la Facultad de Psicolog\xeda (2013) introdujo cambios significativos como:",B.Tl,"B","El Documento de Trabajo 9 resume los cambios del Plan 2013: 'La novedad fue la reducci\xf3n de la cursada a cuatro a\xf1os en lugar de 5, la adopci\xf3n del sistema de cr\xe9ditos... y la obligatoriedad de un trabajo final de grado como requisito para la graduaci\xf3n'.")
B.On=A.a(s(["La falta total de financiamiento para la investigaci\xf3n.","La excesiva colaboraci\xf3n internacional que impide el desarrollo local.","La tendencia a la 'endogamia' (publicar en revistas locales) y la necesidad de aumentar la calidad y la colaboraci\xf3n internacional.",""]),t.s)
B.a_S=new A.c("9","\xbfCu\xe1l es uno de los desaf\xedos que el Documento de Trabajo 9 identifica para la investigaci\xf3n psicol\xf3gica en Uruguay?",B.On,"C","El documento menciona la 'endogamia' como un problema y cita a Vera-Villarroel et al. (2011) sobre los desaf\xedos futuros: 'aumentar la calidad de la producci\xf3n por sobre la cantidad... e incrementar la colaboraci\xf3n dentro de la comunidad latinoamericana y con el resto del mundo'.")
B.Oq=A.a(s(["A la creaci\xf3n de empresas por parte de los estudiantes como parte de su formaci\xf3n.","A la adopci\xf3n de una l\xf3gica de competencia y productividad, similar a la de las empresas, en el \xe1mbito acad\xe9mico.","A la venta de las universidades p\xfablicas a corporaciones privadas.",""]),t.s)
B.aa4=new A.c("9","\xbfA qu\xe9 se refiere el Documento de Trabajo 9 con la 'empresalizaci\xf3n' de la universidad?",B.Oq,"B","El documento critica la 'infiltraci\xf3n de una l\xf3gica de la competencia propia de las empresas al interior de la universidad', lo que denomina 'empresalizaci\xf3n', y que se manifiesta en la presi\xf3n por la productividad y la competitividad entre pares.")
B.Mu=A.a(s(["Cuestionar las certezas del presente analizando los momentos de ruptura y error del pasado.","Convalidar el estado actual de la disciplina, creando una tradici\xf3n respetable y ocultando los hechos perturbadores.","Centrarse exclusivamente en los descubrimientos de los 'grandes genios' sin considerar el contexto social.",""]),t.s)
B.a2w=new A.c("9","Seg\xfan Nikolas Rose, \xbfcu\xe1l es la funci\xf3n principal de las 'historias recurrentes' en una disciplina cient\xedfica?",B.Mu,"B","En 'Una historia cr\xedtica de la psicolog\xeda', Rose afirma que las historias recurrentes 'convalidan el presente por medio de su respetable tradici\xf3n y lo deslindan de aquellos aspectos del pasado que puedan perturbarlo'. Construyen una narrativa de progreso continuo hacia el presente, legitim\xe1ndolo.")
B.T6=A.a(s(["C\xf3mo los desarrollos econ\xf3micos se tradujeron directamente en cambios espec\xedficos en el conocimiento.","Las condiciones pol\xedticas e institucionales que problematizaron aspectos de la existencia desde la perspectiva de 'la econom\xeda'.","La biograf\xeda de los principales economistas de la \xe9poca.",""]),t.s)
B.a1G=new A.c("9","Seg\xfan Rose, al estudiar los factores econ\xf3micos en la historia de la psicolog\xeda, \xbfqu\xe9 deber\xedamos analizar?",B.T6,"B",'Rose propone invertir la mirada: \'Deber\xedamos prestar atenci\xf3n a la manera en que esas condiciones problematizaron los diferentes aspectos de la existencia... desde la perspectiva de ""la econom\xeda""\'.')
B.NY=A.a(s(["Aceptar que los intereses son la causa principal de las posturas te\xf3ricas.","Estudiar la formaci\xf3n de los intereses mismos, viendo c\xf3mo se construyen alianzas e identidades colectivas.","Descartar por completo el concepto de inter\xe9s en el an\xe1lisis hist\xf3rico.",""]),t.s)
B.a8F=new A.c("9","Rose critica la atribuci\xf3n de 'intereses' como explicaci\xf3n sociol\xf3gica. \xbfQu\xe9 propone en su lugar?",B.NY,"B","Rose argumenta que 'es necesario explicar la formaci\xf3n de los intereses mismos. Debemos abocarnos a las diversas maneras en que individuos y grupos espec\xedficos se movilizaron en torno de objetivos particulares...'.")
B.QT=A.a(s(["Como el uso de aparatos electr\xf3nicos en la terapia.","Como un conjunto de artes y destrezas que ordena, enmarca y produce al ser, haci\xe9ndolo pensable y gobernable de maneras espec\xedficas.","Como un sin\xf3nimo de 'teor\xeda' o 'discurso'.",""]),t.s)
B.a6L=new A.c("9","\xbfC\xf3mo define Rose el t\xe9rmino 'tecnolog\xeda' en relaci\xf3n a la psicolog\xeda?",B.QT,"B","Rose define tecnolog\xeda como 'un conjunto de artes y destrezas que implica la vinculaci\xf3n de pensamientos, afectos, fuerzas, artefactos y t\xe9cnicas que no solamente fabrican y manipulan al ser, sino que, fundamentalmente, lo ordenan, lo enmarcan, lo producen, lo hacen pensable...'.")
B.LS=A.a(s(["Todos los problemas sociales se reducen a causas psicol\xf3gicas individuales.","Una serie de espacios y pr\xe1cticas se vuelven problem\xe1ticos e inteligibles en t\xe9rminos impregnados de psicolog\xeda.","La psicolog\xeda se ha vuelto una disciplina puramente te\xf3rica sin aplicaciones pr\xe1cticas.",""]),t.s)
B.a8G=new A.c("9","Para Rose, la 'psicologizaci\xf3n' implica que:",B.LS,"B","Rose explica que los espacios 'se vuelven psicol\xf3gicos' en el sentido de que 'se problematizan, es decir, se vuelven perturbadores e inteligibles a la vez en t\xe9rminos impregnados de psicolog\xeda'.")
B.Sa=A.a(s(["A que el conocimiento psicol\xf3gico se genera exclusivamente dentro de las universidades.","A que las reglas que determinan qu\xe9 puede considerarse conocimiento est\xe1n estructuradas por las relaciones institucionales donde se formaron (c\xe1rcel, escuela, f\xe1brica).","A que la psicolog\xeda carece de cualquier tipo de epistemolog\xeda.",""]),t.s)
B.a8a=new A.c("9","\xbfA qu\xe9 se refiere Rose con 'epistemolog\xeda institucional' en el caso de los saberes 'psi'?",B.Sa,"B","Rose, citando a Gordon, explica que la epistemolog\xeda psicol\xf3gica es una 'epistemolog\xeda institucional': 'las reglas mismas que determinan lo que puede considerarse conocimiento est\xe1n estructuradas por las relaciones institucionales en las cuales cobraron forma'.")
B.QL=A.a(s(["La debilit\xf3, eliminando toda forma de autoridad.","Gener\xf3 nuevas autoridades (psic\xf3logos, terapeutas) y transform\xf3 las preexistentes (maestros, jueces), volvi\xe9ndolas 'terap\xe9uticas'.","La hizo m\xe1s autoritaria y represiva.",""]),t.s)
B.a9H=new A.c("9","Seg\xfan Rose, \xbfc\xf3mo transform\xf3 la psicolog\xeda la naturaleza de la autoridad social?",B.QL,"B","Rose argumenta que la psicolog\xeda gener\xf3 'nuevas autoridades sociales' y, a la vez, transform\xf3 las formas de autoridad preexistentes, volvi\xe9ndolas \xe9ticas en la medida en que se ejercen a la luz de un conocimiento de los sujetos, convirtiendo el ejercicio de la autoridad en algo 'terap\xe9utico'.")
B.QQ=A.a(s(["Porque ignora completamente el sufrimiento de las mujeres.","Porque suele atribuir un rol pasivo de v\xedctimas a las mujeres y uno activo de dominadores a los hombres, sin analizar c\xf3mo se construy\xf3 el g\xe9nero para ambos.","Porque la psicolog\xeda nunca ha tratado temas relacionados con el g\xe9nero.",""]),t.s)
B.a1K=new A.c("9","Seg\xfan Nikolas Rose, \xbfpor qu\xe9 es problem\xe1tico usar 'factores patriarcales' como una explicaci\xf3n simple en la historia de la psicolog\xeda?",B.QQ,"B","Rose argumenta que, si bien la cr\xedtica feminista fue decisiva, a menudo se bas\xf3 en 'una l\xf3gica de explicaci\xf3n en t\xe9rminos de intereses previos y subyacentes, en este caso los de los hombres y el patriarcado', y propone analizar 'c\xf3mo ese proceso se llev\xf3 a cabo y a trav\xe9s de cu\xe1les pr\xe1cticas se conform\xf3 y se diferenci\xf3 el g\xe9nero'.")
B.S8=A.a(s(["Una esfera prediscursiva de la naturaleza.","Mutaciones culturales en los patrones de significaci\xf3n.","La organizaci\xf3n t\xe9cnica y pr\xe1ctica de procedimientos para pensar, inscribir e intervenir sobre los seres humanos.",""]),t.s)
B.a1x=new A.c("9","Para Rose, la realidad hist\xf3rica de las entidades psicol\xf3gicas emerge de:",B.S8,"C","Rose concluye que 'la realidad hist\xf3rica de las entidades psicol\xf3gicas no emerge de una esfera prediscursiva de la naturaleza ni de mutaciones culturales... sino de la organizaci\xf3n t\xe9cnica y pr\xe1ctica de procedimientos para pensar, inscribir e intervenir sobre los seres humanos...'.")
B.Jl=A.a(s(["La elaboraci\xf3n de una gran variedad de t\xe9cnicas para disciplinar, vigilar y formar a las poblaciones.","El rechazo total de los m\xe9todos estad\xedsticos y experimentales.","La separaci\xf3n completa de la psicolog\xeda de cualquier aplicaci\xf3n pr\xe1ctica.",""]),t.s)
B.a2R=new A.c("9","Seg\xfan Rose, la 'disciplinarizaci\xf3n' de la psicolog\xeda estuvo intr\xednsecamente ligada a:",B.Jl,"A","En 'Una historia cr\xedtica de la psicolog\xeda', Rose argumenta que 'las condiciones para lograr una estabilizaci\xf3n disciplinaria de este tipo se basaron en la elaboraci\xf3n de una gran variedad de t\xe9cnicas y pr\xe1cticas para disciplinar, vigilar y formar a las poblaciones y a los seres humanos que las conforman'.")
B.MK=A.a(s(["Que depende exclusivamente de computadoras y software.","Que es un complejo de lenguaje, t\xe9cnicas de inscripci\xf3n y procedimientos que hacen al mundo pensable y gobernable de cierta manera.","Que es una ciencia puramente abstracta y te\xf3rica.",""]),t.s)
B.a5s=new A.c("9","\xbfQu\xe9 significa para Rose que la psicolog\xeda es 'tecnol\xf3gica'?",B.MK,"B","Rose define la psicolog\xeda como 'tecnol\xf3gica' en varios sentidos, incluyendo que su lenguaje es una 't\xe9cnica intelectual', que usa 't\xe9cnicas de inscripci\xf3n' (gr\xe1ficos, tablas) y que se vincula a 'tecnolog\xedas humanas' para gobernar la conducta.")
B.K9=A.a(s(["Son irrelevantes, ya que la verdad se descubre objetivamente.","Son procesos sociales de exclusi\xf3n donde argumentos y teor\xedas son marginados para que otros ingresen al campo de 'lo verdadero'.","Son debates puramente filos\xf3ficos sin consecuencias pr\xe1cticas.",""]),t.s)
B.a3f=new A.c("9","Seg\xfan Rose, \xbfqu\xe9 papel juegan las 'batallas por la verdad' en la ciencia?",B.K9,"B","Rose explica que 'existen batallas acerca de la verdad en las que la evidencia, los resultados, los argumentos... se despliegan como recursos en un intento por ganar aliados y lograr que algo ingrese en el campo de lo verdadero'.")
B.OK=A.a(s(["El proceso de traducir textos psicol\xf3gicos de un idioma a otro.","El proceso de negociaciones, intrigas y persuasi\xf3n por el cual un actor logra hablar o actuar en nombre de otro.","La traducci\xf3n de los impulsos neuronales en pensamientos conscientes.",""]),t.s)
B.a8V=new A.c("9","La noci\xf3n de 'traducci\xf3n' de Latour y Callon, utilizada por Rose, se refiere a:",B.OK,"B","Rose cita a Callon y Latour: 'Por traducci\xf3n entendemos todas las negociaciones, intrigas, c\xe1lculos, actos de persuasi\xf3n y de violencia, por medio de los cuales un actor o fuerza adquiere... autoridad para hablar o actuar en nombre de otro actor o fuerza'.")
B.Sy=A.a(s(["El multiculturalismo en una sociedad diversa.","Dar muerte en una sociedad de normalizaci\xf3n.","La superioridad de una cultura sobre otra.",""]),t.s)
B.a6N=new A.c("3","Seg\xfan Foucault en Defender la Sociedad, el racismo de Estado es la condici\xf3n que hace aceptable:",B.Sy,"B","Para Foucault, el biopoder gestiona la vida de la poblaci\xf3n. El racismo introduce 'un corte entre lo que debe vivir y lo que debe morir', permitiendo al Estado ejercer el viejo derecho soberano de matar en una sociedad que, por lo dem\xe1s, est\xe1 orientada a 'hacer vivir'. Es la condici\xf3n que justifica la eliminaci\xf3n de 'razas inferiores' para 'purificar' la propia.")
B.Np=A.a(s(["Para vivir hay que dejar vivir al otro pero no relacionarse con \xe9l.","Para vivir es preciso que el otro muera.","Para vivir hay que dejar que el otro muera sin que yo haga algo al respecto.",""]),t.s)
B.a3J=new A.c("3","Seg\xfan Foucault en Defender la Sociedad, el racismo pone en juego la siguiente m\xe1xima:",B.Np,"B","El racismo de Estado, seg\xfan Foucault, no es simplemente un prejuicio, sino una tecnolog\xeda de poder que justifica la violencia y la muerte. La supervivencia y el fortalecimiento de la propia 'raza' o poblaci\xf3n se legitiman a trav\xe9s de la eliminaci\xf3n o el dejar morir a las otras, consideradas una amenaza biol\xf3gica.")
B.Sv=A.a(s(["Permiten construir una red autogestionada de gobierno.","Permiten regular y controlar conductas de manera racional.","Inhabilitan la posibilidad de un gobierno racional.",""]),t.s)
B.a58=new A.c("3","La numerosa variedad de agentes y acciones en las acciones de gobierno:",B.Sv,"B","El Documento de Trabajo 3, al definir gobierno, habla de una 'actividad racional y calculada, realizada por una multiplicidad de autoridades y organismos' que busca 'dar forma a la conducta'.")
B.T2=A.a(s(["La subordinaci\xf3n del gobierno como mecanismo de poder frente a la disciplina.","La preeminencia del tipo de poder gobierno sobre el resto de la soberan\xeda y la disciplina.","La sustituci\xf3n de la tecnolog\xeda disciplinaria por la tecnolog\xeda de gobierno.",""]),t.s)
B.a5W=new A.c("3","Para Foucault, una de las definiciones de la gubernamentalidad es la siguiente:",B.T2,"B","El Documento de Trabajo 3 explica que por gubernamentalidad se entiende 'la tendencia... hacia la preeminencia del tipo de poder que podemos llamar gobierno sobre todos los dem\xe1s: soberan\xeda, disciplina...'.")
B.Md=A.a(s(["Hacer morir y dejar vivir.","Dejar morir y hacer vivir.","Hacer morir y hacer vivir.",""]),t.s)
B.a0S=new A.c("3","Seg\xfan Michel Foucault la soberan\xeda se ejerce sobre el derecho de espada que implica el atribuirse el derecho de:",B.Md,"A","El poder soberano cl\xe1sico se caracterizaba por su derecho a 'hacer morir y dejar vivir', en contraposici\xf3n al biopoder que busca 'hacer vivir y dejar morir'.")
B.Pt=A.a(s(["Proyecci\xf3n, sujetamiento y subjetividad.","Identificaci\xf3n masiva, sujeci\xf3n y subjetivaci\xf3n.","Identificaci\xf3n anal\xedtica, sujeci\xf3n y subjetivaci\xf3n.",""]),t.s)
B.a2g=new A.c("3","Para Foucault los procesos de individualizaci\xf3n del poder pastoral son los siguientes:",B.Pt,"C","El Documento de Trabajo 3 detalla los tres procedimientos de individualizaci\xf3n del pastorado cristiano: 'Identificaci\xf3n anal\xedtica, sujeci\xf3n y subjetivaci\xf3n'.")
B.S_=A.a(s(["Act\xfaa normalizando el cuerpo de las poblaciones con miras a hacerlas m\xe1s d\xf3ciles y \xfatiles.","Emerge en torno al siglo XVII consistiendo en el adiestramiento de los cuerpos.","Es una tecnolog\xeda nacida en el siglo XIX cuyo campo de actuaci\xf3n es aut\xf3nomo con respecto a otras tecnolog\xedas.",""]),t.s)
B.a1e=new A.c("3","La t\xe9cnica disciplinaria del poder:",B.S_,"B","El Documento de Trabajo 3 explica que las t\xe9cnicas de poder de los siglos XVII y XVIII, denominadas anatomopol\xedticas, 'se centraban m\xe1s que nada en el cuerpo individual' y buscaban adiestrarlo para incrementar su utilidad.")
B.Ri=A.a(s(["Un arte de conducir, dirigir, encauzar, guiar, llevar de la mano y manipular a los hombres.","Un modo racional y calculado de guiar el esp\xedritu del reba\xf1o.","Una estrategia de sometimiento dirigida espec\xedficamente sobre cada uno de los individuos.",""]),t.s)
B.a7A=new A.c("3","El pastorado, en el cristianismo se convirti\xf3 en:",B.Ri,"A","El Documento de Trabajo 3 cita a Foucault: 'en el cristianismo el pastorado se convirti\xf3 en... todo un arte de conducir, dirigir, encauzar, guiar, llevar de la mano, manipular a los hombres...'.")
B.Td=A.a(s(["Un saber/poder que se aplica s\xf3lo al cuerpo.","Un saber/poder que se aplica s\xf3lo a la poblaci\xf3n.","Un saber que se aplica al cuerpo y a la poblaci\xf3n.",""]),t.s)
B.a12=new A.c("3","Seg\xfan Foucault, en Defender la Sociedad, la medicina es:",B.Td,"C","La medicina moderna, en la concepci\xf3n foucaultiana, opera en dos niveles: sobre el cuerpo individual (anatomopol\xedtica, cl\xednica) y sobre la poblaci\xf3n (biopol\xedtica, salud p\xfablica, higiene).")
B.JD=A.a(s(["Procede seg\xfan reglas, expresando una racionalidad propia de las formas de gobernar.","Procede seg\xfan reglas, expresando una racionalidad en el arte de gobernar y es propia al Estado que debe ser gobernado.","Elabora reglas de gobierno y su raz\xf3n se desprende de la reflexi\xf3n sobre los efectos de la aplicaci\xf3n de esas reglas.",""]),t.s)
B.a4b=new A.c("3","La raz\xf3n de Estado es caracterizada por Foucault a partir de su operativa y establece que:",B.JD,"B","El Documento de Trabajo 3 explica que la raz\xf3n de Estado 'procede seg\xfan reglas, por lo que expresa una racionalidad en el arte de gobernar y es inmanente al Estado, es decir que no remite a la figura de Dios o del Soberano, sino que surge del propio Estado que debe ser gobernado'.")
B.Kz=A.a(s(["La conjunci\xf3n de la tecnolog\xeda disciplinaria del poder y la tecnolog\xeda de seguridad.","Una manera distinta de llamar a las sociedades disciplinarias.","Un sin\xf3nimo de la tecnolog\xeda reguladora de la poblaci\xf3n.",""]),t.s)
B.Y1=new A.c("3","Cuando Foucault habla de sociedades de normalizaci\xf3n lo hace refiri\xe9ndose a:",B.Kz,"A","Las sociedades de normalizaci\xf3n son aquellas donde operan articuladamente la disciplina (que normaliza al individuo a trav\xe9s de la norma) y la biopol\xedtica o tecnolog\xeda de seguridad (que regula la poblaci\xf3n en torno a la media).")
B.ND=A.a(s(["Fueron irrelevantes para la formaci\xf3n de psic\xf3logos.","Fueron espacios de adoctrinamiento del r\xe9gimen.","Cumplieron un rol importante en la formaci\xf3n, compensando el deterioro de las posibilidades de formaci\xf3n oficial.",""]),t.s)
B.Yj=new A.c("7","\xbfQu\xe9 rol cumplieron los 'grupos de estudio' durante la dictadura, seg\xfan el texto de Baroni 'Resistir en silencio'?",B.ND,"C","Ante el cierre de la Licenciatura y la orientaci\xf3n restrictiva de la EUP, los grupos de estudio privados se convirtieron en espacios cruciales de formaci\xf3n, discusi\xf3n y resistencia acad\xe9mica para los estudiantes y profesionales de la psicolog\xeda durante la dictadura.")
B.J1=A.a(s(["El debilitamiento del sistema educativo y la administraci\xf3n del Estado.","La expansi\xf3n econ\xf3mica, la industrializaci\xf3n y el fortalecimiento del sistema educativo y la administraci\xf3n del Estado.","La llegada masiva de una aristocracia europea.",""]),t.s)
B.a9A=new A.c("5","El 'ascenso de las clases medias' a principios del siglo XX en Uruguay, seg\xfan Germ\xe1n Rama, estuvo posibilitado por:",B.J1,"B","El Documento de Trabajo 5 explica que este fen\xf3meno de transformaci\xf3n demogr\xe1fica 'acontece como consecuencia de la expansi\xf3n econ\xf3mica, la industrializaci\xf3n, el fortalecimiento del sistema educativo y la expansi\xf3n de la administraci\xf3n del Estado'.")
B.P3=A.a(s(["El Test de Asociaci\xf3n de Palabras de Jung.","El Psicodiagn\xf3stico Miokin\xe9tico (PMK).","El electroencefalograma.",""]),t.s)
B.a2B=new A.c("6","En el estudio del 'normotipo uruguayo', \xbfqu\xe9 t\xe9cnica de diagn\xf3stico promovida por Mira y L\xf3pez fue central?",B.P3,"B","El Documento de Trabajo 6 destaca que Mira y L\xf3pez abord\xf3 'la aplicabilidad del Psicoadiagn\xf3stico Mioquin\xe9tico' y que uno de los equipos de la secci\xf3n psicol\xf3gica fue el de 'Equipo de Psicodiagn\xf3stico Miokin\xe9tico'.")
B.Kg=A.a(s(["La falta de inter\xe9s de los estudiantes en la carrera de psicolog\xeda.","La culminaci\xf3n simult\xe1nea de los planes de la EUP y Psicolog\xeda Infantil, el alto crecimiento de la matr\xedcula y la falta de presupuesto.","La oposici\xf3n de los gremios de psic\xf3logos a la unificaci\xf3n de la formaci\xf3n.",""]),t.s)
B.a98=new A.c("8","El plan de estudios del IPUR de 1988 enfrent\xf3 dificultades iniciales como:",B.Kg,"B","El Documento de Trabajo 8 detalla los inconvenientes del IPUR: 'la existencia de dos planes de estudios EUP y Psicolog\xeda Infantil que deb\xedan culminar sus cursos al mismo tiempo que deb\xeda comenzar el plan 88... otra dificultad se ve\xeda en el alto crecimiento de la matricula estudiantil y la falta de presupuesto'.")
B.KD=A.a(s(["Un plan para privatizar la Universidad de la Rep\xfablica.","Un proyecto de reforma institucional que buscaba priorizar la investigaci\xf3n cient\xedfica sobre la orientaci\xf3n puramente profesionalista de la UDELAR.","Un plan econ\xf3mico para reducir el presupuesto de la educaci\xf3n.",""]),t.s)
B.a1j=new A.c("7","Seg\xfan el Documento de Trabajo 7, \xbfqu\xe9 fue el 'Plan Maggiolo' de 1967?",B.KD,"B","El Documento de Trabajo 7 describe el 'Plan Maggiolo' como un 'ambicioso proyecto de reforma institucional' que 'resum\xeda la intenci\xf3n de reforma estructural y de priorizaci\xf3n de la investigaci\xf3n cient\xedfica de un sector destacado de docentes'.")
B.Op=A.a(s(["Prohibi\xf3 el ejercicio de la psicolog\xeda a todos los egresados de la UDELAR.","Cre\xf3 una Comisi\xf3n Especial para que los profesionales con 'competencia notoria y t\xedtulo diferente' pudieran solicitar la habilitaci\xf3n para ejercer.","Estableci\xf3 que solo los m\xe9dicos pod\xedan ejercer la psicoterapia.",""]),t.s)
B.a45=new A.c("8","El Art\xedculo 3\xb0 de la Ley del Psic\xf3logo (N\xb0 17.154) fue importante porque:",B.Op,"B","El Documento de Trabajo 8 incluye el texto de la Ley. El Art. 3\xb0 establece que 'Los profesionales de la psicolog\xeda que... tengan competencia notoria y t\xedtulo diferente, y no cumplan con los requisitos exigidos en el art\xedculo 2\xb0, podr\xe1n solicitar la habilitaci\xf3n de su t\xedtulo para el ejercicio de la profesi\xf3n ante la Comisi\xf3n Especial'.")
B.Ol=A.a(s(["Exclusivamente al conjunto de instituciones del Estado (parlamento, ministerios, etc.).","A los esquemas, c\xe1lculos y estrategias para la 'conducci\xf3n de la conducta' de las personas, ejercidos por m\xfaltiples autoridades.","Al autogobierno individual sin ninguna forma de poder externo.",""]),t.s)
B.Xw=new A.c("9","\xbfA qu\xe9 se refiere Nikolas Rose con el concepto de 'gobierno' o 'gubernamentalidad'?",B.Ol,"B",'Rose, siguiendo a Foucault, entiende por gobierno \'un modo de pensar acerca del poder pol\xedtico y de intentar ejercerlo: el territorio delimitado por el sinn\xfamero de esquemas, sue\xf1os, c\xe1lculos y estrategias para la ""conducci\xf3n de la conducta"" que proliferaron durante los dos \xfaltimos siglos\'.')
B.L4=A.a(s(["La Sociedad de Psiquiatr\xeda del Uruguay.","La 'Uni\xf3n de Psic\xf3logos del Uruguay'.","La Asociaci\xf3n de Estudiantes de Psicolog\xeda.",""]),t.s)
B.a9n=new A.c("8","En el proceso de reglamentaci\xf3n de la profesi\xf3n, \xbfqu\xe9 asociaci\xf3n expres\xf3 su preocupaci\xf3n por los profesionales no contemplados en el proyecto inicial, generando un nuevo debate?",B.L4,"B","El Documento de Trabajo 8 relata que en agosto de 1996, 'representantes de la denominada \"\"Uni\xf3n de Psic\xf3logos del Uruguay\"\"' se presentaron ante la Comisi\xf3n de Salud expresando su preocupaci\xf3n porque los profesionales que agrupaban 'no estaban contemplados en la fr\xeda letra del proyecto'.")
B.P8=A.a(s(["Fortalecer la investigaci\xf3n en un campo de fuerte desarrollo mundial pero con menor tradici\xf3n en el pa\xeds.","Limitar la investigaci\xf3n psicol\xf3gica exclusivamente al \xe1rea cl\xednica.","Promover \xfanicamente la investigaci\xf3n con animales de laboratorio.",""]),t.s)
B.a48=new A.c("8","La creaci\xf3n del Centro de Investigaci\xf3n B\xe1sica en Psicolog\xeda (CIB-Psi) en 2010 tuvo como objetivo:",B.P8,"A","El Documento de Trabajo 8 se\xf1ala que se cre\xf3 el CIB-Psi 'con el objetivo de fortalecer la investigaci\xf3n cient\xedfica en uno de los campos con menor tradici\xf3n de la Psicolog\xeda en nuestro pa\xeds, pero con fuerte desarrollo a nivel mundial'.")
B.L2=A.a(s(["Emilio Mira y L\xf3pez.","Laura Achard.","Waclaw Radecki.",""]),t.s)
B.a2K=new A.c("6","\xbfQu\xe9 figura fue central en la introducci\xf3n del psicoan\xe1lisis en la Cl\xednica M\xe9dico Psicol\xf3gica y en la formaci\xf3n de psicoanalistas de ni\xf1os en Uruguay?",B.L2,"B","El Documento de Trabajo 6 destaca el rol de Laura Achard, jefa de la Secci\xf3n Psicot\xe9cnica de la Cl\xednica, quien se form\xf3 en psicoan\xe1lisis y a quien se asocia con el plan de 'estudio psicoanal\xedtico de algunos ni\xf1os' y la 'formaci\xf3n de psicoanalistas especializados en ni\xf1os en el Uruguay'.")
B.Si=A.a(s(["El ascetismo, el ahorro y la moderaci\xf3n en todas las costumbres.","La violencia f\xedsica, y los excesos en el ocio, el juego y la sexualidad.","El estricto cumplimiento de las leyes y el respeto a la autoridad central.",""]),t.s)
B.ab5=new A.c("4","La 'sensibilidad b\xe1rbara' que el gobierno uruguayo buscaba transformar en el siglo XIX se caracterizaba por:",B.Si,"B","El Documento de Trabajo 4, citando a Jos\xe9 Pedro Barr\xe1n, describe la 'sensibilidad b\xe1rbara' (1800-1860) como caracterizada por 'la pr\xe1ctica y justificaci\xf3n de la violencia f\xedsica' y por 'los excesos en el ocio, el juego, la sexualidad, la violencia'.")
B.QI=A.a(s(["Redujo dr\xe1sticamente el campo laboral para los psic\xf3logos.","Gener\xf3 una contrataci\xf3n masiva de psic\xf3logos, ampliando su campo laboral y convirtiendo las pol\xedticas sociales en un nuevo objeto de investigaci\xf3n.","Provoc\xf3 que la psicolog\xeda abandonara el campo cl\xednico para centrarse solo en lo social.",""]),t.s)
B.a3H=new A.c("9","Seg\xfan el Documento de Trabajo 9, \xbfcu\xe1l fue uno de los efectos de la creaci\xf3n del MIDES en 2005 para la psicolog\xeda?",B.QI,"B","El documento se\xf1ala que con la creaci\xf3n del MIDES, 'la pr\xe1ctica psicol\xf3gica pudo desplegarse en diversos campos asociados a las distintas pol\xedticas sociales', lo que 'tuvo como consecuencia el reconocimiento social de la disciplina y la ampliaci\xf3n del campo laboral para la psicolog\xeda'.")
B.Jd=A.a(s(["Lo aceler\xf3, implementando inmediatamente el ciclo de Doctorado.","No tuvo ning\xfan efecto, ya que la investigaci\xf3n continu\xf3 sin cambios.","Provoc\xf3 un retroceso de d\xe9cadas, relegando la investigaci\xf3n psicol\xf3gica a un segundo plano.",""]),t.s)
B.a8s=new A.c("9","\xbfQu\xe9 efecto tuvo la dictadura c\xedvico-militar (1973-1984) sobre el intento de academizaci\xf3n de la psicolog\xeda que se hab\xeda esbozado en el plan de estudios de 1971?",B.Jd,"C","El Documento de Trabajo 9 afirma que el plan de 1971, que inclu\xeda un ciclo de Doctorado, marcaba el camino a la academizaci\xf3n, pero que 'por motivos de la intervenci\xf3n militar, aquel plan no fue llevado a cabo. El efecto de esta intervenci\xf3n fue un retroceso de casi m\xe1s de dos d\xe9cadas... donde la investigaci\xf3n psicolog\xeda en la Universidad qued\xf3 relegada a un segundo plano'.")
