B.Qi=A.a(s(["Es un modelo alternativo al socioconstructivismo y al relativismo, que permite explicar el desarrollo de la ciencia de forma objetiva.","Explica que los actores son plenamente conscientes y racionales en sus elecciones, dejando de lado los factores sociales.","Sostiene que solo se pueden estudiar los procesos del conocimiento a partir de sus componentes individuales, obviando los sociales.",""]),t.s)
B.zA=new A.c("1","\xbfQu\xe9 plantea la teor\xeda de la racionalidad de la acci\xf3n en relaci\xf3n con la sociolog\xeda del conocimiento cient\xedfico?",B.Qi,"A","La teor\xeda de la racionalidad de la acci\xf3n busca ofrecer una alternativa a las perspectivas socioconstructivistas y relativistas, argumentando que la racionalidad de los cient\xedficos puede explicar el progreso cient\xedfico de manera m\xe1s objetiva, sin negar la influencia de factores sociales pero sin reducirlos a ellos.")
B.Lt=A.a(s(["Explicar c\xf3mo se desarrollan teor\xedas cient\xedficas verdaderas, independientemente de su contexto social.","Investigar las causas sociales de la creencia y del conocimiento, aplicando los mismos principios a teor\xedas 'verdaderas' y 'falsas'.","Criticar la ciencia y desacreditarla, mostrando que todo el conocimiento es relativo.",""]),t.s)
B.zq=new A.c("1","\xbfCu\xe1l es el prop\xf3sito central del programa fuerte de la sociolog\xeda del conocimiento cient\xedfico, propuesto por la Escuela de Edimburgo?",B.Lt,"B","El programa fuerte (strong programme) de la sociolog\xeda del conocimiento cient\xedfico busca explicar el conocimiento cient\xedfico de la misma manera que otros fen\xf3menos sociales, prestando atenci\xf3n a las causas sociales de las creencias, sin distinci\xf3n entre \xe9xito o fracaso, verdad o falsedad.")
B.PQ=A.a(s(["Una teor\xeda cient\xedfica individual que puede ser falseada.","Un conjunto de m\xe9todos y t\xe9cnicas de laboratorio.","Un sistema de creencias, valores, t\xe9cnicas y problemas compartidos por una comunidad cient\xedfica en un momento dado.",""]),t.s)
B.zy=new A.c("1","Seg\xfan Thomas Kuhn, \xbfqu\xe9 es un 'paradigma' en la ciencia?",B.PQ,"C","Kuhn define el paradigma como el marco conceptual, metodol\xf3gico y de valores que gu\xeda la investigaci\xf3n y la pr\xe1ctica de una comunidad cient\xedfica, determinando qu\xe9 es un problema v\xe1lido y qu\xe9 es una soluci\xf3n aceptable.")
B.Rb=A.a(s(["Que una teor\xeda es cient\xedfica si puede ser probada como verdadera mediante la observaci\xf3n.","Que una teor\xeda es cient\xedfica si puede ser refutada o demostrada como falsa mediante pruebas emp\xedricas.","Que todas las teor\xedas cient\xedficas son inherentemente falsas.",""]),t.s)
B.zD=new A.c("1","Karl Popper, en su filosof\xeda de la ciencia, propone el criterio de 'falsabilidad'. \xbfQu\xe9 implica esto?",B.Rb,"B","La falsabilidad es el criterio de demarcaci\xf3n de Popper: una teor\xeda es cient\xedfica si es posible dise\xf1ar experimentos o observaciones que, en principio, podr\xedan demostrar su falsedad, a diferencia de teor\xedas que siempre pueden ser 'salvadas' de la refutaci\xf3n.")
B.RK=A.a(s(["Se centran en la falsaci\xf3n de teor\xedas individuales de forma aislada.","Consisten en una secuencia de teor\xedas conectadas, con un 'n\xfacleo firme' protegido y un 'cintur\xf3n protector' de hip\xf3tesis auxiliares.","Son m\xe9todos para confirmar las teor\xedas a trav\xe9s de la acumulaci\xf3n de pruebas positivas.",""]),t.s)
B.zG=new A.c("1","Imre Lakatos introdujo la noci\xf3n de 'programas de investigaci\xf3n cient\xedfica'. \xbfCu\xe1l es su caracter\xedstica principal?",B.RK,"B","Un programa de investigaci\xf3n es una serie de teor\xedas relacionadas donde el 'n\xfacleo firme' son las hip\xf3tesis irrefutables por decisi\xf3n metodol\xf3gica, y el 'cintur\xf3n protector' son hip\xf3tesis auxiliares modificables para proteger el n\xfacleo de las refutaciones.")
B.or=A.a(s(["Que diferentes paradigmas pueden ser comparados y evaluados usando los mismos criterios.","Que los conceptos y m\xe9todos de diferentes paradigmas son fundamentalmente incompatibles y no pueden ser comparados directamente.","Que la ciencia progresa acumulando conocimiento de forma lineal y continua.",""]),t.s)
B.a90=new A.c("1","\xbfQu\xe9 significa el concepto de 'inconmensurabilidad' seg\xfan Kuhn?",B.or,"B",u.dX)
B.OG=A.a(s(["Es un error que debe ser eliminado de inmediato de la pr\xe1ctica cient\xedfica.","Son preconcepciones, h\xe1bitos mentales o prejuicios que dificultan la producci\xf3n de conocimiento nuevo.","Es una etapa necesaria en el proceso de verificaci\xf3n de una hip\xf3tesis.",""]),t.s)
B.zs=new A.c("1","Seg\xfan Gaston Bachelard, \xbfqu\xe9 papel juega el 'obst\xe1culo epistemol\xf3gico' en la ciencia?",B.OG,"B","Para Bachelard, el obst\xe1culo epistemol\xf3gico no es la ignorancia, sino el conocimiento anterior (errores, ideas preconcebidas) que, en lugar de ayudar, se interpone en el camino de la verdadera comprensi\xf3n y del progreso cient\xedfico.")
B.PB=A.a(s(["La forma individual en que cada cient\xedfico concibe sus hip\xf3tesis.","Un conjunto de costumbres, principios y m\xe9todos que caracterizan el conocimiento dentro de una comunidad de pensamiento.","Un dogma que impide la creatividad cient\xedfica.",""]),t.s)
B.zB=new A.c("1","Para Ludwik Fleck, \xbfqu\xe9 es un 'estilo de pensamiento' (Denkstil)?",B.PB,"B","Fleck introduce el concepto de 'estilo de pensamiento' para referirse a la manera peculiar en que una comunidad (colectivo de pensamiento) percibe, experimenta y conceptualiza la realidad, lo cual influye en la producci\xf3n del conocimiento.")
B.Li=A.a(s(["La ciencia normal es experimental y la revoluci\xf3n cient\xedfica es te\xf3rica.","La ciencia normal trabaja dentro de un paradigma establecido, mientras que la revoluci\xf3n cient\xedfica implica un cambio de paradigma.","La ciencia normal es ineficaz y la revoluci\xf3n cient\xedfica es siempre exitosa.",""]),t.s)
B.zC=new A.c("1","\xbfCu\xe1l es la principal diferencia entre la 'ciencia normal' y la 'revoluci\xf3n cient\xedfica' seg\xfan Kuhn?",B.Li,"B","La ciencia normal se caracteriza por la resoluci\xf3n de 'enigmas' dentro de los l\xedmites de un paradigma existente. Una revoluci\xf3n cient\xedfica ocurre cuando las 'anomal\xedas' desaf\xedan el paradigma, llevando a su abandono y la adopci\xf3n de uno nuevo.")
B.PZ=A.a(s(["El conocimiento cient\xedfico es el resultado de la genialidad de individuos aislados.","El conocimiento es un producto social que se desarrolla y sostiene dentro de una colectividad.","La comunidad de pensamiento solo se encarga de difundir el conocimiento, no de producirlo.",""]),t.s)
B.zx=new A.c("1","\xbfC\xf3mo se relaciona la 'comunidad de pensamiento' de Fleck con la producci\xf3n de conocimiento cient\xedfico?",B.PZ,"B","Fleck enfatiza que el conocimiento no es un descubrimiento individual, sino una construcci\xf3n colectiva. Un 'colectivo de pensamiento' es el portador del estilo de pensamiento y el lugar donde se valida y modifica el conocimiento.")
B.LW=A.a(s(["Ser demasiado objetiva e imparcial.","Promover la diversidad de perspectivas en la investigaci\xf3n.","Excluir las experiencias y perspectivas de las mujeres, y perpetuar sesgos de g\xe9nero.",""]),t.s)
B.zv=new A.c("2","La epistemolog\xeda feminista critica la ciencia tradicional por:",B.LW,"C","Critica c\xf3mo la ciencia ha sido construida desde una perspectiva androc\xe9ntrica, excluyendo o devaluando el conocimiento femenino y perpetuando estereotipos de g\xe9nero en la investigaci\xf3n y sus resultados.")
B.N0=A.a(s(["Abandonar por completo la idea de objetividad.","Una 'objetividad fuerte' o 'situada', que reconoce las perspectivas de los sujetos cognoscentes.","Que solo las mujeres pueden producir conocimiento objetivo.",""]),t.s)
B.zu=new A.c("2","\xbfQu\xe9 propone la epistemolog\xeda feminista como alternativa a la noci\xf3n tradicional de 'objetividad'?",B.N0,"B","Argumentan que la objetividad no es un punto de vista 'desde ning\xfan lugar', sino que siempre est\xe1 situada. Promueven una objetividad que es m\xe1s rigurosa al reconocer y reflexionar sobre las propias ubicaciones y sesgos.")
B.Pr=A.a(s(["Una 'objetividad d\xe9bil' que ignora las perspectivas y sesgos.","Una 'objetividad fuerte' que incluye m\xfaltiples puntos de vista.","Un compromiso \xe9tico inquebrantable con la neutralidad.",""]),t.s)
B.zH=new A.c("2","Sandra Harding, una figura clave en la epistemolog\xeda feminista, sostiene que la ciencia tradicional se ha caracterizado por:",B.Pr,"A","Harding critica la 'objetividad d\xe9bil' que pretende ser neutral pero enmascara sesgos, y propone la 'objetividad fuerte' que se logra al reconocer y tener en cuenta las m\xfaltiples perspectivas, especialmente las de los grupos marginados.")
B.MT=A.a(s(["Que el conocimiento solo es v\xe1lido en ciertas situaciones.","Que todo conocimiento es parcial y se produce desde una ubicaci\xf3n espec\xedfica (social, hist\xf3rica, cultural).","Que solo el conocimiento local es relevante para la investigaci\xf3n.",""]),t.s)
B.zE=new A.c("2","\xbfQu\xe9 significa la 'situaci\xf3n del conocimiento' o 'conocimiento situado' en la epistemolog\xeda feminista?",B.MT,"B","El conocimiento situado es una respuesta a la pretensi\xf3n de universalidad y neutralidad. Reconoce que el conocimiento siempre es producido por sujetos encarnados y ubicados en contextos espec\xedficos, lo que influye en lo que se conoce y c\xf3mo se conoce.")
B.Ob=A.a(s(["La importancia de la experiencia personal de cada cient\xedfico como base \xfanica del conocimiento.","Que gran parte de nuestro conocimiento se adquiere a trav\xe9s de lo que otros nos dicen.","Que solo se debe confiar en el conocimiento derivado de la observaci\xf3n directa.",""]),t.s)
B.zt=new A.c("2","La noci\xf3n de 'testimonio' o 'conocimiento testimonial' en la epistemolog\xeda contempor\xe1nea destaca:",B.Ob,"B","La epistemolog\xeda del testimonio subraya que la mayor\xeda de nuestro conocimiento (tanto en la vida cotidiana como en la ciencia) no proviene de nuestra propia experiencia directa, sino de lo que aprendemos de otros a trav\xe9s del lenguaje.")
B.Nm=A.a(s(["Su \xe9nfasis en la importancia de la experimentaci\xf3n.","Su creencia en que la ciencia es un proceso neutral, objetivo y libre de valores.","Su aceptaci\xf3n de la metaf\xedsica como una parte fundamental de la investigaci\xf3n cient\xedfica.",""]),t.s)
B.zF=new A.c("2","\xbfCu\xe1l es una de las principales cr\xedticas a la visi\xf3n positivista de la ciencia desde la epistemolog\xeda contempor\xe1nea?",B.Nm,"B","El positivismo defend\xeda la idea de una ciencia libre de valores, que solo describe hechos. La epistemolog\xeda contempor\xe1nea, influenciada por Kuhn y otros, destaca el papel de los valores, los intereses y el contexto social en la producci\xf3n cient\xedfica.")
B.LY=A.a(s(["Es irrelevante, ya que la ciencia se basa solo en la evidencia emp\xedrica.","Es fundamental, ya que los cient\xedficos dependen del trabajo y la credibilidad de otros.","Solo es importante en las etapas iniciales de una investigaci\xf3n.",""]),t.s)
