B.oG=A.a(s(["Que no se enfoca lo suficiente en la felicidad.","Que es demasiado pesimista y se centra en los problemas.","Que puede presionar a los individuos a ser 'felices' y responsables de su propio bienestar, ignorando los determinantes sociales.",""]),t.s)
B.XB=new A.c("8",u.aT,B.oG,"C",u.C)
B.pl=A.a(s(["El deber de los profesionales de la salud mental.","La tendencia a atribuir la causa y la soluci\xf3n de los problemas de salud mental exclusivamente al individuo.","La importancia de la comunidad en la prevenci\xf3n de enfermedades.",""]),t.s)
B.a7O=new A.c("8",u.f5,B.pl,"B","Esta tendencia individualiza los problemas, haciendo que la persona se sienta \xfanica responsable de su bienestar o enfermedad, lo que puede desviar la atenci\xf3n de factores sociales, econ\xf3micos o pol\xedticos m\xe1s amplios.")
B.Mr=A.a(s(["Que los pacientes quieren dirigir su propio tratamiento.","El empoderamiento de las personas con experiencia en salud mental para influir en pol\xedticas y pr\xe1cticas.","La pasividad de los pacientes ante el sistema m\xe9dico.",""]),t.s)
B.aaf=new A.c("8","\xbfQu\xe9 significa el 'activismo de los pacientes' o 'movimientos de usuarios' en salud mental?",B.Mr,"B","Estos movimientos buscan desafiar el modelo biom\xe9dico hegem\xf3nico, promoviendo una visi\xf3n m\xe1s centrada en la recuperaci\xf3n, el empoderamiento y la participaci\xf3n de los propios usuarios en el dise\xf1o de los servicios y pol\xedticas.")
B.Tq=A.a(s(["Que se ignoren los avances en neurociencia.","Que se pierda de vista la importancia de los factores psicol\xf3gicos, sociales y culturales.","Que se promuevan tratamientos puramente psicol\xf3gicos.",""]),t.s)
B.a3k=new A.c("8","Desde una perspectiva cr\xedtica, \xbfcu\xe1l es el riesgo de ver la salud mental \xfanicamente como un asunto 'cerebral' o 'biol\xf3gico'?",B.Tq,"B","Un modelo puramente biom\xe9dico tiende a reducir la complejidad de los problemas de salud mental a desequilibrios qu\xedmicos o disfunciones cerebrales, dejando de lado el papel crucial de las relaciones, el contexto social y las experiencias de vida.")
B.Pb=A.a(s(["La eficacia de los psicof\xe1rmacos.","La hegemon\xeda del modelo biom\xe9dico y la medicalizaci\xf3n de la vida.","La existencia de las enfermedades mentales.",""]),t.s)
B.a7K=new A.c("8","La 'psiquiatr\xeda cr\xedtica' cuestiona:",B.Pb,"B","Busca una aproximaci\xf3n m\xe1s hol\xedstica a la salud mental, reconociendo el papel de los factores sociales, econ\xf3micos y pol\xedticos, y criticando la tendencia a medicalizar y patologizar la experiencia humana.")
B.Tb=A.a(s(["Diversidad humana.","Normalizaci\xf3n patol\xf3gica.","Biopoder y gubernamentalidad (Foucault).",""]),t.s)
B.a0Z=new A.c("8","\xbfQu\xe9 concepto describe la tendencia de la sociedad a normalizar y clasificar las conductas seg\xfan criterios estad\xedsticos y m\xe9dicos?",B.Tb,"C","Foucault analiza c\xf3mo el biopoder opera a trav\xe9s de mecanismos de normalizaci\xf3n, que establecen est\xe1ndares para lo 'normal' y lo 'anormal' en la poblaci\xf3n, permitiendo la intervenci\xf3n y el control.")
B.S0=A.a(s(["Estudiar los procesos biol\xf3gicos que subyacen a la conducta.","Investigar c\xf3mo los conceptos psicol\xf3gicos y la realidad social se construyen a trav\xe9s del lenguaje y la interacci\xf3n.","Encontrar leyes universales del comportamiento humano.",""]),t.s)
B.Zb=new A.c("9","\xbfCu\xe1l es el principal objetivo del 'construccionismo social' en psicolog\xeda?",B.S0,"B","El construccionismo social (Gergen, Burr) enfatiza que la realidad (incluyendo la psicol\xf3gica) no es dada, sino que se construye a trav\xe9s de procesos sociales, culturales e hist\xf3ricos, especialmente a trav\xe9s del lenguaje y el discurso.")
B.S3=A.a(s(["La verdad es absoluta e independiente del contexto.","La verdad es relativa y solo existe en la mente individual.","Las 'verdades' en psicolog\xeda son construcciones sociales y culturales, no reflejos directos de una realidad objetiva.",""]),t.s)
B.ab6=new A.c("9","Desde una perspectiva construccionista social, \xbfqu\xe9 se dice sobre la 'verdad' en psicolog\xeda?",B.S3,"C","El construccionismo social cuestiona la idea de una verdad universal y atemporal. Las teor\xedas psicol\xf3gicas son vistas como formas de entender el mundo que surgen en contextos sociales espec\xedficos y tienen consecuencias particulares.")
B.RM=A.a(s(["La introspecci\xf3n individual.","La neurociencia cognitiva.","El lenguaje y la conversaci\xf3n en la construcci\xf3n de la realidad y la identidad.",""]),t.s)
B.a5k=new A.c("9","Kenneth Gergen, una figura clave del construccionismo social, enfatiza la importancia de:",B.RM,"C","Gergen subraya c\xf3mo nuestras identidades, emociones y la comprensi\xf3n de nosotros mismos y del mundo se forman y se mantienen a trav\xe9s de las interacciones ling\xfc\xedsticas y las narrativas compartidas.")
B.T7=A.a(s(["Que es demasiado centrado en el individuo.","Que conduce al relativismo extremo y a la negaci\xf3n de la realidad.","Que no presta suficiente atenci\xf3n a la cultura.",""]),t.s)
B.Yy=new A.c("9","\xbfCu\xe1l es una de las cr\xedticas comunes al construccionismo social?",B.T7,"B","Una cr\xedtica frecuente es que, al enfatizar la construcci\xf3n social de la realidad, el construccionismo puede parecer que niega la existencia de una realidad objetiva externa, lo que a menudo lleva a acusaciones de relativismo.")
B.Nf=A.a(s(["Las historias personales no tienen relevancia para la terapia.","La identidad y el sentido de s\xed mismo se construyen a trav\xe9s de las historias que contamos y vivimos.","Solo las narrativas cient\xedficas son importantes.",""]),t.s)
B.a3u=new A.c("9","El enfoque 'narrativo' en psicolog\xeda sostiene que:",B.Nf,"B","Las terapias narrativas, por ejemplo, trabajan con c\xf3mo las personas construyen sus vidas a trav\xe9s de relatos, y c\xf3mo la modificaci\xf3n de esas narrativas puede llevar a cambios en la identidad y en la forma de enfrentar los problemas.")
B.RC=A.a(s(["Que la depresi\xf3n siempre ha existido de la misma forma.","Que su significado y existencia como categor\xeda se desarrollan y cambian a lo largo de la historia y la cultura.","Que solo ocurre en ciertas \xe9pocas.",""]),t.s)
B.a2Z=new A.c("9","\xbfQu\xe9 significa que un concepto (ej. 'depresi\xf3n') es 'hist\xf3ricamente contingente' desde el construccionismo social?",B.RC,"B","Implica que categor\xedas como 'depresi\xf3n' no son descubrimientos atemporales de la naturaleza humana, sino que su comprensi\xf3n, sus s\xedntomas y su tratamiento est\xe1n ligados a contextos sociales, culturales y discursivos espec\xedficos de un momento hist\xf3rico.")
B.Ss=A.a(s(["Una disfunci\xf3n cerebral inherente al individuo.","Una construcci\xf3n social que emerge en la interacci\xf3n y el lenguaje.","Un estado universal de sufrimiento humano.",""]),t.s)
B.a0D=new A.c("9","Desde el construccionismo social, el 'problema' o 'trastorno' se considera:",B.Ss,"B","En lugar de ver los problemas como entidades preexistentes, el construccionismo los ve como algo que se 'problematiza' o se 'construye' a trav\xe9s de las conversaciones, las narrativas dominantes y las pr\xe1cticas sociales.")
B.J9=A.a(s(["El terapeuta debe ser un experto neutral que solo observa.","El terapeuta y el cliente deben reflexionar conjuntamente sobre c\xf3mo se construyen sus realidades y los problemas.","Solo el cliente debe reflexionar sobre su propia vida.",""]),t.s)
B.a3r=new A.c("9","\xbfQu\xe9 rol juega la 'reflexividad' en la pr\xe1ctica terap\xe9utica desde una perspectiva construccionista?",B.J9,"B","La reflexividad compartida permite que tanto el terapeuta como el cliente examinen cr\xedticamente las narrativas y las construcciones sociales que dan forma a sus vidas y a los problemas, abriendo espacio para nuevas posibilidades.")
B.RZ=A.a(s(["Un simple acto de hablar.","Un conjunto de pr\xe1cticas ling\xfc\xedsticas que construyen la realidad, definen lo que se puede decir y pensar, y ejercen poder.","Un debate pol\xedtico.",""]),t.s)
B.a1p=new A.c("9","\xbfQu\xe9 es el 'discurso' en el sentido que lo usa Foucault (y adoptado por el construccionismo social)?",B.RZ,"B","El discurso no es solo lenguaje, sino un sistema de significado y poder que produce lo que se considera 'verdadero', 'normal' o 'real' en un contexto determinado, configurando sujetos y objetos.")
B.N4=A.a(s(["Promover el uso exclusivo de f\xe1rmacos.","Retirar el estatus de 'enfermedad' a problemas que no son fundamentalmente m\xe9dicos, y buscar abordajes alternativos.","Incrementar la dependencia de los servicios de salud.",""]),t.s)
B.a5b=new A.c("9","La 'desmedicalizaci\xf3n' de ciertos fen\xf3menos busca:",B.N4,"B","Es un movimiento que busca contrarrestar la medicalizaci\xf3n excesiva, argumentando que muchos problemas pueden ser mejor comprendidos y abordados desde perspectivas sociales, psicol\xf3gicas o educativas, sin convertirlos en diagn\xf3sticos m\xe9dicos.")
B.Rl=A.a(s(["El estudio de la psicolog\xeda individual en contextos de abundancia.","Abordar los problemas psicol\xf3gicos en el contexto de la opresi\xf3n social, la injusticia y la b\xfasqueda de la emancipaci\xf3n.","Promover una psicolog\xeda neutral y despolitizada.",""]),t.s)
B.a4_=new A.c("10","\xbfCu\xe1l es el foco principal de la 'psicolog\xeda de la liberaci\xf3n'?",B.Rl,"B","Desarrollada principalmente en Am\xe9rica Latina (Ignacio Mart\xedn-Bar\xf3), busca una psicolog\xeda comprometida con los problemas sociales, analizando c\xf3mo la opresi\xf3n impacta la salud mental y c\xf3mo la psicolog\xeda puede contribuir a la liberaci\xf3n y el cambio social.")
B.RJ=A.a(s(["Eliminar todas las ideolog\xedas de la ciencia.","Hacer expl\xedcitos los supuestos y valores subyacentes a la teor\xeda y pr\xe1ctica psicol\xf3gica, para no perpetuar la opresi\xf3n.","Adoptar una \xfanica ideolog\xeda cient\xedfica.",""]),t.s)
B.a5w=new A.c("10","Ignacio Mart\xedn-Bar\xf3, figura central de la psicolog\xeda de la liberaci\xf3n, plante\xf3 la necesidad de una 'desideologizaci\xf3n' de la psicolog\xeda. \xbfQu\xe9 significa esto?",B.RJ,"B","Mart\xedn-Bar\xf3 argumentaba que la psicolog\xeda, al igual que otras ciencias, no es neutral y a menudo reproduce ideolog\xedas dominantes. La desideologizaci\xf3n busca un an\xe1lisis cr\xedtico para revelar y transformar esos sesgos.")
B.NZ=A.a(s(["El acto de hacer que alguien sea consciente de sus errores.","El proceso por el cual las personas oprimidas desarrollan una comprensi\xf3n cr\xedtica de su situaci\xf3n y de las causas de su opresi\xf3n.","Un m\xe9todo de terapia individual.",""]),t.s)
B.a2p=new A.c("10","\xbfQu\xe9 es la 'concientizaci\xf3n' en la psicolog\xeda de la liberaci\xf3n (inspirada en Paulo Freire)?",B.NZ,"B","Es un proceso pedag\xf3gico y pol\xedtico que permite a los individuos y comunidades comprender las estructuras de poder que los oprimen y desarrollar la agencia para transformarlas, pasando de una conciencia ingenua a una conciencia cr\xedtica.")
B.RS=A.a(s(["Un trauma individual causado por un accidente.","El impacto psicol\xf3gico de la violencia estructural, la opresi\xf3n y los conflictos sociales en individuos y comunidades.","Un tipo de terapia para el trauma.",""]),t.s)
B.a7M=new A.c("10","La 'trauma psicosocial' en psicolog\xeda de la liberaci\xf3n se refiere a:",B.RS,"B","Reconoce que el sufrimiento psicol\xf3gico no es solo el resultado de experiencias individuales, sino que tambi\xe9n es generado por condiciones sociales, econ\xf3micas y pol\xedticas de injusticia y violencia colectiva.")
B.R6=A.a(s(["Mantenerse neutral y objetivo, sin involucrarse en problemas sociales.","Actuar como un agente de cambio social, comprometido con la transformaci\xf3n de las condiciones de opresi\xf3n.","Limitarse a la pr\xe1ctica cl\xednica individual.",""]),t.s)
B.a_a=new A.c("10","\xbfCu\xe1l es el papel del psic\xf3logo en la psicolog\xeda de la liberaci\xf3n?",B.R6,"B","El psic\xf3logo es visto como un actor pol\xedtico y \xe9tico que utiliza su conocimiento y habilidades para empoderar a las comunidades, fomentar la conciencia cr\xedtica y trabajar hacia la justicia social.")
B.M1=A.a(s(["Una verdad universal y abstracta.","Una construcci\xf3n que emerge del di\xe1logo y la pr\xe1ctica en contextos espec\xedficos, especialmente la de los oprimidos.","Una verdad impuesta por la ideolog\xeda dominante.",""]),t.s)
B.a9w=new A.c("10","La 'verdad' en la psicolog\xeda de la liberaci\xf3n se entiende como:",B.M1,"B","Se valora el conocimiento que emerge de la experiencia y la lucha de los grupos oprimidos, promoviendo una epistemolog\xeda que da voz a las perspectivas marginadas y busca la transformaci\xf3n de la realidad.")
B.Pc=A.a(s(["Es irrelevante, ya que la psicolog\xeda se centra en el presente.","Es fundamental para comprender el impacto del pasado de opresi\xf3n y conflicto en la salud mental y la identidad de las comunidades.","Se refiere solo a la memoria individual.",""]),t.s)
B.a_9=new A.c("10","\xbfC\xf3mo se relaciona la 'memoria hist\xf3rica' con la psicolog\xeda de la liberaci\xf3n?",B.Pc,"B","La recuperaci\xf3n de la memoria hist\xf3rica es crucial para la elaboraci\xf3n del trauma colectivo, la resistencia a la amnesia impuesta y la construcci\xf3n de futuros m\xe1s justos.")
B.Le=A.a(s(["Un ideal a alcanzar para garantizar la objetividad.","Una ilusi\xf3n o una forma encubierta de apoyar el status quo y la opresi\xf3n.","Una caracter\xedstica esencial de la pr\xe1ctica \xe9tica.",""]),t.s)
B.a7q=new A.c("10","En la psicolog\xeda de la liberaci\xf3n, la 'neutralidad' del psic\xf3logo es vista como:",B.Le,"B","Mart\xedn-Bar\xf3 argumenta que la neutralidad en contextos de opresi\xf3n es imposible y, de hecho, se convierte en una complicidad t\xe1cita con los sistemas de poder existentes.")
B.Pl=A.a(s(["Ignorar las ideolog\xedas y centrarse en los hechos puros.","Analizar cr\xedticamente las ideolog\xedas dominantes que naturalizan la opresi\xf3n, para desvelar sus mecanismos y posibilidades de cambio.","Imponer una \xfanica ideolog\xeda liberadora.",""]),t.s)
B.XN=new A.c("10","\xbfQu\xe9 significa 'desideologizar la realidad' para Mart\xedn-Bar\xf3?",B.Pl,"B","La desideologizaci\xf3n implica desentra\xf1ar las construcciones ideol\xf3gicas que legitiman las injusticias, permitiendo una visi\xf3n m\xe1s clara de la realidad y abriendo caminos para su transformaci\xf3n.")
B.LM=A.a(s(["La separaci\xf3n radical entre teor\xeda y pr\xe1ctica.","La interconexi\xf3n din\xe1mica entre la reflexi\xf3n te\xf3rica y la acci\xf3n transformadora.","La primac\xeda de la teor\xeda sobre la pr\xe1ctica.",""]),t.s)
B.a6g=new A.c("10","La 'praxis' en la psicolog\xeda de la liberaci\xf3n enfatiza:",B.LM,"B","Inspirada en el marxismo y Freire, la praxis es un ciclo continuo de reflexi\xf3n cr\xedtica que informa la acci\xf3n, y una acci\xf3n que a su vez retroalimenta y transforma la teor\xeda, buscando cambiar la realidad social.")
B.Ra=A.a(s(["Un software que corre en el hardware del cerebro.","Inmaterial y separada del cuerpo.","Profundamente influenciada y constituida por la estructura y las interacciones del cuerpo con el entorno.",""]),t.s)
B.a_u=new A.c("11","Seg\xfan el 'enfoque de la cognici\xf3n corporizada' (embodied cognition), la mente es:",B.Ra,"C","Este enfoque desaf\xeda la visi\xf3n desencarnada de la cognici\xf3n, argumentando que los procesos cognitivos (percepci\xf3n, memoria, pensamiento) est\xe1n fundamentalmente moldeados por las capacidades motoras, sensoriales y las interacciones del cuerpo con el mundo.")
B.OI=A.a(s(["La percepci\xf3n es un proceso pasivo de recepci\xf3n de informaci\xf3n sensorial.","La percepci\xf3n es un proceso activo que depende de la interacci\xf3n motora del organismo con el entorno.","La percepci\xf3n es una funci\xf3n puramente cerebral.",""]),t.s)
B.a2F=new A.c("11","\xbfQu\xe9 implicaci\xf3n tiene la cognici\xf3n corporizada para la percepci\xf3n?",B.OI,"B","Desde esta perspectiva, la percepci\xf3n no es solo procesar inputs, sino que est\xe1 guiada por las posibilidades de acci\xf3n del cuerpo y sus interacciones con el entorno (ej. percibir un objeto como 'agarrable').")
B.Oo=A.a(s(["La mente est\xe1 contenida exclusivamente dentro del cr\xe1neo.","La mente no se limita al cerebro, sino que se extiende a herramientas, dispositivos y el entorno con los que interactuamos.","Solo los cerebros humanos tienen cognici\xf3n.",""]),t.s)
B.Zv=new A.c("11","La 'cognici\xf3n extendida' postula que:",B.Oo,"B","Clark y Chalmers argumentan que, en ciertos casos, herramientas externas (como un cuaderno, un smartphone) pueden funcionar como partes integrantes de nuestros procesos cognitivos, extendiendo nuestra mente m\xe1s all\xe1 de los l\xedmites biol\xf3gicos.")
B.Jb=A.a(s(["Resolver un problema matem\xe1tico abstracto en la cabeza.","Un chef que sabe c\xf3mo cortar cebollas eficientemente en su cocina, usando sus utensilios y el entorno.","La memoria de trabajo sin ning\xfan contexto.",""]),t.s)
B.a8T=new A.c("11","\xbfCu\xe1l es un ejemplo de 'cognici\xf3n situada'?",B.Jb,"B","La cognici\xf3n situada enfatiza que el pensamiento y la acci\xf3n est\xe1n intr\xednsecamente ligados al contexto f\xedsico y social espec\xedfico en el que ocurren, y no pueden entenderse de forma aislada de ese entorno.")
B.Rs=A.a(s(["Un lugar tranquilo para pensar.","El ambiente modificado por una especie para mejorar sus capacidades cognitivas y de supervivencia.","Una funci\xf3n cerebral espec\xedfica para la cognici\xf3n.",""]),t.s)
B.a6M=new A.c("11","El concepto de 'nicho cognitivo' (cognitive niche) se refiere a:",B.Rs,"B","Propuesto por Odling-Smee, Laland y Feldman, se refiere a c\xf3mo los organismos no solo se adaptan a su entorno, sino que tambi\xe9n lo modifican activamente para facilitar su cognici\xf3n y adaptaci\xf3n.")
B.PE=A.a(s(["Que la cognici\xf3n es puramente representacional.","Que la cognici\xf3n no es solo una funci\xf3n del cerebro, sino que surge de la interacci\xf3n activa del organismo completo con su entorno.","La primac\xeda de la mente sobre el cuerpo.",""]),t.s)
B.a68=new A.c("11","La 'enacci\xf3n' (enactivism) es un enfoque que destaca:",B.PE,"B","La enacci\xf3n (Varela, Thompson, Rosch) argumenta que la cognici\xf3n es una 'acci\xf3n encarnada', donde la mente y el mundo se coproducen mutuamente a trav\xe9s de la actividad sensoriomotora del organismo.")
B.Oh=A.a(s(["Que solo ocurre en ciertas partes del cerebro.","Que los procesos cognitivos no se limitan a la mente individual, sino que se extienden a herramientas, artefactos y otros individuos en un sistema social.","Que la cognici\xf3n es muy dif\xedcil de localizar.",""]),t.s)
B.a8x=new A.c("11","\xbfQu\xe9 significa que la cognici\xf3n es 'distribuida'?",B.Oh,"B","La cognici\xf3n distribuida (Hutchins) sugiere que la inteligencia no reside solo en una mente individual, sino que emerge de la interacci\xf3n din\xe1mica entre personas, herramientas y el entorno social, como en un equipo de navegaci\xf3n de un barco.")
B.Nr=A.a(s(["Los procesos cognitivos son est\xe1ticos y discretos.","La cognici\xf3n debe entenderse como la evoluci\xf3n de estados en sistemas complejos que cambian continuamente en el tiempo.","Los cerebros son sistemas ca\xf3ticos y aleatorios.",""]),t.s)
B.a6y=new A.c("11","El enfoque de los 'sistemas din\xe1micos' en ciencias cognitivas sostiene que:",B.Nr,"B","Aplica principios de la teor\xeda de sistemas din\xe1micos para entender la cognici\xf3n como procesos continuos, interactivos y autoorganizados, en lugar de como simples operaciones de procesamiento de s\xedmbolos.")
B.RN=A.a(s(["Electr\xf3nica, Energ\xe9tica, Ef\xedmera, Externa.","Encarnada (Embodied), Embebida (Embedded), Enactiva (Enacted), Extendida (Extended).","Ego\xedsta, Emp\xe1tica, Experimental, Evolutiva.",""]),t.s)
B.a2G=new A.c("11","La 'mente 4E' se refiere a un conjunto de enfoques en ciencias cognitivas que enfatizan que la cognici\xf3n es:",B.RN,"B","Estas 4 E representan los pilares de la cognici\xf3n post-cognitivista, que busca superar el computacionalismo cl\xe1sico al enfatizar la importancia del cuerpo, el entorno, la acci\xf3n y las herramientas en la constituci\xf3n de la mente.")
B.LB=A.a(s(["Que las IA solo necesitan procesar informaci\xf3n abstracta.","Que para lograr una IA verdaderamente inteligente, esta debe tener un cuerpo e interactuar con el mundo de forma sensoriomotora.","Que las IA nunca podr\xe1n ser inteligentes.",""]),t.s)
B.a4L=new A.c("11","\xbfQu\xe9 implicaci\xf3n tiene la cognici\xf3n corporizada para la inteligencia artificial?",B.LB,"B","Los enfoques de rob\xf3tica encarnada o 'embodied AI' argumentan que la inteligencia no puede desarrollarse plenamente sin un cuerpo que interact\xfae con el mundo, permitiendo aprender y adaptarse de forma m\xe1s flexible y robusta.")
B.Lu=A.a(s(["La historia de los tratamientos psiqui\xe1tricos.","Cuestiones conceptuales, \xe9ticas y metodol\xf3gicas relacionadas con la naturaleza de la enfermedad mental, el diagn\xf3stico y el tratamiento.","La gesti\xf3n administrativa de los hospitales psiqui\xe1tricos.",""]),t.s)
B.a_U=new A.c("12","\xbfQu\xe9 aborda la filosof\xeda de la psiquiatr\xeda?",B.Lu,"B","La filosof\xeda de la psiquiatr\xeda es un campo que reflexiona sobre los fundamentos de la disciplina, analizando problemas como la distinci\xf3n entre normalidad y patolog\xeda, el papel de los valores en el diagn\xf3stico, y la naturaleza de las explicaciones en psiquiatr\xeda.")
B.L_=A.a(s(["Si las enfermedades mentales son tan reales como las enfermedades f\xedsicas.","Si las enfermedades mentales son construcciones sociales o si tienen una base biol\xf3gica objetiva.","Si solo las enfermedades gen\xe9ticas son reales.",""]),t.s)
B.a73=new A.c("12","El debate sobre la 'realidad de las enfermedades mentales' se refiere a:",B.L_,"B","Este debate central explora si los trastornos mentales son entidades 'naturales' con una base biol\xf3gica clara (realismo) o si son categor\xedas construidas socialmente para clasificar y controlar la conducta (construccionismo social).")
B.T8=A.a(s(["El construccionismo social.","El modelo biopsicosocial.","El enfoque de la evoluci\xf3n y el trastorno (e.g., Wakefield).",""]),t.s)
B.YL=new A.c("12","\xbfQu\xe9 enfoque sostiene que las enfermedades mentales son 'mecanismos disfuncionales' que no cumplen una funci\xf3n biol\xf3gica esperada?",B.T8,"C","Jerome Wakefield propone la noci\xf3n de 'disfunci\xf3n perjudicial' (Harmful Dysfunction), donde un trastorno implica una disfunci\xf3n de un mecanismo biol\xf3gico que no cumple su funci\xf3n esperada, y que adem\xe1s es perjudicial seg\xfan las normas sociales.")
B.Q3=A.a(s(["La financiaci\xf3n de la investigaci\xf3n.","El consentimiento informado, la autonom\xeda del paciente y el uso de la coerci\xf3n en el tratamiento.","La eficacia de los f\xe1rmacos.",""]),t.s)
B.a8K=new A.c("12","La '\xe9tica en psiquiatr\xeda' aborda cuestiones como:",B.Q3,"B","La \xe9tica psiqui\xe1trica se ocupa de dilemas morales y valores en la pr\xe1ctica cl\xednica, especialmente en situaciones donde la capacidad de decisi\xf3n del paciente puede estar comprometida o cuando hay un conflicto entre la autonom\xeda y la beneficencia.")
B.St=A.a(s(["Los trastornos mentales son exclusivamente problemas sociales.","Los trastornos mentales pueden ser completamente explicados y tratados en t\xe9rminos de procesos biol\xf3gicos cerebrales.","La psiquiatr\xeda es una disciplina obsoleta.",""]),t.s)
B.Y6=new A.c("12","El 'reduccionismo biol\xf3gico' en psiquiatr\xeda sostiene que:",B.St,"B","Esta posici\xf3n minimiza o niega el papel de los factores psicol\xf3gicos, sociales y ambientales en la etiolog\xeda y el tratamiento de los trastornos mentales, centr\xe1ndose solo en desequilibrios qu\xedmicos o gen\xe9ticos.")
B.Ns=A.a(s(["Una marca de honor.","La discriminaci\xf3n y el desprestigio asociados a las personas con problemas de salud mental.","Un s\xedntoma de enfermedad mental.",""]),t.s)
B.a4w=new A.c("12","\xbfQu\xe9 significa el t\xe9rmino 'estigma' en salud mental?",B.Ns,"B","El estigma puede llevar a la exclusi\xf3n social, la discriminaci\xf3n en el empleo y la vivienda, y a que las personas busquen menos ayuda, debido al prejuicio y los estereotipos negativos.")
B.Oc=A.a(s(["La falta de investigaci\xf3n en psiquiatr\xeda.","La instituci\xf3n psiqui\xe1trica tradicional, la medicalizaci\xf3n y la coerci\xf3n en el tratamiento.","La terapia de conversaci\xf3n.",""]),t.s)
B.a3e=new A.c("12","El 'movimiento antipsiqui\xe1trico' de los a\xf1os 60 y 70 criticaba principalmente:",B.Oc,"B","Este movimiento, con figuras como R. D. Laing y Thomas Szasz, cuestion\xf3 la validez del concepto de 'enfermedad mental', argumentando que era una etiqueta social para controlar la desviaci\xf3n y que las instituciones psiqui\xe1tricas eran represivas.")
B.Se=A.a(s(["Un f\xe1rmaco con efectos secundarios graves.","Una sustancia inactiva o un tratamiento simulado que puede producir efectos terap\xe9uticos debido a la expectativa del paciente.","El principio activo de un medicamento.",""]),t.s)
B.Yk=new A.c("12","\xbfQu\xe9 es el 'placebo' en el contexto de la investigaci\xf3n cl\xednica?",B.Se,"B","El efecto placebo demuestra el poder de la expectativa y la creencia en el resultado del tratamiento, y es un factor importante a controlar en los ensayos cl\xednicos de medicamentos.")
B.QJ=A.a(s(["Que todos los cerebros son id\xe9nticos.","Que las variaciones neurol\xf3gicas (ej. autismo, TDAH) son parte de la diversidad humana natural, no necesariamente trastornos a curar.","Que solo se deben estudiar los cerebros t\xedpicos.",""]),t.s)
B.a8N=new A.c("12","La 'neurodiversidad' es un concepto que propone:",B.QJ,"B","Este movimiento aboga por la aceptaci\xf3n de las diferencias neurol\xf3gicas como formas naturales de variaci\xf3n humana, promoviendo el respeto y la inclusi\xf3n en lugar de la patologizaci\xf3n y la b\xfasqueda de 'curas'.")
B.MI=A.a(s(["Centrarse exclusivamente en los factores biol\xf3gicos de la enfermedad.","Considerar los factores biol\xf3gicos, psicol\xf3gicos y sociales como interrelacionados en la comprensi\xf3n y el tratamiento de la salud y la enfermedad.","Ignorar los aspectos psicol\xf3gicos de los pacientes.",""]),t.s)
B.a4G=new A.c("12","\xbfCu\xe1l es el prop\xf3sito del 'modelo biopsicosocial' en salud mental?",B.MI,"B","Propuesto por George Engel, busca una comprensi\xf3n integral de la salud, reconociendo que los aspectos biol\xf3gicos (gen\xe9tica, qu\xedmica cerebral), psicol\xf3gicos (pensamientos, emociones) y sociales (cultura, econom\xeda, relaciones) interact\xfaan para influir en la salud y la enfermedad.")
B.N5=A.a(s(["Dos procesos completamente separados en la pr\xe1ctica cient\xedfica.","Aspectos interconectados donde la manipulaci\xf3n experimental (intervenci\xf3n) es crucial para establecer la existencia y las propiedades de las entidades (representaci\xf3n).","Solo relevantes en las ciencias sociales.",""]),t.s)
B.aaE=new A.c("13","Seg\xfan Ian Hacking, la 'intervenci\xf3n' y la 'representaci\xf3n' en las ciencias son:",B.N5,"B","Hacking argumenta que no solo 'representamos' el mundo a trav\xe9s de teor\xedas, sino que tambi\xe9n 'intervenimos' en \xe9l (manipulamos, experimentamos). La capacidad de manipular una entidad es una fuerte evidencia de su existencia, incluso si no podemos 'verla' directamente.")
B.OH=A.a(s(["Que no cambia nunca.","Que sus propiedades internas subyacentes son estables a lo largo del tiempo y el espacio, lo que permite generalizaciones predictivas.","Que solo se encuentra en la naturaleza.",""]),t.s)
B.a0O=new A.c("13","\xbfQu\xe9 significa que un 'tipo natural' (natural kind) en la filosof\xeda de la ciencia es 'estable'?",B.OH,"B","Los tipos naturales son categor\xedas que 'cortan la naturaleza en sus junturas', lo que significa que sus miembros comparten propiedades esenciales no obvias y se comportan de manera predecible, lo que los hace ideales para la investigaci\xf3n cient\xedfica.")
B.MM=A.a(s(["A la creaci\xf3n de robots humanoides.","A c\xf3mo las clasificaciones y etiquetas cient\xedficas (ej. 'homosexual', 'ni\xf1o autista') pueden influir y dar forma a la forma de ser y a la experiencia de las personas clasificadas.","A la manipulaci\xf3n gen\xe9tica de los seres humanos.",""]),t.s)
B.a5N=new A.c("13","Ian Hacking propone el concepto de 'hacer gente' (making up people). \xbfA qu\xe9 se refiere?",B.MM,"B","Hacking argumenta que las clasificaciones humanas no son neutrales. Cuando se etiqueta a las personas, estas etiquetas pueden cambiar su auto-comprensi\xf3n, su conducta y la forma en que la sociedad interact\xfaa con ellas, creando una 'trayectoria de bucle de retroalimentaci\xf3n'.")
B.IP=A.a(s(["La forma en que se descubre el conocimiento.","La naturaleza de la realidad y qu\xe9 tipo de entidades existen.","Los m\xe9todos de investigaci\xf3n.",""]),t.s)
B.a2E=new A.c("13","La 'ontolog\xeda' en filosof\xeda de la ciencia se ocupa de:",B.IP,"B","La ontolog\xeda es la rama de la metaf\xedsica que estudia el ser, la existencia y la realidad. En ciencia, se pregunta qu\xe9 tipo de cosas existen en el mundo que la ciencia investiga (ej. electrones, genes, enfermedades mentales).")
B.Ke=A.a(s(["Circuitos neuronales en el cerebro.","Procesos por los cuales la clasificaci\xf3n de las personas cambia a las personas mismas, quienes a su vez reaccionan y cambian la clasificaci\xf3n.","Un tipo de error en la investigaci\xf3n.",""]),t.s)
B.a8r=new A.c("13","\xbfQu\xe9 son los 'bucles de retroalimentaci\xf3n' (looping effects) en el trabajo de Hacking?",B.Ke,"B","Estos bucles son centrales en 'Making Up People'. Una etiqueta crea un nuevo tipo de persona, esa persona se comporta de manera diferente, lo que retroalimenta la comprensi\xf3n y la clasificaci\xf3n de esa categor\xeda.")
B.J_=A.a(s(["Los \xe1tomos no pueden reaccionar a la clasificaci\xf3n, mientras que las personas s\xed.","No hay diferencia.","Solo los \xe1tomos pueden ser clasificados.",""]),t.s)
B.aaB=new A.c("13","Seg\xfan Hacking, \xbfcu\xe1l es la diferencia clave entre la clasificaci\xf3n de las personas y la clasificaci\xf3n de los \xe1tomos?",B.J_,"A","La capacidad de las personas de 'actuar rec\xedprocamente' a las clasificaciones que se les imponen es lo que crea los bucles de retroalimentaci\xf3n, a diferencia de los objetos inanimados.")
B.QE=A.a(s(["Diferentes formas de argumentar en filosof\xeda.","Maneras hist\xf3ricamente espec\xedficas de pensar y producir conocimiento en ciencia, con sus propios criterios de validez y tipos de entidades.","La forma individual en que cada cient\xedfico piensa.",""]),t.s)
B.aar=new A.c("13","Cuando Hacking habla de 'estilos de razonamiento', se refiere a:",B.QE,"B","Son marcos o modos de indagaci\xf3n que definen qu\xe9 preguntas son leg\xedtimas, qu\xe9 se cuenta como evidencia y qu\xe9 tipo de entidades pueden existir, influyendo en la forma en que se construye el conocimiento.")
B.Pj=A.a(s(["Que cambia r\xe1pidamente de un momento a otro.","Que sus propiedades pueden ser modificadas por la propia categorizaci\xf3n y por la reacci\xf3n de las personas clasificadas a esa categorizaci\xf3n.","Que solo se encuentra en entornos inestables.",""]),t.s)
B.a52=new A.c("13","\xbfQu\xe9 significa que un 'tipo interactivo' (interactive kind) puede ser 'vol\xe1til'?",B.Pj,"B","Los tipos interactivos son categor\xedas que se aplican a personas. Son 'vol\xe1tiles' porque la acci\xf3n de clasificarlos y la reacci\xf3n de los clasificados pueden cambiar las propiedades de la categor\xeda misma.")
B.PD=A.a(s(["El acto de dar un nombre a una persona.","El proceso por el cual una caracter\xedstica o comportamiento se convierte en una 'cosa' o 'entidad' con un nombre propio (ej. 'depresi\xf3n' como sustantivo).","La creaci\xf3n de nuevos sustantivos en el lenguaje.",""]),t.s)
B.a8L=new A.c("13","La 'nominalizaci\xf3n' en el contexto de las clasificaciones humanas se refiere a:",B.PD,"B","La nominalizaci\xf3n convierte verbos o adjetivos en sustantivos, lo que puede solidificar conceptos, d\xe1ndoles una apariencia de ser entidades objetivas y estables, incluso si son construcciones sociales.")
B.NL=A.a(s(["Es irrelevante.","Proporciona la base para categorizar y contar a las personas seg\xfan atributos, creando nuevas poblaciones que pueden ser objeto de estudio e intervenci\xf3n.","Solo se usa para confirmar la existencia de tipos naturales.",""]),t.s)
B.a3E=new A.c("13","\xbfQu\xe9 papel juega la estad\xedstica en la 'fabricaci\xf3n de personas' (making up people)?",B.NL,"B","La estad\xedstica permite 'identificar' y cuantificar poblaciones con ciertas caracter\xedsticas, lo que a su vez puede llevar a la creaci\xf3n de nuevas categor\xedas para esas personas y a intervenciones dirigidas a ellas.")
B.NN=A.a(s(["Que la realidad es puramente una construcci\xf3n social y no existe una realidad externa.","Que solo se debe estudiar lo observable y emp\xedricamente verificable.","Que existe una realidad externa independiente de nuestras construcciones, pero que esta realidad tiene estructuras y mecanismos causales 'profundos' que no son directamente observables y deben ser inferidos.",""]),t.s)
B.a2A=new A.c("14","\xbfQu\xe9 postula el 'realismo cr\xedtico' en ciencias sociales (ej. Bhaskar)?",B.NN,"C","El realismo cr\xedtico busca ir m\xe1s all\xe1 del positivismo y el relativismo, sosteniendo que la ciencia puede investigar las causas subyacentes de los fen\xf3menos, incluso si estas causas no son directamente observables, y que el conocimiento es falible pero progresivo.")
B.Ls=A.a(s(["Que la estructura es m\xe1s importante que la agencia.","Que la agencia es m\xe1s importante que la estructura.","Que la estructura (condiciones sociales) y la agencia (capacidad de actuar de los individuos) son aspectos interdependientes de la realidad social.",""]),t.s)
B.ZM=new A.c("14","Seg\xfan el realismo cr\xedtico, la diferencia entre 'estructura' y 'agencia' es:",B.Ls,"C","El realismo cr\xedtico rechaza tanto el determinismo estructural como el individualismo metodol\xf3gico. Sostiene que las estructuras sociales habilitan y constri\xf1en la agencia individual, y que la agencia individual puede reproducir o transformar las estructuras.")
B.LR=A.a(s(["Solo la honestidad en la publicaci\xf3n de resultados.","Cuestiones relacionadas con el consentimiento informado, la privacidad, el da\xf1o potencial a los participantes y la responsabilidad social del investigador.","La financiaci\xf3n de los proyectos de investigaci\xf3n.",""]),t.s)
B.a6m=new A.c("14","La '\xe9tica de la investigaci\xf3n' en ciencias sociales aborda:",B.LR,"B","La \xe9tica de la investigaci\xf3n busca proteger los derechos y el bienestar de los participantes, as\xed como asegurar que la investigaci\xf3n se realice de manera responsable y beneficie a la sociedad.")
B.KC=A.a(s(["La ausencia total de valores o sesgos.","La capacidad de producir conocimiento que se refiere a la realidad externa, aunque reconociendo que este conocimiento es mediado por teor\xedas e instrumentos.","Un ideal inalcanzable para las ciencias sociales.",""]),t.s)
B.a3j=new A.c("14","\xbfQu\xe9 es la 'objetividad' desde una perspectiva realista cr\xedtica?",B.KC,"B","El realismo cr\xedtico defiende una forma de objetividad que reconoce el papel de la interpretaci\xf3n y la teor\xeda, pero que a\xfan se compromete con la idea de que el conocimiento puede acercarse a una comprensi\xf3n de la realidad independiente del sujeto.")
B.O0=A.a(s(["Una jerarqu\xeda donde la teor\xeda dicta la pr\xe1ctica.","Una separaci\xf3n radical donde la teor\xeda no influye en la pr\xe1ctica.","Una relaci\xf3n dial\xe9ctica donde la teor\xeda informa la pr\xe1ctica y la pr\xe1ctica transforma la teor\xeda.",""]),t.s)
B.a7X=new A.c("14","La 'relaci\xf3n teor\xeda-pr\xe1ctica' en las ciencias sociales, desde el realismo cr\xedtico, es vista como:",B.O0,"C","La praxis es central. La teor\xeda no es solo contemplaci\xf3n; debe guiar la acci\xf3n para cambiar la realidad. La acci\xf3n, a su vez, proporciona nueva informaci\xf3n que refina y desarrolla la teor\xeda.")
B.MU=A.a(s(["Son solo ficciones \xfatiles para la explicaci\xf3n.","Son las tendencias o poderes subyacentes de las entidades que generan los fen\xf3menos observables.","Son directamente observables y cuantificables.",""]),t.s)
B.a7r=new A.c("14","\xbfQu\xe9 rol juegan los 'mecanismos causales' en el realismo cr\xedtico?",B.MU,"B","El realismo cr\xedtico busca identificar los mecanismos causales 'profundos' que operan en el mundo, incluso si no son directamente observables, para explicar por qu\xe9 ocurren los fen\xf3menos.")
B.QU=A.a(s(["La separaci\xf3n estricta de las disciplinas.","El uso de m\xe9todos de una \xfanica disciplina para estudiar un problema.","La colaboraci\xf3n y la integraci\xf3n de perspectivas, conceptos y m\xe9todos de diferentes disciplinas para abordar un problema complejo.",""]),t.s)
B.aa7=new A.c("14","La 'interdisciplinariedad' en ciencias sociales se refiere a:",B.QU,"C","Reconoce que muchos problemas complejos (sociales, ambientales, de salud) no pueden ser comprendidos ni resueltos desde una \xfanica disciplina, requiriendo el di\xe1logo y la s\xedntesis de m\xfaltiples campos.")
B.PH=A.a(s(["Los valores deben ser eliminados de la investigaci\xf3n.","Los valores son inherentemente subjetivos y no tienen lugar en la ciencia.","Los valores son inevitables en la investigaci\xf3n, pero es crucial hacerlos expl\xedcitos y reflexionar sobre su influencia.",""]),t.s)
B.a5l=new A.c("14","En el realismo cr\xedtico, \xbfcu\xe1l es la relaci\xf3n entre 'valores' e 'investigaci\xf3n'?",B.PH,"C","Reconoce que los valores (tanto epist\xe9micos como \xe9ticos/sociales) no pueden ser completamente separados de la investigaci\xf3n. La clave es la transparencia y la reflexi\xf3n cr\xedtica sobre c\xf3mo los valores moldean las preguntas, los m\xe9todos y las interpretaciones.")
B.QO=A.a(s(["Que no hay l\xedmites para lo que pueden investigar.","Que est\xe1n sujetas a la influencia de m\xfaltiples factores que no pueden ser completamente controlados, a diferencia de los experimentos de laboratorio.","Que solo estudian lo que es p\xfablicamente observable.",""]),t.s)
B.a9K=new A.c("14","\xbfQu\xe9 significa que las ciencias sociales estudian un 'dominio abierto'?",B.QO,"B","A diferencia de los sistemas 'cerrados' (ideales para la experimentaci\xf3n en ciencias naturales), los sistemas sociales son 'abiertos', lo que significa que est\xe1n influenciados por una infinidad de variables externas, lo que hace la predicci\xf3n y la generalizaci\xf3n m\xe1s dif\xedciles.")
B.MN=A.a(s(["Un m\xe9todo de debate.","Un proceso de contradicci\xf3n y resoluci\xf3n que impulsa el cambio y el desarrollo en la realidad social y en el conocimiento.","Una l\xf3gica lineal de causa y efecto.",""]),t.s)
B.a4a=new A.c("14","La 'dial\xe9ctica' en el realismo cr\xedtico se refiere a:",B.MN,"B","La dial\xe9ctica, inspirada en Hegel y Marx, es un m\xe9todo para comprender c\xf3mo las contradicciones internas en los sistemas sociales impulsan el cambio y la transformaci\xf3n, y c\xf3mo el conocimiento se desarrolla a trav\xe9s de un proceso de cr\xedtica y superaci\xf3n.")
B.KP=A.a(s(["La moralidad de la tecnolog\xeda.","C\xf3mo la tecnolog\xeda influye en la pr\xe1ctica cient\xedfica, sus m\xe9todos y objetos de estudio.","El desarrollo de nuevas tecnolog\xedas.",""]),t.s)
B.a3L=new A.c("15","\xbfQu\xe9 aborda la filosof\xeda de la tecnolog\xeda en relaci\xf3n con la ciencia?",B.KP,"B","Se centra en la co-constituci\xf3n mutua de ciencia y tecnolog\xeda, argumentando que la tecnolog\xeda no es solo una aplicaci\xf3n de la ciencia, sino que tambi\xe9n moldea lo que la ciencia puede investigar y c\xf3mo lo hace.")
B.Lg=A.a(s(["Los humanos controlan completamente la tecnolog\xeda.","La tecnolog\xeda es el principal motor del cambio social y cultural, con efectos inevitables.",u.ft,""]),t.s)
B.Yx=new A.c("15","El 'determinismo tecnol\xf3gico' sostiene que:",B.Lg,"B","Es una perspectiva que atribuye a la tecnolog\xeda un poder aut\xf3nomo para determinar la evoluci\xf3n social, relegando los factores humanos y sociales a un papel secundario.")
B.IQ=A.a(s(["Que la tecnolog\xeda se desarrolla de forma aut\xf3noma.","Que la tecnolog\xeda es el resultado de procesos sociales de negociaci\xf3n, dise\xf1o y uso por parte de grupos relevantes.","Que la tecnolog\xeda es una extensi\xf3n natural del ser humano.",""]),t.s)
B.a9G=new A.c("15","\xbfQu\xe9 propone el 'constructivismo social de la tecnolog\xeda' (SCOT)?",B.IQ,"B","SCOT (Social Construction of Technology) argumenta que la tecnolog\xeda no tiene una trayectoria de desarrollo \xfanica, sino que su dise\xf1o y significado son moldeados por las interpretaciones y acciones de diferentes actores sociales.")
B.QZ=A.a(s(["Un objeto con una funci\xf3n \xfanica e inmutable.","Un objeto con significados y funciones que son negociados y construidos socialmente.","Un error en el dise\xf1o de una m\xe1quina.",""]),t.s)
B.ab_=new A.c("15","\xbfQu\xe9 es un 'artefacto tecnol\xf3gico' desde una perspectiva constructivista?",B.QZ,"B","Los artefactos no tienen un significado fijo, sino que su significado y uso son producto de las interacciones y atribuciones de los diferentes grupos de usuarios y dise\xf1adores.")
B.Th=A.a(s(["Exclusivamente a los seres humanos que act\xfaan.","Cualquier entidad (humana o no humana) que tiene la capacidad de hacer una diferencia, de producir un efecto en una red.","Un espectador pasivo de la tecnolog\xeda.",""]),t.s)
B.a8A=new A.c("15","La 'actante' en la teor\xeda del actor-red (ANT) se refiere a:",B.Th,"B","La ANT borra la distinci\xf3n tradicional entre sujetos y objetos, otorgando agencia a entidades no humanas (m\xe1quinas, software, textos) que tambi\xe9n 'act\xfaan' y configuran la realidad social y tecnol\xf3gica.")
B.N1=A.a(s(["El dise\xf1o est\xe9tico de los robots.","La autonom\xeda de la IA, el sesgo algor\xedtmico, la responsabilidad por las decisiones de la IA y el impacto social y laboral.","C\xf3mo hacer la IA m\xe1s r\xe1pida y eficiente.",""]),t.s)
B.a0G=new A.c("15","La '\xe9tica de la inteligencia artificial' (IA) aborda cuestiones como:",B.N1,"B","Ante el avance de la IA, surgen dilemas \xe9ticos fundamentales sobre c\xf3mo garantizar que su desarrollo y uso sean justos, transparentes, seguros y beneficien a la humanidad.")
B.NS=A.a(s(["Un error de programaci\xf3n aleatorio.","Un resultado injusto o discriminatorio producido por un algoritmo de IA, debido a sesgos en los datos de entrenamiento o en el dise\xf1o.","Una preferencia personal de un programador.",""]),t.s)
B.Yz=new A.c("15","\xbfQu\xe9 es el 'sesgo algor\xedtmico'?",B.NS,"B","Los algoritmos aprenden de los datos. Si los datos reflejan sesgos sociales existentes (ej. raciales, de g\xe9nero), el algoritmo puede perpetuarlos o incluso amplificarlos en sus decisiones (ej. en contrataci\xf3n, justicia, atenci\xf3n m\xe9dica).")
B.Mo=A.a(s(["A que la IA puede sentir emociones.","A la capacidad de un sistema de IA para tomar decisiones y actuar en el mundo sin intervenci\xf3n humana directa.","A la capacidad de la IA para repararse a s\xed misma.",""]),t.s)
B.a2L=new A.c("15","Cuando se habla de 'autonom\xeda de la IA', \xbfa qu\xe9 se refiere?",B.Mo,"B","La autonom\xeda es una caracter\xedstica clave en el debate \xe9tico de la IA, ya que plantea desaf\xedos sobre la responsabilidad, el control humano y la posibilidad de que la IA tome decisiones con consecuencias significativas.")
B.KH=A.a(s(["La separaci\xf3n entre la ciencia y la tecnolog\xeda.","La interconexi\xf3n y mutua dependencia entre ciencia y tecnolog\xeda, donde el avance de una depende intr\xednsecamente de la otra.","Que la tecnolog\xeda es solo un producto de la ciencia.",""]),t.s)
B.YE=new A.c("15","El concepto de 'tecnociencia' enfatiza:",B.KH,"B","Este t\xe9rmino subraya que en la pr\xe1ctica contempor\xe1nea, ciencia y tecnolog\xeda no son entidades separadas, sino un continuo. La investigaci\xf3n cient\xedfica a menudo requiere tecnolog\xedas avanzadas, y las nuevas tecnolog\xedas surgen de la investigaci\xf3n cient\xedfica.")
B.L6=A.a(s(["El control pol\xedtico de las empresas de IA.","El desarrollo de marcos, pol\xedticas y regulaciones para guiar el desarrollo y uso \xe9tico y responsable de la inteligencia artificial.","La supervisi\xf3n humana de cada decisi\xf3n de la IA.",""]),t.s)
B.a7N=new A.c("15","\xbfQu\xe9 es la 'gobernanza de la IA'?",B.L6,"B","La gobernanza de la IA busca establecer normas, principios y mecanismos para asegurar que la IA se alinee con los valores sociales, promueva el bien com\xfan y mitigue los riesgos potenciales.")
B.Oi=A.a(s(["Una era donde la verdad es objetiva y universalmente aceptada.","Una situaci\xf3n en la que los hechos objetivos son menos influyentes en la opini\xf3n p\xfablica que las apelaciones a la emoci\xf3n y a las creencias personales.","La ausencia total de verdad en la informaci\xf3n.",""]),t.s)
B.a0W=new A.c("16","\xbfQu\xe9 se entiende por 'posverdad' (post-truth)?",B.Oi,"B","El t\xe9rmino 'posverdad' describe un clima cultural y pol\xedtico donde la veracidad de la informaci\xf3n es menos importante que su capacidad para resonar con las emociones o creencias preexistentes de las personas.")
B.MJ=A.a(s(["Un exceso de informaci\xf3n verdadera.","Una sobreabundancia de informaci\xf3n (correcta o incorrecta) que dificulta que las personas encuentren fuentes confiables y orientaci\xf3n confiable.","La escasez de informaci\xf3n en l\xednea.",""]),t.s)
B.aaV=new A.c("16","La 'infodemia' se refiere a:",B.MJ,"B","Es un fen\xf3meno de saturaci\xf3n de informaci\xf3n, a menudo mezclada con desinformaci\xf3n y rumores, que puede generar confusi\xf3n, desconfianza y dificultar la toma de decisiones informadas.")
B.MY=A.a(s(["Lugares donde la gente grita.","Espacios donde los individuos solo interact\xfaan con personas que tienen opiniones similares, reforzando sus propias creencias y limitando la exposici\xf3n a puntos de vista diferentes.","Foros de debate abiertos y diversos.",""]),t.s)
B.a3v=new A.c("16","\xbfQu\xe9 son las 'c\xe1maras de eco' (echo chambers) en el contexto de las redes sociales?",B.MY,"B","Las c\xe1maras de eco contribuyen a la polarizaci\xf3n al reducir la diversidad de perspectivas y reforzar sesgos de confirmaci\xf3n, dificultando el di\xe1logo y el entendimiento entre grupos con opiniones opuestas.")
B.QV=A.a(s(["Informar con precisi\xf3n al p\xfablico.","Enga\xf1ar, manipular o influir en la opini\xf3n p\xfablica, a menudo con fines pol\xedticos o econ\xf3micos.","Promover el pensamiento cr\xedtico.",""]),t.s)
B.a9t=new A.c("16","\xbfCu\xe1l es el prop\xf3sito de las 'noticias falsas' (fake news)?",B.QV,"B","Las noticias falsas son informaciones deliberadamente enga\xf1osas que se presentan como noticias reales, y que a menudo se difunden r\xe1pidamente a trav\xe9s de redes sociales, socavando la confianza en los medios y las instituciones.")
B.Ox=A.a(s(["La tendencia a buscar, interpretar y recordar informaci\xf3n que confirma nuestras creencias preexistentes.","La capacidad de aceptar informaci\xf3n que contradice nuestras creencias.","La dificultad de confirmar hechos en un debate.",""]),t.s)
B.a88=new A.c("16","El 'sesgo de confirmaci\xf3n' en psicolog\xeda se refiere a:",B.Ox,"A","Este sesgo cognitivo explica por qu\xe9 las personas tienden a prestar m\xe1s atenci\xf3n a la informaci\xf3n que respalda lo que ya creen, y a ignorar o desestimar la informaci\xf3n que lo contradice, contribuyendo a la polarizaci\xf3n y la resistencia a cambiar de opini\xf3n.")
B.Ot=A.a(s(["Garantiza que solo la informaci\xf3n verdadera se difunda r\xe1pidamente.","Permite que la informaci\xf3n (verdadera o falsa) se propague de forma exponencial, a menudo sin verificaci\xf3n.","Hace que la informaci\xf3n sea m\xe1s f\xe1cil de controlar.",""]),t.s)
B.a03=new A.c("16","\xbfQu\xe9 implicaci\xf3n tiene la 'viralidad' de la informaci\xf3n en la era digital para la difusi\xf3n de la verdad?",B.Ot,"B","La viralidad es una caracter\xedstica clave de las redes sociales. Si bien puede amplificar el conocimiento, tambi\xe9n es un mecanismo potente para la r\xe1pida y descontrolada difusi\xf3n de desinformaci\xf3n.")
B.OY=A.a(s(["Razonar l\xf3gicamente para llegar a conclusiones correctas.","La tendencia a que la motivaci\xf3n (deseo de creer algo) influya en el proceso de razonamiento, llevando a conclusiones que apoyen esa motivaci\xf3n.","Razonar de forma desinteresada.",""]),t.s)
B.a_B=new A.c("16","\xbfQu\xe9 es el 'razonamiento motivado' (motivated reasoning)?",B.OY,"B","Es un proceso cognitivo donde las personas no buscan la verdad objetiva, sino que interpretan la evidencia de manera que justifique sus creencias o preferencias preexistentes, a menudo de forma inconsciente.")
B.L0=A.a(s(["No tienen ning\xfan papel.","La informaci\xf3n que apela a emociones fuertes (miedo, enojo) tiende a ser m\xe1s compartida, incluso si es falsa.","Solo las emociones positivas influyen en la difusi\xf3n.",""]),t.s)
B.a13=new A.c("16","\xbfCu\xe1l es el papel de las 'emociones' en la difusi\xf3n de informaci\xf3n falsa?",B.L0,"B","Las emociones, especialmente las negativas, son un potente motor para la difusi\xf3n de noticias falsas. La informaci\xf3n emocionalmente cargada es m\xe1s propensa a ser compartida sin una verificaci\xf3n cuidadosa.")
B.Sz=A.a(s(["Ense\xf1ar a usar las redes sociales.","Capacitar a las personas para evaluar cr\xedticamente la informaci\xf3n, reconocer sesgos y distinguir fuentes confiables de las no confiables.","Promover la aceptaci\xf3n acr\xedtica de toda la informaci\xf3n.",""]),t.s)
B.a42=new A.c("16","La 'alfabetizaci\xf3n medi\xe1tica y digital' busca:",B.Sz,"B","Es una habilidad crucial en la era de la posverdad, que permite a los ciudadanos navegar el complejo panorama informativo, identificar desinformaci\xf3n y tomar decisiones informadas.")
B.O8=A.a(s(["Una burbuja f\xedsica donde las personas se a\xedslan.","El aislamiento intelectual que ocurre cuando un algoritmo de personalizaci\xf3n de contenido muestra solo la informaci\xf3n que cree que el usuario querr\xe1 ver, bas\xe1ndose en su historial.","Un mecanismo de seguridad en l\xednea.",""]),t.s)
B.XC=new A.c("16","El 'filtro burbuja' (filter bubble) se refiere a:",B.O8,"B","Los filtros burbuja, creados por algoritmos de recomendaci\xf3n, pueden limitar la exposici\xf3n de los usuarios a perspectivas diversas, reforzando sus puntos de vista existentes y contribuyendo a la polarizaci\xf3n.")
B.Tk=A.a(s(["Las finanzas personales.","Cuestiones conceptuales, \xe9ticas y metodol\xf3gicas en la ciencia econ\xf3mica.","La historia de los mercados.",""]),t.s)
B.XP=new A.c("17","\xbfQu\xe9 aborda la filosof\xeda de la econom\xeda?",B.Tk,"B","Examina los fundamentos de la econom\xeda como ciencia, incluyendo la naturaleza de los modelos econ\xf3micos, la racionalidad de los agentes, la \xe9tica de los sistemas econ\xf3micos y el papel de los valores.")
B.R2=A.a(s(["Un ser humano altruista.","Un modelo de agente econ\xf3mico que act\xfaa de forma perfectamente racional, ego\xedsta y maximizadora de su propia utilidad.","Un modelo de comportamiento animal.",""]),t.s)
B.a3l=new A.c("17","\xbfQu\xe9 es el 'homo economicus'?",B.R2,"B","Es una idealizaci\xf3n en la econom\xeda neocl\xe1sica. Se le atribuye informaci\xf3n completa y la capacidad de tomar decisiones \xf3ptimas para maximizar su propio beneficio, ignorando a menudo factores psicol\xf3gicos o sociales.")
B.LX=A.a(s(["Reafirmar el modelo del homo economicus.","Integrar la psicolog\xeda y la econom\xeda para comprender c\xf3mo los factores psicol\xf3gicos reales influyen en las decisiones econ\xf3micas.","Estudiar la econom\xeda de los animales.",""]),t.s)
B.a5g=new A.c("17","La 'econom\xeda conductual' (behavioral economics) busca:",B.LX,"B","Es un campo interdisciplinario que desaf\xeda la suposici\xf3n de racionalidad perfecta, mostrando c\xf3mo sesgos cognitivos, emociones y factores sociales afectan las decisiones econ\xf3micas de las personas.")
B.MG=A.a(s(["Un error aleatorio en el pensamiento.","Un patr\xf3n sistem\xe1tico de desviaci\xf3n del pensamiento racional, que afecta el juicio y la toma de decisiones.","Un tipo de inversi\xf3n financiera.",""]),t.s)
B.a4R=new A.c("17","\xbfQu\xe9 es un 'sesgo cognitivo' en econom\xeda conductual?",B.MG,"B","Los sesgos cognitivos (ej. aversi\xf3n a la p\xe9rdida, sesgo de anclaje, heur\xedsticas) demuestran que las personas a menudo se desv\xedan de las decisiones puramente racionales que postula la econom\xeda cl\xe1sica.")
B.Mb=A.a(s(["Describir c\xf3mo funciona la econom\xeda en la realidad.","Hacer juicios de valor sobre c\xf3mo 'deber\xeda' ser la econom\xeda y las pol\xedticas econ\xf3micas.","Estudiar las leyes econ\xf3micas inmutables.",""]),t.s)
B.a3Y=new A.c("17","La 'econom\xeda normativa' se ocupa de:",B.Mb,"B","Se centra en la \xe9tica y los valores, pregunt\xe1ndose qu\xe9 objetivos econ\xf3micos son deseables (ej. equidad, eficiencia) y qu\xe9 pol\xedticas deber\xedan implementarse para alcanzarlos.")
B.IR=A.a(s(["Describir y explicar los fen\xf3menos econ\xf3micos tal como son, sin juicios de valor.","Estudiar c\xf3mo 'deber\xeda' ser la econom\xeda.","Promover pol\xedticas econ\xf3micas espec\xedficas.",""]),t.s)
B.Zw=new A.c("17","La 'econom\xeda positiva' se ocupa de:",B.IR,"A","Se enfoca en la descripci\xf3n y explicaci\xf3n de los hechos econ\xf3micos, utilizando modelos y datos para predecir resultados, de forma 'neutral' respecto a los valores.")
B.LC=A.a(s(["Que los humanos son completamente irracionales.","Que los humanos toman decisiones racionales, pero est\xe1n limitados por la informaci\xf3n disponible, el tiempo y sus capacidades cognitivas.","Que solo la econom\xeda es limitada en su racionalidad.",""]),t.s)
B.ZA=new A.c("17","\xbfQu\xe9 es la 'racionalidad limitada' (bounded rationality)?",B.LC,"B","Propuesta por Herbert Simon, reconoce que, si bien las personas intentan ser racionales, sus decisiones son 'satisfactorias' en lugar de '\xf3ptimas', debido a las limitaciones cognitivas y del entorno.")
B.Qz=A.a(s(["La dificultad de predecir el futuro de los mercados bas\xe1ndose en datos pasados.","La imposibilidad de verificar hip\xf3tesis econ\xf3micas.","La falta de creatividad en los modelos econ\xf3micos.",""]),t.s)
B.a3m=new A.c("17","El 'problema de la inducci\xf3n' en econom\xeda se refiere a:",B.Qz,"A","Al igual que en la ciencia en general, la econom\xeda se enfrenta al desaf\xedo de justificar que los patrones observados en el pasado se mantendr\xe1n en el futuro, especialmente en sistemas complejos y din\xe1micos como los mercados.")
B.Os=A.a(s(["Que lo que es bueno para una parte es necesariamente bueno para el todo.","Que lo que es bueno para el todo es necesariamente bueno para una parte.","Que las falacias son importantes en econom\xeda.",""]),t.s)
B.ZG=new A.c("17","\xbfQu\xe9 es la 'falacia de la composici\xf3n' en econom\xeda?",B.Os,"A","Es el error de suponer que una propiedad o acci\xf3n que es beneficiosa o verdadera para un individuo o una parte de un sistema, tambi\xe9n lo ser\xe1 para el conjunto del sistema.")
B.SI=A.a(s(["Analizar c\xf3mo las personas juegan videojuegos.","Modelar situaciones donde la decisi\xf3n de un agente afecta el resultado de otros agentes y viceversa.","Estudiar el comportamiento de los animales.",""]),t.s)
B.ab8=new A.c("17","La 'teor\xeda de juegos' en econom\xeda se utiliza para:",B.SI,"B","Es una herramienta matem\xe1tica para analizar interacciones estrat\xe9gicas, donde el resultado de la acci\xf3n de cada participante depende de las acciones de los dem\xe1s, siendo fundamental en \xe1reas como la competencia y la cooperaci\xf3n.")
B.OF=A.a(s([u.ft,"La tecnolog\xeda es un motor aut\xf3nomo que determina la sociedad.","Examina c\xf3mo la tecnolog\xeda moldea la sociedad y c\xf3mo la sociedad moldea la tecnolog\xeda, y las implicaciones \xe9ticas y existenciales.",""]),t.s)
B.a6C=new A.c("18","\xbfQu\xe9 propone la 'filosof\xeda de la tecnolog\xeda' en relaci\xf3n con la sociedad?",B.OF,"C","Se aleja de las posturas deterministas o neutrales, abogando por una comprensi\xf3n m\xe1s matizada de la relaci\xf3n bidireccional entre la tecnolog\xeda y la sociedad, y sus dilemas morales.")
B.M5=A.a(s(["Enfocarse solo en los actores humanos en la ciencia y la tecnolog\xeda.","Tratar a los actores humanos y no humanos como igualmente importantes en la construcci\xf3n de la realidad sociot\xe9cnica.","Considerar que la tecnolog\xeda es un mero producto de la sociedad.",""]),t.s)
B.aaH=new A.c("18","La 'teor\xeda del actor-red' (ANT) de Latour y Callon se caracteriza por:",B.M5,"B","ANT desaf\xeda las divisiones tradicionales entre lo social y lo t\xe9cnico, argumentando que ambos se co-construyen en redes heterog\xe9neas donde actantes de todo tipo ejercen agencia.")
B.P0=A.a(s(["Un hecho cient\xedfico puro.","Un objeto que es a la vez un artefacto tecnol\xf3gico y un hecho cient\xedfico, evidenciando la interdependencia entre ciencia y tecnolog\xeda.","Un mito sobre la tecnolog\xeda.",""]),t.s)
B.Yo=new A.c("18","\xbfQu\xe9 es un 'tecnofacto'?",B.P0,"B","El concepto resalta c\xf3mo en la pr\xe1ctica cient\xedfica contempor\xe1nea, los hechos son a menudo inseparables de los dispositivos y las pr\xe1cticas tecnol\xf3gicas que los producen y verifican.")
B.Ky=A.a(s(["El rechazo de toda tecnolog\xeda.","La mejora radical de las capacidades humanas (f\xedsicas, cognitivas, morales) a trav\xe9s de la tecnolog\xeda.","Un retorno a un estilo de vida m\xe1s natural.",""]),t.s)
B.a1r=new A.c("18","El 'transhumanismo' es un movimiento que propone:",B.Ky,"B","Busca superar las limitaciones biol\xf3gicas humanas a trav\xe9s de la ingenier\xeda gen\xe9tica, la biotecnolog\xeda, la inteligencia artificial y la nanotecnolog\xeda, con el objetivo de alcanzar una 'condici\xf3n post-humana'.")
B.NI=A.a(s(["Que no es lo suficientemente ambicioso.","Que puede exacerbar las desigualdades sociales y crear nuevas formas de discriminaci\xf3n.","Que es demasiado conservador en su visi\xf3n.",""]),t.s)
B.a8Z=new A.c("18","Una cr\xedtica com\xfan al 'transhumanismo' es:",B.NI,"B","Se argumenta que las tecnolog\xedas de mejora podr\xedan ser inaccesibles para la mayor\xeda, creando una divisi\xf3n entre 'mejorados' y 'no mejorados', o incluso llevando a nuevas formas de eugenesia.")
B.S1=A.a(s(["Un momento en el tiempo donde la tecnolog\xeda se estanca.","Un punto hipot\xe9tico en el futuro donde el crecimiento tecnol\xf3gico se vuelve incontrolable e irreversible, resultando en cambios impredecibles para la civilizaci\xf3n humana.","La invenci\xf3n de una \xfanica tecnolog\xeda importante.",""]),t.s)
B.a8W=new A.c("18","La 'singularidad tecnol\xf3gica'?",B.S1,"B","Concepto popularizado por Raymond Kurzweil, sugiere un punto en el que la inteligencia artificial superar\xeda a la inteligencia humana, llevando a una explosi\xf3n de la inteligencia auto-mejorada.")
B.Sh=A.a(s(["C\xf3mo almacenar grandes cantidades de datos.","C\xf3mo asegurar que las inteligencias artificiales avanzadas act\xfaen de acuerdo con los objetivos humanos y no generen consecuencias no deseadas.","C\xf3mo dise\xf1ar el hardware de la IA.",""]),t.s)
B.Yl=new A.c("18","El 'problema de la caja' (control problem) en la \xe9tica de la IA se refiere a:",B.Sh,"B","Es un desaf\xedo clave en la seguridad de la IA: c\xf3mo dise\xf1ar sistemas inteligentes que sean 'alien\xedgenas' en su forma de pensar, pero que permanezcan bajo control humano y no causen da\xf1o no intencional.")
B.Rd=A.a(s(["Que la tecnolog\xeda es consciente.","Que la tecnolog\xeda puede ser responsable de sus acciones.","Que la tecnolog\xeda, a trav\xe9s de su dise\xf1o y funcionamiento, puede influir en las decisiones humanas y tener implicaciones \xe9ticas.",""]),t.s)
B.a9J=new A.c("18","\xbfQu\xe9 significa que la tecnolog\xeda tiene 'agencia moral'?",B.Rd,"C","Si bien la tecnolog\xeda no tiene conciencia o intenciones, su 'agencia' reside en su capacidad para moldear las elecciones y comportamientos humanos, lo que conlleva responsabilidades para sus dise\xf1adores y usuarios.")
B.R5=A.a(s(["El costo de una tecnolog\xeda.","Las posibilidades de acci\xf3n que un objeto tecnol\xf3gico 'ofrece' o 'invita' a un usuario, basadas en sus propiedades.","La belleza de un dise\xf1o tecnol\xf3gico.",""]),t.s)
B.a5J=new A.c("18","El concepto de 'afordancia' (affordance) en el dise\xf1o de tecnolog\xeda se refiere a:",B.R5,"B","Un bot\xf3n 'aforda' ser presionado, una manija 'aforda' ser girada. Es una propiedad relacional entre un objeto y un usuario, que gu\xeda el uso sin necesidad de instrucciones expl\xedcitas.")
B.LL=A.a(s(["Es un concepto obsoleto.","Es un derecho fundamental que se ve constantemente desafiado por la recolecci\xf3n masiva de datos y la vigilancia.","Solo es relevante para los gobiernos.",""]),t.s)
B.XQ=new A.c("18","\xbfQu\xe9 rol juega la 'privacidad' en la era digital y tecnol\xf3gica?",B.LL,"B","La recolecci\xf3n, el an\xe1lisis y el uso de datos personales por parte de empresas y gobiernos plantean serios desaf\xedos a la privacidad, la autonom\xeda y la seguridad individual.")
B.MD=A.a(s(["Un enfoque en la gesti\xf3n de residuos.","Una filosof\xeda ambiental que postula el valor intr\xednseco de todas las formas de vida y ecosistemas, m\xe1s all\xe1 de su utilidad para los humanos.","El estudio de los ecosistemas marinos.",""]),t.s)
B.Yc=new A.c("19","\xbfQu\xe9 es la 'ecolog\xeda profunda'?",B.MD,"B","Difiere de la 'ecolog\xeda superficial' (que se centra en problemas ambientales para beneficio humano) al argumentar que los problemas ecol\xf3gicos requieren un cambio fundamental en la cosmovisi\xf3n antropoc\xe9ntrica.")
B.Rc=A.a(s(["Una nueva era geol\xf3gica donde el clima es estable.","Una propuesta de nueva \xe9poca geol\xf3gica en la que las actividades humanas se han convertido en la principal fuerza geol\xf3gica que moldea la Tierra.","Un per\xedodo en el que los humanos desaparecen.",""]),t.s)
B.aai=new A.c("19","\xbfQu\xe9 significa el concepto de 'Antropoceno'?",B.Rc,"B","El Antropoceno destaca el impacto sin precedentes de la humanidad en los sistemas planetarios (clima, biodiversidad, ciclos biogeoqu\xedmicos), planteando la necesidad de una reflexi\xf3n \xe9tica y pol\xedtica profunda.")
B.Tp=A.a(s(["Solo la contaminaci\xf3n del aire.","Las cuestiones morales relacionadas con la interacci\xf3n de los seres humanos con el medio ambiente natural.","C\xf3mo las empresas pueden ser m\xe1s rentables.",""]),t.s)
B.a4O=new A.c("19","La '\xe9tica ambiental' aborda:",B.Tp,"B","Examina los valores, derechos y responsabilidades en relaci\xf3n con la naturaleza, incluyendo la vida silvestre, los ecosistemas y las generaciones futuras.")
B.QG=A.a(s(["La protecci\xf3n legal de la propiedad privada.","El principio de que ning\xfan grupo de personas deber\xeda soportar una parte desproporcionada de las consecuencias ambientales negativas.","El uso sostenible de los recursos naturales.",""]),t.s)
B.a61=new A.c("19","\xbfQu\xe9 es la 'justicia ambiental'?",B.QG,"B","Destaca c\xf3mo las comunidades marginadas (por raza, etnia, ingresos) a menudo son las m\xe1s afectadas por la contaminaci\xf3n, la degradaci\xf3n ambiental y la falta de acceso a recursos ambientales saludables.")
B.Ks=A.a(s(["Priorizar el crecimiento econ\xf3mico a toda costa.","Satisfacer las necesidades del presente sin comprometer la capacidad de las generaciones futuras para satisfacer sus propias necesidades.","Limitar el desarrollo a los pa\xedses ricos.",""]),t.s)
B.a5f=new A.c("19","El 'desarrollo sostenible' busca:",B.Ks,"B","Es un concepto clave en la pol\xedtica ambiental global que intenta equilibrar la satisfacci\xf3n de las necesidades humanas actuales con la protecci\xf3n del medio ambiente para el futuro.")
B.MA=A.a(s(["Analizar los componentes individuales de un ecosistema por separado.","Entender los fen\xf3menos ecol\xf3gicos como interacciones complejas dentro de sistemas interconectados.","Que los ecosistemas son simples y lineales.",""]),t.s)
B.Y7=new A.c("19","\xbfQu\xe9 significa 'pensamiento sist\xe9mico' en ecolog\xeda?",B.MA,"B","En lugar de una visi\xf3n lineal causa-efecto, el pensamiento sist\xe9mico reconoce las relaciones, los bucles de retroalimentaci\xf3n y las propiedades emergentes en los ecosistemas, lo que es crucial para abordar problemas ambientales complejos.")
B.MC=A.a(s(["Solo la \xe9tica m\xe9dica.","Cuestiones \xe9ticas relacionadas con la vida en general, incluyendo la biotecnolog\xeda, la ecolog\xeda y la salud p\xfablica.","La \xe9tica de los animales en laboratorios.",""]),t.s)
B.a5Q=new A.c("19","La 'bio\xe9tica' en su sentido amplio aborda:",B.MC,"B","Es un campo multidisciplinario que examina los dilemas morales que surgen de los avances en biolog\xeda, medicina, ecolog\xeda y tecnolog\xeda, y su impacto en la vida.")
B.R8=A.a(s(["La capacidad de un ecosistema para resistir perturbaciones y mantener su estructura y funci\xf3n.","La capacidad de los humanos para adaptarse a los cambios ambientales.","La fragilidad de un ecosistema.",""]),t.s)
B.a_f=new A.c("19","\xbfQu\xe9 es la 'resiliencia ecol\xf3gica'?",B.R8,"A","Se refiere a la capacidad de un sistema ecol\xf3gico (o social-ecol\xf3gico) para absorber perturbaciones, reorganizarse mientras experimenta cambios, y retener esencialmente la misma funci\xf3n, estructura, identidad y retroalimentaci\xf3n.")
B.JL=A.a(s(["El dinero invertido en energ\xedas renovables.","Los recursos naturales y los servicios ecosist\xe9micos que sustentan la vida y la econom\xeda.","Los edificios construidos con materiales naturales.",""]),t.s)
B.Yi=new A.c("19","El 'capital natural' se refiere a:",B.JL,"B","Incluye elementos como el aire puro, el agua dulce, los bosques, los oc\xe9anos, la biodiversidad y los procesos naturales (ej. polinizaci\xf3n, regulaci\xf3n del clima) de los que dependen las sociedades.")
B.Pe=A.a(s(["Una mejora inesperada en el medio ambiente.","Cuando las ganancias de eficiencia energ\xe9tica o de recursos se compensan o se superan por el aumento del consumo.","La capacidad de recuperaci\xf3n de los recursos naturales.",""]),t.s)
B.a74=new A.c("19","\xbfQu\xe9 es el 'efecto rebote' (rebound effect) en sostenibilidad?",B.Pe,"B","Por ejemplo, un coche m\xe1s eficiente en combustible podr\xeda llevar a que la gente conduzca m\xe1s, anulando parte de los beneficios ambientales de la eficiencia.")
B.QY=A.a(s(["Una sociedad sin riesgos.","Una sociedad donde los riesgos (ambientales, tecnol\xf3gicos) son producidos y distribuidos por la propia modernizaci\xf3n y globalizaci\xf3n.","Una sociedad que ignora los riesgos.",""]),t.s)
B.a67=new A.c("20","\xbfQu\xe9 se entiende por 'sociedad del riesgo' (Beck)?",B.QY,"B","Ulrich Beck argumenta que la sociedad moderna, a pesar de sus avances, genera nuevos riesgos a gran escala (cambio clim\xe1tico, accidentes nucleales) que son globales e incontrolables, afectando a todos sin distinci\xf3n.")
B.Sp=A.a(s(["Actuar solo cuando hay certeza cient\xedfica de da\xf1o.","Tomar medidas preventivas ante posibles da\xf1os ambientales graves o irreversibles, incluso si la evidencia cient\xedfica no es concluyente.","Ignorar los riesgos futuros.",""]),t.s)
B.a8v=new A.c("20","\xbfQu\xe9 es el 'principio de precauci\xf3n' en pol\xedtica ambiental?",B.Sp,"B","Es un principio \xe9tico y pol\xedtico que invierte la carga de la prueba: se debe demostrar que una actividad no es da\xf1ina antes de implementarla, especialmente cuando hay incertidumbre cient\xedfica sobre sus impactos.")
B.S6=A.a(s(["La ciencia es simple y los valores son irrelevantes.","Los hechos son inciertos, los valores est\xe1n en disputa, hay mucho en juego y las decisiones son urgentes.","La ciencia ha alcanzado su estado final de verdad.",""]),t.s)
B.a6j=new A.c("20","La 'ciencia posnormal' (Funtowicz & Ravetz) se aplica a situaciones donde:",B.S6,"B","Propone un enfoque para problemas complejos donde la incertidumbre es alta, los valores \xe9ticos y sociales son centrales, y los cient\xedficos deben interactuar con m\xfaltiples actores sociales y pol\xedticos.")
B.SW=A.a(s(["Es un receptor pasivo del conocimiento cient\xedfico.","Debe ser excluido de los debates cient\xedficos.","Participa activamente en la deliberaci\xf3n, la coproducci\xf3n de conocimiento y la toma de decisiones.",""]),t.s)
B.a16=new A.c("20","\xbfCu\xe1l es el papel del 'p\xfablico' en la ciencia posnormal?",B.SW,"C","La ciencia posnormal aboga por una 'comunidad ampliada de pares' que incluye no solo a cient\xedficos, sino tambi\xe9n a ciudadanos, grupos de inter\xe9s y otros actores que aportan conocimientos y valores relevantes.")
B.LA=A.a(s(["El gobierno de los recursos naturales por parte de una sola entidad.","Los procesos, reglas e instituciones a trav\xe9s de los cuales las decisiones ambientales son tomadas y implementadas.","La privatizaci\xf3n de los ecosistemas.",""]),t.s)
B.a5n=new A.c("20","La 'gobernanza ambiental' se refiere a:",B.LA,"B","Implica la participaci\xf3n de m\xfaltiples actores (gobiernos, sociedad civil, empresas, cient\xedficos) en la gesti\xf3n de los desaf\xedos ambientales, buscando soluciones colaborativas y equitativas.")
B.Mw=A.a(s(["Que la ciencia dicte las pol\xedticas sin discusi\xf3n.","Traducir el conocimiento cient\xedfico en acciones pol\xedticas efectivas y viceversa.","Separar completamente la ciencia de la pol\xedtica.",""]),t.s)
B.a1b=new A.c("20","El 'di\xe1logo ciencia-pol\xedtica' es crucial para:",B.Mw,"B","Es el puente entre la evidencia cient\xedfica y la toma de decisiones. Implica que los cient\xedficos comuniquen sus hallazgos de manera comprensible y que los pol\xedticos consideren la evidencia cient\xedfica en sus decisiones.")
B.LH=A.a(s(["Que es un problema f\xe1cil de resolver.","Que es un problema complejo, ambiguo, con m\xfaltiples causas interconectadas, soluciones inciertas y sin una definici\xf3n clara.","Que es un problema con una soluci\xf3n \xfanica.",""]),t.s)
B.a_M=new A.c("20","\xbfQu\xe9 significa que un problema ambiental es 'wicked problem' (problema perverso)?",B.LH,"B","Los problemas perversos (Rittel & Webber) son intr\xednsecamente dif\xedciles de abordar porque no tienen soluciones simples, sus fronteras son difusas y las intervenciones a menudo generan nuevas consecuencias no deseadas.")
B.QX=A.a(s(["No se puede tomar ninguna decisi\xf3n.","La falta de certeza absoluta no debe ser una excusa para la inacci\xf3n, pero requiere enfoques adaptativos y manejo de riesgos.","La ciencia no es \xfatil para los problemas ambientales.",""]),t.s)
B.a5d=new A.c("20","La 'incertidumbre cient\xedfica' en los debates ambientales implica que:",B.QX,"B","El principio de precauci\xf3n aborda esta incertidumbre. La ciencia a menudo solo puede ofrecer probabilidades, no certezas absolutas, especialmente en sistemas complejos. Esto requiere decisiones bajo incertidumbre.")
B.Of=A.a(s(["Un estudio solo de los beneficios econ\xf3micos de un proyecto.","Un proceso para identificar, predecir y evaluar los efectos ambientales y sociales de un proyecto o pol\xedtica propuestos.","Una herramienta para evitar proyectos.",""]),t.s)
B.YQ=new A.c("20","\xbfQu\xe9 es la 'evaluaci\xf3n de impacto ambiental' (EIA)?",B.Of,"B","La EIA es una herramienta preventiva de gesti\xf3n ambiental. Su objetivo es asegurar que las consideraciones ambientales se integren en la planificaci\xf3n y toma de decisiones desde etapas tempranas.")
B.QN=A.a(s(["El peso de la contaminaci\xf3n en la salud.","La acumulaci\xf3n desproporcionada de m\xfaltiples riesgos ambientales y de salud en comunidades vulnerables.","La carga de trabajo de los cient\xedficos ambientales.",""]),t.s)
B.a6o=new A.c("20","El concepto de 'cargas dobles' o 'triple carga' en la salud ambiental se refiere a:",B.QN,"B","Se relaciona con la justicia ambiental, se\xf1alando que las poblaciones ya desfavorecidas (por pobreza, raza, etc.) a menudo sufren una carga mayor de problemas ambientales y de salud.")
B.oo=A.a(s([B.zA,B.zq,B.zy,B.zD,B.zG,B.a90,B.zs,B.zB,B.zC,B.zx,B.zv,B.zu,B.zH,B.zE,B.zt,B.zF,B.zI,B.zw,B.zz,B.zr,B.Xx,B.a3d,B.a4M,B.XX,B.a0Y,B.a2M,B.YN,B.a9I,B.a08,B.a89,B.a92,B.Yv,B.XS,B.a9D,B.a8p,B.aaa,B.a9_,B.Yr,B.aay,B.YW,B.XR,B.a6d,B.a7d,B.a1l,B.aag,B.a7h,B.a4r,B.a4D,B.a0b,B.a8c,B.a79,B.a6v,B.a0y,B.a47,B.a5S,B.a9f,B.ZY,B.a9W,B.a8U,B.ab3,B.a5q,B.Xy,B.a__,B.Zs,B.a2T,B.a9u,B.a8u,B.a_Z,B.a4H,B.a4f,B.a8I,B.a40,B.Z6,B.ZP,B.a2Q,B.a7J,B.XB,B.a7O,B.aaf,B.a3k,B.a7K,B.a0Z,B.Zb,B.ab6,B.a5k,B.Yy,B.a3u,B.a2Z,B.a0D,B.a3r,B.a1p,B.a5b,B.a4_,B.a5w,B.a2p,B.a7M,B.a_a,B.a9w,B.a_9,B.a7q,B.XN,B.a6g,B.a_u,B.a2F,B.Zv,B.a8T,B.a6M,B.a68,B.a8x,B.a6y,B.a2G,B.a4L,B.a_U,B.a73,B.YL,B.a8K,B.Y6,B.a4w,B.a3e,B.Yk,B.a8N,B.a4G,B.aaE,B.a0O,B.a5N,B.a2E,B.a8r,B.aaB,B.aar,B.a52,B.a8L,B.a3E,B.a2A,B.ZM,B.a6m,B.a3j,B.a7X,B.a7r,B.aa7,B.a5l,B.a9K,B.a4a,B.a3L,B.Yx,B.a9G,B.ab_,B.a8A,B.a0G,B.Yz,B.a2L,B.YE,B.a7N,B.a0W,B.aaV,B.a3v,B.a9t,B.a88,B.a03,B.a_B,B.a13,B.a42,B.XC,B.XP,B.a3l,B.a5g,B.a4R,B.a3Y,B.Zw,B.ZA,B.a3m,B.ZG,B.ab8,B.a6C,B.aaH,B.Yo,B.a1r,B.a8Z,B.a8W,B.Yl,B.a9J,B.a5J,B.XQ,B.Yc,B.aai,B.a4O,B.a61,B.a5f,B.Y7,B.a5Q,B.a_f,B.Yi,B.a74,B.a67,B.a8v,B.a6j,B.a16,B.a5n,B.a1b,B.a_M,B.a5d,B.YQ,B.a6o]),t.tE)
B.lY=new A.DK(0,"named")
B.BP=new A.DK(1,"anonymous")
B.KL=A.a(s([B.lY,B.BP]),A.ah("y<DK>"))
B.ON=A.a(s(["Que ambas perspectivas resuelven la tensi\xf3n entre lo singular y lo colectivo desde un paradigma disyuntivo y antag\xf3nico.","Que el psicologismo es m\xe1s frecuente en el pensamiento liberal y el sociologismo en el pensamiento socialista.","Que el psicoan\xe1lisis ha privilegiado los sesgos psicologistas en la cultura 'psi'.",""]),t.s)
B.a9p=new A.c("1","Seg\xfan los planteos de Ana Mar\xeda Fern\xe1ndez, \xbfcu\xe1l es la cr\xedtica principal al psicologismo y al sociologismo?",B.ON,"A","Fern\xe1ndez critica que ambas posturas, en lugar de articular la complejidad, resuelven la tensi\xf3n oponiendo individuo y sociedad, lo que considera un paradigma disyuntivo t\xedpico del pensamiento occidental.")
B.JS=A.a(s(["Un reino de caos e incertidumbre.","Un orden feudal mejorado por la tecnolog\xeda.","Un orden social postradicional.",""]),t.s)
B.a4J=new A.c("1","Anthony Giddens define la modernidad reciente (tambi\xe9n llamada modernidad tard\xeda) como:",B.JS,"C","Giddens caracteriza la modernidad tard\xeda como 'postradicional' porque las tradiciones pierden su poder de gu\xeda y el individuo se ve forzado a tomar decisiones y construir su identidad de manera reflexiva.")
B.Po=A.a(s(["El materialismo como sustento crucial de ambas teor\xedas.","Las dificultades de comprender la articulaci\xf3n de las fuerzas sociales con los actos de los individuos.","La evoluci\xf3n de la sociedad socio hist\xf3ricamente y culturalmente.",""]),t.s)
B.a0q=new A.c("1","De acuerdo a A.M. Fern\xe1ndez las tesis individualistas y las tesis de mentalidad de grupo dan cuenta que:",B.Po,"B","Fern\xe1ndez plantea que ambas posturas (psicologismo y sociologismo) son reduccionistas y reflejan el problema de fondo para articular conceptualmente lo singular y lo colectivo.")
B.S4=A.a(s(["Conllevan una profunda desestructuraci\xf3n del yo (self) al este inscribirse en los sistemas institucionales.","Implican la extracci\xf3n de las relaciones sociales de sus circunstancias locales y su rearticulaci\xf3n en sistemas espacio temporales indefinidos.","Derivan del impacto social de las acciones de los sujetos en un determinado orden simb\xf3lico.",""]),t.s)
B.a32=new A.c("1","De acuerdo a Giddens, los mecanismos de desenclave:",B.S4,"B","El concepto central de 'desenclave' es precisamente el 'despegar' las interacciones de los lugares particulares, permitiendo su reestructuraci\xf3n a trav\xe9s de distancias de tiempo y espacio indefinidas.")
B.Jk=A.a(s(["Reposa sobre la idea de que los sujetos son naturalmente dependientes unos de otros.","Busca legitimar los sistemas colectivos de existencia.","Se propone conectar a sujetos considerados naturalmente independientes.",""]),t.s)
B.ZN=new A.c("1","De acuerdo a Marx, el contrato social de Rousseau:",B.Jk,"C","Marx critica la idea de Rousseau de partir de un individuo aislado y naturalmente independiente ('robinsonadas') que luego necesita un contrato para vincularse en sociedad.")
B.KI=A.a(s(["Es aquella que establece una divisi\xf3n entre teor\xeda y pr\xe1ctica.","Es la que pasa por separar lo subjetivo de lo objetivo.","Es la que separa alma y cuerpo.",""]),t.s)
B.a8J=new A.c("1","De acuerdo al pensamiento de De Brasi, la divisi\xf3n fundamental que ti\xf1e todas nuestras reflexiones y pr\xe1cticas:",B.KI,"B","Para De Brasi, la dicotom\xeda fundante del pensamiento occidental, de la que derivan otras como individuo/sociedad, es la separaci\xf3n artificial entre un polo subjetivo y uno objetivo.")
B.Q0=A.a(s(["No hay nada primario para interpretar pues, en el fondo, todo es ya interpretaci\xf3n; cada signo es en s\xed mismo no la cosa que se ofrece a la interpretaci\xf3n, sino interpretaci\xf3n de otros signos.","La interpretaci\xf3n no es m\xe1s que un juego autorreferente del int\xe9rprete, una suerte de solipsismo que puede ser desterrado gracias a las herramientas cient\xedficas.","Debe evadirse el peligro de interpretar las interpretaciones para, de esta manera, acceder a las cosas mismas.",""]),t.s)
B.a30=new A.c("1","En su ponencia sobre Marx, Nietzsche y Freud (1964), Michel Foucault ha se\xf1alado:",B.Q0,"A","Foucault postula que la hermen\xe9utica moderna nos enfrenta a una tarea infinita donde no existe un significado original, ya que todo signo es ya una interpretaci\xf3n de otros signos.")
B.MH=A.a(s(["La falacia de que la mentalidad de grupo otorga direccionalidad e intencionalidad a los momentos grupales.","La falacia de que los grupos pueden ser m\xe1s que la suma de individualidades.","La falacia de que no existe la mentalidad de grupo pero que se otorga direccionalidad por el inconsciente colectivo.",""]),t.s)
B.a6f=new A.c("1","En el texto 'el campo grupal', Ana Mar\xeda Fern\xe1ndez retoma lo que Asch denomin\xf3 'la falacia antropom\xf3rfica de la tesis de la mentalidad de grupo', esto hace referencia a:",B.MH,"A","La cr\xedtica apunta a no atribuir a la 'mentalidad de grupo' caracter\xedsticas de un psiquismo individual (como intenciones o deseos), lo cual ser\xeda una personificaci\xf3n falaz de un fen\xf3meno colectivo.")
B.LV=A.a(s(["El autor la considera un principio universal de la existencia humana.","Es la garant\xeda de una s\xf3lida identidad individual.","Implica la existencia imaginaria de un l\xedmite, que el autor asocia con la envoltura de la piel.",""]),t.s)
B.Y2=new A.c("1","La divisi\xf3n adentro/afuera, seg\xfan Juan Carlos De Brasi:",B.LV,"C","De Brasi sostiene que la dicotom\xeda adentro/afuera se apoya en la imagen corporal de la piel como un l\xedmite que separa un interior de un exterior, consider\xe1ndola una construcci\xf3n imaginaria.")
B.Nh=A.a(s(["El surgimiento del psicoan\xe1lisis y su descubrimiento acerca del mundo ps\xedquico de los sujetos plantea reconsiderar la racionalidad.","Occidente en el marco del capitalismo se comienza a pensar la sociedad como un conjunto de pensadores libres.","La fe hace necesaria la individualizaci\xf3n de los sujetos para el control moral.",""]),t.s)
B.a4g=new A.c("1","La noci\xf3n del individuo surge seg\xfan los planteos de Ana Mar\xeda Fern\xe1ndez:",B.Nh,"B","Fern\xe1ndez sit\xfaa la emergencia de la noci\xf3n de 'individuo' en la modernidad, ligada a la desintegraci\xf3n de los lazos comunitarios feudales y el surgimiento del modo de producci\xf3n capitalista.")
B.RF=A.a(s(["Se define en base a la conjunci\xf3n del propio yo (self) con coordenadas espaciales y temporales concretas.","Constituye una trayectoria a trav\xe9s de los diferentes \xf3rdenes institucionales de la modernidad.","Deriva del conjunto de relaciones que se dan por fuera de los procesos de reflexividad institucional.",""]),t.s)
B.a8H=new A.c("1","Para Anthony Giddens la identidad del yo (self):",B.RF,"B","La identidad del 'self' en la modernidad tard\xeda no es algo dado, sino un proyecto reflexivo que el individuo debe construir y sostener a trav\xe9s de los diversos contextos institucionales en los que participa.")
B.Sd=A.a(s(["Deriva de los sistemas de coerci\xf3n institucional sobre la vida personal.","Entra\xf1a un orden institucional en el cual el yo (self), logra desprenderse de las l\xf3gicas de pertenencia social.","Constituye el uso regularizado del conocimiento y la informaci\xf3n de la vida social, en tanto elemento constitutivo de su organizaci\xf3n y transformaci\xf3n.",""]),t.s)
B.a0x=new A.c("1","Para Anthony Giddens, la reflexividad institucional:",B.Sd,"C","La reflexividad de la modernidad implica que las pr\xe1cticas sociales son constantemente examinadas y reformadas a la luz de nueva informaci\xf3n, siendo el conocimiento un factor clave en su propia organizaci\xf3n y cambio.")
B.OX=A.a(s(["Emplean modos de conocimiento t\xe9cnico cuya validez depende de quienes lo practican.","Tienden a desestructurar la identidad del yo (self).","Se extienden a las relaciones sociales y a la intimidad del yo.",""]),t.s)
B.a_x=new A.c("1","Para Anthony Giddens, los sistemas expertos:",B.OX,"C","Los sistemas expertos no se limitan a \xe1reas t\xe9cnicas. Penetran en la vida social y personal (ej. terapia, medicina), influyendo en la construcci\xf3n reflexiva de la identidad y las relaciones \xedntimas.")
B.Lo=A.a(s(["Se presenta como desprendido de las relaciones sociales que hac\xedan de \xe9l parte integrante de conjuntos humanos espec\xedficos.","Aparece formando parte de nuevos grupos sociales como consecuencia del efecto conectivo del contrato social de Rousseau.","Deriva de las formaciones sociales feudales.",""]),t.s)
B.a7u=new A.c("1","Para Marx el sujeto emergente de las sociedades de libre concurrencia (formaciones econ\xf3mico-sociales capitalista):",B.Lo,"A","Marx explica que el 'individuo aislado' del siglo XVIII no es un punto de partida natural, sino el resultado hist\xf3rico de la disoluci\xf3n de las formas sociales feudales.")
B.P4=A.a(s(["Llevan a cabo una disoluci\xf3n del antropocentrismo moderno, de la misma manera que la modernidad hab\xeda descompuesto el teocentrismo medieval.","Transformaron la idea de hombre propio del racionalismo moderno y la reubicaron como eje central de sus reflexiones.","Al transformar la visi\xf3n de sujeto de la modernidad perpetuaron la idea de hombre del iluminismo.",""]),t.s)
B.a9E=new A.c("1","Se puede entender que Marx, Nietzsche y Freud respecto de la idea de hombre:",B.P4,"A","Estos autores descentran al sujeto de la posici\xf3n fundante que le otorg\xf3 la modernidad, mostrando que est\xe1 determinado por fuerzas que lo exceden (la historia, el inconsciente, la voluntad de poder).")
B.OJ=A.a(s(["La reflexividad institucional y la separaci\xf3n espacio-tiempo.","Los sistemas de confianza institucional.","Las se\xf1ales simb\xf3licas y los sistemas expertos.",""]),t.s)
B.a9b=new A.c("1","Seg\xfan Giddens, el desenclave tiene como mecanismos:",B.OJ,"C","Giddens identifica dos tipos de mecanismos de desanclaje que 'despegan' las relaciones sociales de sus contextos locales: las se\xf1ales simb\xf3licas (como el dinero) y los sistemas expertos (confianza en conocimiento t\xe9cnico an\xf3nimo).")
B.Qk=A.a(s(["Se opone al inconsciente, ya que \xe9ste lo precede.","Es aquello frente a lo cual se desdibuja el inconsciente.","Es aquello con que est\xe1 tramado el mismo inconsciente.",""]),t.s)
B.aba=new A.c("1","Tal como sostiene Raggio (citando a De Brasi) lo social-hist\xf3rico:",B.Qk,"C","Esta afirmaci\xf3n rompe con la idea de un inconsciente puramente individual. El inconsciente mismo est\xe1 constituido por la materia social e hist\xf3rica, eliminando la separaci\xf3n radical entre el 'adentro' y el 'afuera'.")
B.Qj=A.a(s(["La ideolog\xeda comunitarista, que privilegiaba la predominancia de los intereses colectivos.","La ideolog\xeda que legitima la sujeci\xf3n de la fuerza de trabajo al feudo.","La ideolog\xeda liberal que presupone el Contrato Social, en tanto protector de la libertad y los bienes de la persona.",""]),t.s)
B.a0B=new A.c("1","Uno de los aspectos que condiciona de manera significativa la aparici\xf3n del individuo como formaci\xf3n subjetiva es, seg\xfan Raggio:",B.Qj,"C","Raggio se\xf1ala que la ideolog\xeda liberal, con su \xe9nfasis en la libertad individual y la protecci\xf3n de la propiedad privada, es el marco de pensamiento que legitima y produce la figura del 'individuo'.")
B.So=A.a(s(["Demostrar que la producci\xf3n, es en definitiva algo que se basa en las capacidades naturales de los sujetos, vivan o no en sociedad.","Visualizar como la producci\xf3n s\xf3lo es pensable como producci\xf3n de sujetos que viven en sociedad.","Mostrar c\xf3mo las relaciones sociales de producci\xf3n son esencialmente las mismas para los sujetos de todas las \xe9pocas.",""]),t.s)
B.a6Z=new A.c("1","Uno de los principales objetivos de Marx en la Introducci\xf3n a los Elementos fundamentales para la cr\xedtica de la econom\xeda pol\xedtica (1857) es:",B.So,"B","Marx argumenta contra la idea de una 'producci\xf3n en general'. Sostiene que siempre se debe hablar de producci\xf3n en un estadio determinado del desarrollo social, es decir, la producci\xf3n de individuos que ya est\xe1n en sociedad.")
B.QA=A.a(s(["Que los tres pusieron en evidencia la influencia de la moral cristiana en la filosof\xeda moderna.","Que los tres complementan los desarrollos del pensamiento racional.","Que los tres cambiaron la naturaleza del signo.",""]),t.s)
B.a0i=new A.c("1","\xbfQu\xe9 destaca Foucault de Nietzsche, Freud y Marx?",B.QA,"C","Foucault sostiene que estos autores aportan una operativa que transforma la naturaleza del signo, modificando tanto la estrategia para interpretarlo como la imagen misma del sujeto que interpreta.")
B.RG=A.a(s(["Para mostrar la vigencia de un m\xe9todo que reconoc\xeda que las cosas se parec\xedan.","Para recuperar las t\xe9cnicas involucradas en ese m\xe9todo y rearticularlas en la hermen\xe9utica moderna.","Para mostrar como cada cultura ha tenido su sistema, su m\xe9todo de interpretaci\xf3n.",""]),t.s)
B.a5T=new A.c("1","\xbfPor qu\xe9 Foucault necesita recurrir al m\xe9todo de interpretaci\xf3n utilizado en el siglo XVI?",B.RG,"C","Foucault lo usa como ejemplo hist\xf3rico para demostrar que la interpretaci\xf3n no es universal y que cada \xe9poca organiza el saber y los signos de una manera particular y contingente.")
B.Mh=A.a(s(["La memoria es el resultado de acuerdos entre comunidades basadas en el contrato.","La memoria es fruto de la evoluci\xf3n de la especie en tanto caracter\xedsticas biol\xf3gicas heredadas.","El surgimiento de la memoria fue realizado con sangre, martirios y sacrificios.",""]),t.s)
B.a24=new A.c("2","\xbfC\xf3mo hace su aparici\xf3n la memoria seg\xfan Nietzsche en 'La genealog\xeda de la moral'?",B.Mh,"C","Nietzsche plantea que para que el hombre pudiera hacer promesas, fue necesario 'grabar' la memoria en \xe9l, lo cual 'no se realiz\xf3 jam\xe1s sin sangre, martirios y sacrificios'.")
B.Pk=A.a(s(["Los modos de subjetivaci\xf3n son las formas por las cuales la ciencia pierde eficacia y objetividad.","Los modos de subjetivaci\xf3n son esas modalidades desde las cuales se constituyen tanto los objetos como los sujetos.","Los modos de subjetivaci\xf3n son aquellos modos que hacen a los sujetos a diferencia de los modos de objetivaci\xf3n.",""]),t.s)
B.a0n=new A.c("2","De acuerdo a Eira y Romano:",B.Pk,"B","Los autores entienden la 'subjetivaci\xf3n' como las pr\xe1cticas, discursos y relaciones de poder hist\xf3ricas que producen simult\xe1neamente tanto las formas de ser sujeto como los objetos de conocimiento.")
B.Kv=A.a(s(["Mostrar como el mecanismo de la represi\xf3n llega a -en ciertos casos- a producir diferentes formas de sufrimiento ps\xedquico.","El planteo de que una parte significativa de nuestra vida an\xedmica se ha sustra\xeddo a nuestro conocimiento y la soberan\xeda de nuestra voluntad.","La postulaci\xf3n de que la sexualidad infantil es determinante de nuestra conformaci\xf3n como sujetos ps\xedquicos.",""]),t.s)
B.a9S=new A.c("2","De acuerdo a Freud, una de las ofensas m\xe1s grandes que ha recibido nuestro narcisismo consiste en:",B.Kv,"B","Freud describe la ofensa psicol\xf3gica que \xe9l mismo inflige al demostrar que el yo no es soberano en su propia casa, estando sometido a lo inconsciente.")
B.Nb=A.a(s(["Someter a revisi\xf3n la moral sexual imperante.","Someter a revisi\xf3n cr\xedtica las metas sexuales.","Someter a revisi\xf3n el proceso de represi\xf3n.",""]),t.s)
B.a2s=new A.c("2","De acuerdo a lo expuesto por Sigmund Freud en *Una Dificultad del Psicoan\xe1lisis*, la terapia psicoanal\xedtica busca entre otras cosas:",B.Nb,"C","La terapia psicoanal\xedtica no busca eliminar las pulsiones, sino trabajar sobre los procesos defensivos como la represi\xf3n para hacer consciente lo reprimido y permitir al yo encontrar soluciones no sintom\xe1ticas.")
B.RE=A.a(s(["Solo se puede entender como pr\xe1ctica revolucionaria.","Solo puede concebirse como actividad intelectual, es decir como toma de conciencia individual.","Se materializa en la interpretaci\xf3n de la realidad.",""]),t.s)
B.a_k=new A.c("2","De acuerdo a Marx la coincidencia de la modificaci\xf3n de las circunstancias y de la actividad humana:",B.RE,"A","En su tercera tesis sobre Feuerbach, Marx une el cambio de las circunstancias con el cambio del ser humano. Esta coincidencia se da en la 'pr\xe1ctica revolucionaria', la acci\xf3n transformadora.")
B.OB=A.a(s(["Desde los diagn\xf3sticos psiqui\xe1tricos hegem\xf3nicos.","En formas jur\xeddicas preponderantes.","A partir de pr\xe1cticas concretas de vigilancia y control.",""]),t.s)
B.a_4=new A.c("2","De acuerdo con Foucault, el surgimiento de la noci\xf3n de anormalidad est\xe1 sostenido:",B.OB,"C","Foucault argumenta que la figura del 'anormal' emerge hist\xf3ricamente a partir de un conjunto de t\xe9cnicas y pr\xe1cticas de poder, vigilancia y normalizaci\xf3n aplicadas sobre los cuerpos.")
B.NW=A.a(s(["De la naturaleza humana, impregnada de la b\xfasqueda de la verdad.","De relaciones conflictivas de poder entre el conocimiento y los instintos.","De una profunda sustancia teol\xf3gica que conforma al sujeto humano.",""]),t.s)
B.YX=new A.c("2","Desde la propuesta de Foucault, los modos de saber devienen:",B.NW,"B","Foucault plantea que el conocimiento no es producto de una naturaleza armoniosa, sino el resultado de la lucha y las relaciones de poder entre los instintos. Es una 'invenci\xf3n' surgida de estas tensiones.")
B.Tj=A.a(s(["Suplantan a los mecanismos disciplinarios propios de las sociedades modernas.","Consiste en gran medida en la reactivaci\xf3n y transformaci\xf3n de las t\xe9cnicas jur\xeddico-legales y las t\xe9cnicas disciplinarias en una nueva l\xf3gica.","Va a establecer una divisi\xf3n binaria entre lo permitido y lo no permitido.",""]),t.s)
B.a0d=new A.c("2","El dispositivo de seguridad seg\xfan Foucault:",B.Tj,"B","Foucault explica que los dispositivos de seguridad no reemplazan a los mecanismos disciplinarios o legales, sino que los integran y los hacen funcionar dentro de una nueva l\xf3gica, m\xe1s flexible y centrada en la gesti\xf3n de poblaciones.")
B.Kx=A.a(s(["Como miembro de un linaje, de un pueblo, de una casta, de un estamento, de una instituci\xf3n, o como integrante de una multitud organizada.","Como un animal de costumbre.","Como miembro de un clan que lo constituye como sujeto.",""]),t.s)
B.a8n=new A.c("2","En 'Psicolog\xeda de las masas...' Freud plantea que la psicolog\xeda debe considerar al individuo como:",B.Kx,"A","Freud argumenta que la psicolog\xeda individual es, desde el principio, social, ya que el 'otro' siempre est\xe1 presente. Por lo tanto, el individuo siempre debe ser considerado en sus m\xfaltiples pertenencias a colectivos.")
B.Ok=A.a(s(["Est\xe1 siempre anudada desde el comienzo a las creencias (religiosas, pol\xedticas, etc.) de la familia del sujeto.","Est\xe1 siempre moldeada por la educaci\xf3n escolar.","Est\xe1 desde el comienzo del desarrollo individual anudado al yo; es decir que 'inviste al yo' de la persona.",""]),t.s)
B.a3A=new A.c("2","En 'Una dificultad del psicoan\xe1lisis' (1916) Freud plantea que todo anhelo er\xf3tico y toda capacidad de amor:",B.Ok,"C","Freud explica aqu\xed el concepto de narcisismo primario, donde la libido (energ\xeda de amor/deseo) est\xe1 inicialmente volcada sobre el propio yo, antes de dirigirse a objetos externos.")
B.Qq=A.a(s(["Que la mala conciencia surge cuando el hombre se encuentra s\xf3lo analizando sus pensamientos.","Que la mala conciencia es el resultado del proceso de vuelta hacia dentro de los propios instintos.","Que la mala conciencia surge de la descarga de los instintos hacia fuera.",""]),t.s)
B.YK=new A.c("2","En cuanto a la mala conciencia, Nietzsche ubica su origen 'cuando el hombre se encontr\xf3 definitivamente encerrado en el sortilegio de la sociedad y de la paz'. Con esta frase hace referencia a:",B.Qq,"B","Para Nietzsche, la 'mala conciencia' es la enfermedad que surge con la civilizaci\xf3n. Al no poder descargar sus instintos hacia afuera, el hombre los vuelve contra s\xed mismo, creando la interioridad y la culpa.")
B.NC=A.a(s(["Depende del n\xfamero de personas que integren una masa.","Se puede homologar al instinto de manada (herd instinct).","Los comienzos de su formaci\xf3n pueden hallarse en un c\xedrculo estrecho, como el de la familia.",""]),t.s)
B.Zr=new A.c("2","En la Introducci\xf3n a Psicolog\xeda de las masas y an\xe1lisis del yo, Freud plantea, a prop\xf3sito de la 'pulsi\xf3n social', que:",B.NC,"C","Freud cuestiona la idea de una 'pulsi\xf3n social' primaria. Argumenta que los lazos sociales se desarrollan a partir de los v\xednculos afectivos iniciales que se establecen en la familia.")
B.M2=A.a(s(["Las condiciones sociales y econ\xf3micas de los sujetos no son algo que impida el conocimiento sino las condiciones que explican al sujeto de conocimiento.","El an\xe1lisis del discurso es de car\xe1cter estrat\xe9gico.","El poder es una propiedad de las clases dominantes que imponen su pensamiento subjetivo.",""]),t.s)
B.a15=new A.c("2","En la perspectiva del marxismo acad\xe9mico, la ideolog\xeda es aquello que obstaculiza el acceso al conocimiento verdadero. Seg\xfan Foucault:",B.M2,"A","Foucault no ve las condiciones materiales como un 'obst\xe1culo' (ideolog\xeda). Para \xe9l, esas condiciones son precisamente lo que produce y hace posible un determinado tipo de sujeto y de saber.")
B.PL=A.a(s(["Las t\xe9cnicas de interpretaci\xf3n de Marx, Nietzsche y Freud, sirven para descubrir la verdad oculta de las cosas.","La interpretaci\xf3n no puede acabarse nunca porque no hay nada absolutamente primario que interpretar, pues en el fondo todo es ya interpretaci\xf3n.","La v\xeda de la interpretaci\xf3n consiste en considerar que existe un sujeto del conocimiento capaz de descubrir la verdad interpret\xe1ndola.",""]),t.s)
B.a2V=new A.c("2","En su ponencia de 1964 (Nietzsche, Freud, Marx) Michel Foucault afirma que:",B.PL,"B","Esta es una de las conclusiones centrales de Foucault sobre la hermen\xe9utica moderna: la interpretaci\xf3n es una tarea infinita porque no hay un texto original o una verdad primera a la cual llegar.")
B.Pa=A.a(s(["Es aquel por el cual la verdad se da en la historia.","No est\xe1 dado de manera previa y definitiva, sino que posee una historia.","Trasciende los diversos momentos de la historia de occidente, siendo el punto de origen de todo conocimiento.",""]),t.s)
B.a57=new A.c("2","Foucault, en La verdad y las formas jur\xeddicas, a prop\xf3sito del sujeto de conocimiento plantea que \xe9ste:",B.Pa,"B","Foucault critica la idea de un sujeto de conocimiento universal y ahist\xf3rico. Sostiene que el sujeto mismo, as\xed como la verdad, son producto de una historia y de las pr\xe1cticas sociales.")
B.O5=A.a(s(["El narcisismo representa una configuraci\xf3n del sujeto en la Modernidad.","Narcisismo da cuenta al estado en el que el yo conserva la libido.","El narcisismo pone en juego el amor hacia los objetos de forma radical.",""]),t.s)
B.a9Z=new A.c("2","Freud en 'una dificultad del psicoan\xe1lisis' en relaci\xf3n al narcisismo sostiene que:",B.O5,"B","Freud define el narcisismo como una fase del desarrollo en la que la libido del individuo est\xe1 dirigida hacia el propio yo, antes de dirigirse a objetos externos.")
B.JT=A.a(s(["La que provoc\xf3 Cop\xe9rnico cuando plante\xf3 su teor\xeda helioc\xe9ntrica.","La herida hecha por Nietzsche cuando critica la moral de occidente.","La que provoc\xf3 el propio Freud al destronar a la conciencia de su lugar de reina de la vida an\xedmica.",""]),t.s)
B.a_K=new A.c("2","Freud identifica tres grandes heridas narcisistas en la cultura occidental, entre las que encontramos:",B.JT,"C","Freud describe tres ofensas al amor propio de la humanidad: la cosmol\xf3gica (Cop\xe9rnico), la biol\xf3gica (Darwin) y la psicol\xf3gica, que \xe9l mismo inflige al demostrar que el yo no es soberano en su propia casa.")
B.Om=A.a(s(["Se entiende a partir del conjunto de v\xednculos afectivos que el sujeto establece desde su nacimiento en el \xe1mbito familiar.","Se explica a partir de la existencia de una esencia propia de cada sujeto.","Es entendida como el conjunto de las relaciones sociales.",""]),t.s)
B.a7Y=new A.c("2","La concepci\xf3n de sujeto en el pensamiento de Marx:",B.Om,"C","En su sexta tesis sobre Feuerbach, Marx afirma que 'la esencia humana no es algo abstracto inherente a cada individuo. Es, en su realidad, el conjunto de las relaciones sociales'.")
B.Jc=A.a(s(["Se debe considerar ante todo, las condiciones comunes a todas las \xe9pocas, esto es la producci\xf3n en general.","Se est\xe1 hablando siempre de producci\xf3n en un estadio determinado del desarrollo social, de la producci\xf3n de individuos en sociedad.","Se hace referencia a la capacidad natural que tienen los hombres de producir.",""]),t.s)
B.Zc=new A.c("2","Marx afirma que, cuando se habla de producci\xf3n:",B.Jc,"B","Marx rechaza la noci\xf3n de una 'producci\xf3n en general' ahist\xf3rica. Para \xe9l, la producci\xf3n es siempre una actividad social y concreta, que ocurre en una etapa espec\xedfica del desarrollo hist\xf3rico.")
B.Ow=A.a(s(["Se manifiesta en el advenimiento del Dios cristiano.","Surge de la relaci\xf3n que establecen amos y esclavos.","Es el producto de un cambio progresivo y gradual en aras de una mejor convivencia.",""]),t.s)
B.a1L=new A.c("2","Nietzsche, en el tratado II de La genealog\xeda de la moral plantea que el m\xe1ximo nivel del sentimiento de culpa:",B.Ow,"A","Nietzsche argumenta que la deuda con los antepasados se transfigura en deuda hacia un dios. Con el Dios cristiano, esta deuda se vuelve impagable y el sentimiento de culpa alcanza su m\xe1xima expresi\xf3n.")
B.Nt=A.a(s(["Son propiedad del poder de una clase dominante.","Son lineales, se corresponden a cada tipo de relaci\xf3n social.","Son intr\xednsecos a todas las relaciones sociales.",""]),t.s)
B.a0C=new A.c("2","Para Foucault, los mecanismos de poder:",B.Nt,"C","En la visi\xf3n foucaultiana, el poder es productivo y es inherente a todas las relaciones: familiares, sexuales, de producci\xf3n, etc.")
B.Pp=A.a(s(["El capital es un factor que destruye comunidades.","El capital es tambi\xe9n trabajo pasado objetivado.","El capital es patrimonio heredado por parte de la burgues\xeda.",""]),t.s)
B.a53=new A.c("2","Para Marx el capital tiene diversas significaciones sin dejar de ser un instrumento de producci\xf3n. Otros atributos que comprenden la categor\xeda para el autor son:",B.Pp,"B","Marx define el capital no solo como un objeto, sino fundamentalmente como una relaci\xf3n social de producci\xf3n. En este sentido, es 'trabajo pasado, trabajo objetivado' que domina al trabajo vivo.")
B.M_=A.a(s(["La sociolog\xeda del conocimiento al preguntarse por la realidad se inserta dentro de la filosof\xeda.","Lo que se entiende por realidad se construye socialmente, la sociolog\xeda del conocimiento deber\xeda estudiar los procesos a trav\xe9s de los cuales \xe9sta es producida.","Se compone de una multiplicidad de factores que pueden ser entendidos a partir de modelos matem\xe1ticos.",""]),t.s)
B.a3B=new A.c("2","Seg\xfan Eira y Romano los autores Berger y Luckmann tuvieron gran impacto en lo que se ha dado en llamar 'sociolog\xeda del conocimiento'. En este sentido, para Berger y Luckmann la realidad:",B.M_,"B","La tesis central de Berger y Luckmann es que la realidad es una construcci\xf3n social, y que la tarea de la sociolog\xeda del conocimiento es analizar los procesos por los cuales el 'conocimiento' llega a ser socialmente establecido como 'realidad'.")
B.NF=A.a(s(["Identificar nuestra sexualidad con los procesos psicol\xf3gicos inconscientes.","Identificar los instintos (pulsiones) con nuestra vida an\xedmica.","Identificar lo 'an\xedmico' con lo 'conciente'.",""]),t.s)
B.a6l=new A.c("2","Seg\xfan Freud, uno de nuestros grandes errores consiste en:",B.NF,"C","El descubrimiento fundamental del psicoan\xe1lisis es que lo an\xedmico no es coextensivo con lo consciente. La existencia de lo inconsciente es una de las tesis centrales de Freud.")
B.N9=A.a(s(["Un conjunto de leyes y normas para controlar la delincuencia.","Tipos de subjetividad y formas de saber.","Un espacio de poder social a lo interno de cualquier democracia formal.",""]),t.s)
B.XE=new A.c("2","Seg\xfan Foucault, las pr\xe1cticas jur\xeddicas definen sustantivamente:",B.N9,"B","Foucault analiza las pr\xe1cticas jur\xeddicas como un lugar donde las relaciones de poder constituyen formas de saber y tipos de sujeto en una sociedad.")
B.Ll=A.a(s(["Introducir las relaciones burguesas como leyes inmutables de la sociedad.","Describir las diferencias hist\xf3ricas de la distribuci\xf3n en los distintos estadios de desarrollo.","Explicar de forma cient\xedfica por qu\xe9 la distribuci\xf3n no est\xe1 separada de la producci\xf3n.",""]),t.s)
B.XD=new A.c("2","Seg\xfan Karl Marx en 'Introducci\xf3n a la Econom\xeda Pol\xedtica' (1857/1971) la presentaci\xf3n de la producci\xf3n como regida por leyes eternas de la naturaleza permite:",B.Ll,"A","Marx critica a la econom\xeda cl\xe1sica por presentar las relaciones de producci\xf3n capitalistas como si fueran leyes naturales y eternas, cuando en realidad son un producto hist\xf3rico.")
B.Ni=A.a(s(["Olvida que son los hombres, precisamente, los que hacen que cambien las circunstancias.","Olvida que los hombres no son capaces de modificar dichas circunstancias.","Se presenta a los sujetos como formas de construir nuevas modalidades de comunidad.",""]),t.s)
B.a0r=new A.c("2","Seg\xfan Marx, la teor\xeda materialista de que los hombres son producto de las circunstancias y de la educaci\xf3n:",B.Ni,"A","En su tercera tesis sobre Feuerbach, Marx critica al materialismo anterior por ser contemplativo y olvidar que la pr\xe1ctica humana ('pr\xe1ctica revolucionaria') transforma tanto las circunstancias como a los propios hombres.")
B.Sf=A.a(s(["En la relaci\xf3n entre amos y esclavos.","En la relaci\xf3n entre madre e hijo.","En la relaci\xf3n entre compradores y vendedores, acreedores y deudores.",""]),t.s)
B.Z8=new A.c("2","Seg\xfan Nietzsche, en el tratado II de La genealog\xeda de la moral, el sentimiento de culpa tiene su origen en:",B.Sf,"C","Nietzsche rastrea el origen de la culpa (Schuld) a su origen material: la deuda (Schulden). La relaci\xf3n contractual acreedor-deudor es la base sobre la que se construy\xf3 el sentimiento de obligaci\xf3n.")
B.LI=A.a(s(["Es una estrategia pol\xedtica que atraviesa todos los planos de la vida y regula tanto al cuerpo del sujeto como al cuerpo social.","Procura constituir una teor\xeda acerca de los mecanismos en los que el poder opera como l\xf3gica represiva sobre los cuerpos.","Constituye una serie de mecanismos de un poder que se presenta como una sustancia que se funda en s\xed misma.",""]),t.s)
B.a_6=new A.c("2","Seg\xfan los desarrollos de Foucault, el biopoder:",B.LI,"A","El biopoder es un concepto clave en Foucault que describe una forma de poder que se ejerce sobre la vida misma, tanto a nivel individual (anatomopol\xedtica del cuerpo) como a nivel de la poblaci\xf3n (biopol\xedtica).")
B.Ng=A.a(s(["Que el poder es un ejercicio y por ello nadie lo tiene, se trata de un ejercicio que se genera en base a mecanismos que interaccionan entre s\xed.","Que el poder es una sustancia que se funda en s\xed misma.","Que el poder se presenta como una l\xf3gica represiva sobre los cuerpos.",""]),t.s)
B.a9i=new A.c("2","\xbfQu\xe9 responder\xeda Foucault ante la afirmaci\xf3n 'El poder lo posee el gobierno de turno y todas las cosas buenas y malas refieren a que hace dicho gobierno con el mismo'?",B.Ng,"A","Foucault concibe el poder no como algo que se posee, sino como algo que se ejerce. Es una red de relaciones estrat\xe9gicas, inmanente a toda relaci\xf3n social, que no emana de un \xfanico centro.")
B.Ph=A.a(s(["La forma en que el capitalismo, en tanto m\xe1quina exterior a los sujetos, ha logrado imponerse sobre ellos.","Mostrar como el objeto, en tanto objeto del consumo, funciona para los sujetos como un satisfactor inmediato.","La articulaci\xf3n de la estructura afectivo-deseante de los sujetos con la tendencia a convertirnos en c\xf3mplices del capitalismo.",""]),t.s)
B.a2J=new A.c("3","\xbfCu\xe1l es el enfoque principal de Jos\xe9 Enrique Ema L\xf3pez, en su art\xedculo 'Capitalismo y subjetividad'?",B.Ph,"C","El autor se centra en c\xf3mo el capitalismo se sostiene gracias a que nuestra propia subjetividad y deseo se acoplan a su l\xf3gica, volvi\xe9ndonos 'c\xf3mplices' en la perpetuaci\xf3n del sistema.")
B.SR=A.a(s(["Porque entiende que el capitalismo utiliza el deseo adictivo del plus-de gozar para empujarnos hacia un duelo constante.","Porque entiende al plus de gozar como una paradoja que divide al sujeto, mientras se satisface en su no satisfacci\xf3n.","Porque entiende al plus de gozar como una necesidad imperiosa de autosatisfacci\xf3n que hay que combatir con austeridad.",""]),t.s)
B.a2l=new A.c("3","\xbfC\xf3mo es que Ema L\xf3pez utiliza el concepto de plus de gozar para revisar el concepto de sujeto?",B.SR,"B","Bas\xe1ndose en Lacan, L\xf3pez utiliza el concepto para explicar la l\xf3gica del consumo. El sujeto busca una satisfacci\xf3n total que nunca llega, y en esa b\xfasqueda insatisfecha encuentra una forma parad\xf3jica de goce.")
B.RD=A.a(s(["Un sujeto esclavo de las imposiciones del capitalismo.","Sujetos libres de sujetamiento neoliberal.","Un sujeto aut\xf3nomo y que presupone su libre elecci\xf3n.",""]),t.s)
B.a1U=new A.c("3","\xbfQu\xe9 tipo de sujeto produce el modo de subjetivaci\xf3n capitalista seg\xfan Ema L\xf3pez?",B.RD,"C","L\xf3pez sostiene que, parad\xf3jicamente, el capitalismo produce un sujeto que se percibe a s\xed mismo como libre y aut\xf3nomo, funcionando esta creencia como un 'fetiche' que oculta los mecanismos de sujeci\xf3n.")
B.Kb=A.a(s(["La sociabilidad y el sentido comunitario.","La importancia de la autoridad disciplinar de la psicolog\xeda y la psiquiatr\xeda.","Los imperativos m\xe1s importantes son el ser feliz y el estar bien.",""]),t.s)
B.a3z=new A.c("3","\xbfCu\xe1les son los imperativos que proponen las culturas terap\xe9uticas seg\xfan la cr\xedtica que hace Papalini sobre estas?",B.Kb,"C","Papalini critica la cultura terap\xe9utica por promover mandatos de felicidad y bienestar, convirtiendo la gesti\xf3n de las emociones y la autorrealizaci\xf3n en una obligaci\xf3n individual.")
B.SP=A.a(s(["Porque son discursos coercitivos para que los sujetos promuevan su felicidad.","Porque se presentan como modos de subjetivaci\xf3n de los sujetos, por los cuales son convocados a tomar un rol activo para maximizar y gestionar su propia felicidad.","Porque son un recurso colectivo revolucionario indispensable para transformar la realidad opresiva.",""]),t.s)
B.a8f=new A.c("3","\xbfPor qu\xe9 Papalini entiende que los discursos de autoayuda son un mecanismo de biopoder?",B.SP,"B","Estos discursos operan a nivel del deseo y la autogesti\xf3n. Convocan al sujeto a trabajar sobre s\xed mismo para ser m\xe1s feliz y productivo, alineando sus deseos con los objetivos de la gubernamentalidad neoliberal.")
B.Rm=A.a(s(["El/la trabajador/a cognitivo est\xe1 desafectado/a de su trabajo.","Es un proceso de trabajo, como un archipi\xe9lago de islas infinitas (trabajadores/as) diseminadas que son aut\xf3nomas y al mismo tiempo, interdependientes.","El/la trabajador/a cognitivo deviene empresario/a tambi\xe9n en el plano jur\xeddico.",""]),t.s)
B.a99=new A.c("3","Berardi (2003) para abordar el trabajo cognitivo en la red y sus implicaciones en la transformaci\xf3n tecnol\xf3gica digital expresa:",B.Rm,"B","Berardi utiliza la met\xe1fora del archipi\xe9lago para describir c\xf3mo los trabajadores cognitivos est\xe1n dispersos y son formalmente aut\xf3nomos, pero est\xe1n interconectados e interdependientes a trav\xe9s de la red digital.")
B.Pv=A.a(s(["El sujeto liberal aut\xf3nomo es el \xfanico que logra desprenderse efectivamente de los sistemas de dominaci\xf3n.","Permite soportar el modo de subjetivaci\xf3n capitalista en su empuje de fragmentaci\xf3n, incertidumbre e incompletud.","Los presupuestos liberales funcionan de tal forma que obligan a los sujetos a realizar acciones que no querr\xedan hacer.",""]),t.s)
B.a6U=new A.c("3","Ema L\xf3pez, analizando la noci\xf3n liberal de sujeto, sostiene que esta funciona como un fetiche. Esto es as\xed en tanto:",B.Pv,"B","La idea de ser un 'sujeto liberal aut\xf3nomo' funciona como un fetiche que nos hace creer en nuestro control. Esta creencia ayuda a soportar un sistema que en verdad nos fragmenta y nos mantiene insatisfechos.")
B.SX=A.a(s(["Una exigencia de transparencia hacia los dem\xe1s, mientras \xe9l mismo puede operar en la opacidad.","Buscar el consenso y la deliberaci\xf3n colectiva a trav\xe9s de las plataformas digitales.","Respetar la privacidad y los l\xedmites entre lo p\xfablico y lo privado.",""]),t.s)
B.a2o=new A.c("3","En la era digital, seg\xfan \xc9ric Sadin, el 'individuo tirano' se caracteriza por:",B.SX,"A","Sadin describe una asimetr\xeda donde el individuo exige transparencia total del poder y de los otros, pero a menudo utiliza la opacidad y la desinformaci\xf3n para imponer su propia perspectiva, convirti\xe9ndose en una fuerza 'tir\xe1nica'.")
B.MP=A.a(s(["Un retorno parcial a formas de gubernamentalidad propias de la institucionalidad moderna.","Una nueva forma de la gubernamentalidad que focaliza la infelicidad y la vuelve un problema para la salud p\xfablica.","Una forma de la gubernamentalidad que resalta y valora la capacidad del sujeto para resolver las m\xfaltiples contingencias como \xfanico responsable.",""]),t.s)
B.YS=new A.c("3","Para Vanina Papalini el neoprudencialismo supone:",B.MP,"C","El neoprudencialismo es una forma de gobierno neoliberal donde los riesgos son transferidos al individuo. Se espera que cada sujeto se autogestione y resuelva sus problemas de forma privada.")
B.R_=A.a(s(["Es fundamental el trabajo comunicacional, podr\xeda simbolizar el enriquecimiento del trabajo.","No es esencial el trabajo de comunicaci\xf3n y por lo tanto decrece en el \xe1mbito laboral.","Es fundamental el trabajo comunicacional y asimismo, no implica decrecimiento laboral.",""]),t.s)
B.aae=new A.c("3","Seg\xfan (Berardi, 2003) el trabajo cognitivo:",B.R_,"A","El trabajo cognitivo o 'infotrabajo' se basa en la manipulaci\xf3n de signos y la comunicaci\xf3n. En teor\xeda, esto podr\xeda representar un enriquecimiento, aunque Berardi tambi\xe9n analiza su lado oscuro (estr\xe9s, precariedad).")
B.Je=A.a(s(["Es su propio empresario, siendo independiente en el plano jur\xeddico y sustancial.","Es su propio empresario, siendo independiente en el plano sustancial pero no en el plano jur\xeddico.","Es su propio empresario, siendo independiente en el plano jur\xeddico pero no en el plano sustancial.",""]),t.s)
B.a8X=new A.c("3","Seg\xfan Berardi, el trabajador aut\xf3nomo contempor\xe1neo:",B.Je,"C","Berardi describe la precarizaci\xf3n del trabajo. Aunque el trabajador aut\xf3nomo no tenga un contrato formal de dependencia (independencia jur\xeddica), est\xe1 sometido a la l\xf3gica de la red productiva del capital (dependencia sustancial).")
B.KZ=A.a(s(["Que las personas tienen una identidad \xfanica y coherente que se mantiene en todos los espacios digitales.","Que las personas presentan m\xfaltiples versiones de s\xed mismas en distintos espacios digitales (redes sociales, foros, etc.).","Que la identidad digital es siempre una representaci\xf3n falsa de la identidad real.",""]),t.s)
B.XG=new A.c("3","Seg\xfan Ram\xedrez y Anzald\xfaa, \xbfqu\xe9 implica la 'multiplicidad del yo' en la era digital?",B.KZ,"B","Los autores sostienen que en la era digital, la identidad no es unificada. Las personas gestionan y presentan diferentes facetas de s\xed mismas dependiendo de la plataforma, lo que lleva a una 'multiplicidad del yo'.")
B.Mj=A.a(s(["Un sistema pol\xedtico donde la mayor\xeda oprime a las minor\xedas a trav\xe9s de elecciones democr\xe1ticas.","Una forma de control donde la presi\xf3n social ejercida por la multitud conectada digitalmente uniformiza las opiniones y sofoca la disidencia.","La capacidad de la multitud para organizarse y derrocar gobiernos autoritarios a trav\xe9s de las redes sociales.",""]),t.s)
B.a9j=new A.c("3","Seg\xfan \xc9ric Sadin, \xbfqu\xe9 se entiende por 'totalitarismo de la multitud'?",B.Mj,"B","Sadin usa este t\xe9rmino para describir un nuevo tipo de control social que no viene de un Estado totalitario, sino de la propia multitud interconectada, que a trav\xe9s de la vigilancia mutua y la presi\xf3n social, impone una conformidad.")
B.OQ=A.a(s(["La funci\xf3n de mando que se encuentra localizada territorialmente, y direcci\xf3n gerencial desde un espacio claramente delimitado.","El analfabetismo digital del cognitoriado y la irrelevancia de los algoritmos.","La puesta en red (coordinaci\xf3n de fragmentos en un \xfanico flujo) y la diseminaci\xf3n del proceso de trabajo en islas productivas.",""]),t.s)
B.a0R=new A.c("3","La transformaci\xf3n tecnol\xf3gica digital, para Franco Berardi, ha puesto en marcha dos procesos diferentes pero integrados:",B.OQ,"C","Berardi describe la organizaci\xf3n del trabajo cognitivo como un 'archipi\xe9lago'. Los trabajadores est\xe1n dispersos ('islas'), pero interconectados y coordinados a trav\xe9s de la red digital.")
B.QK=A.a(s(["La ficci\xf3n que la mentalidad individual solo se origina a partir de la mentalidad grupal.","La ficci\xf3n que la mentalidad grupal aporta un plus con sustento biol\xf3gico.","La ficci\xf3n del individuo que impide pensar cualquier plus grupal y la ficci\xf3n del grupo como intencionalidad.",""]),t.s)
B.a63=new A.c("1","Ana Mar\xeda Fern\xe1ndez dice que se hace necesario someter a elucidaci\xf3n cr\xedtica dos ficciones:",B.QK,"C","Fern\xe1ndez propone deconstruir ambas ficciones: la del individuo como entidad pre-social (que niega lo grupal) y la del grupo como un super-individuo (la falacia antropom\xf3rfica).")
B.OU=A.a(s(["Apuesta a la sincron\xeda grupal anulando las diacron\xedas.","Plantea que la horizontalidad se encuentra subordinada a la verticalidad.","Mantiene la tensi\xf3n sin resolver en ambas instancias.",""]),t.s)
B.aau=new A.c("1","Ana Mar\xeda Fern\xe1ndez sostiene que la noci\xf3n de horizontalidad y verticalidad propuesta por Pichon-Rivi\xe8re en relaci\xf3n a los grupos:",B.OU,"C","Para Fern\xe1ndez, el valor de la conceptualizaci\xf3n de Pichon-Rivi\xe8re reside en que no disuelve la tensi\xf3n entre lo singular (verticalidad) y lo colectivo (horizontalidad), sino que la mantiene como un eje din\xe1mico.")
B.OW=A.a(s(["La tesis de las influencias rec\xedprocas es la soluci\xf3n m\xe1s sensata.","Hay marcos referenciales que logran una aproximaci\xf3n m\xe1s inteligente al dilema como son las teor\xedas cognitivistas.","Hay formulaciones conceptuales que si bien se siguen posicionando de manera dualista, ensayan respuestas m\xe1s interesantes como ser la noci\xf3n de v\xednculo propuesta por Enrique Pich\xf3n-Rivi\xe8re.",""]),t.s)
B.a8S=new A.c("1","En el art\xedculo *Acerca de un problema mal planteado*, Raggio plantea, en relaci\xf3n al dualismo individuo-sociedad:",B.OW,"C","Raggio reconoce que, aunque muchas teor\xedas no superan el dualismo, algunas como la de Pichon-Rivi\xe8re son valiosas porque intentan pensar la articulaci\xf3n entre la estructura social y el mundo interno.")
B.OP=A.a(s(["Se juega en coordenadas concretas de espacio-tiempo.","Requiere de mecanismos m\xe1s simples que los puestos en pr\xe1ctica en la modernidad propiamente dicha.","Deriva de sistemas abstractos nuevos como lo constituye la figura del experto.",""]),t.s)
B.a28=new A.c("1","En la modernidad tard\xeda (la actualidad) la reflexividad del yo (self):",B.OP,"C","Seg\xfan Giddens, en la modernidad tard\xeda, la construcci\xf3n del yo depende cada vez m\xe1s de la confianza en sistemas abstractos, como el conocimiento de los expertos (m\xe9dicos, terapeutas, etc.), que gu\xedan las decisiones vitales.")
B.Kj=A.a(s(["Una investigaci\xf3n hist\xf3rica, epistemol\xf3gica que coopera para una reelaboraci\xf3n en la teor\xeda del sujeto.","Demostrar la supremac\xeda de la conciencia singular ante cualquier pr\xe1ctica social espec\xedfica.","Confirmar que las condiciones econ\xf3micas se reproducen en los sujetos, constituy\xe9ndolos como tales.",""]),t.s)
B.Z4=new A.c("1","En la primera conferencia Foucault se propone:",B.Kj,"A","El objetivo de Foucault es realizar una investigaci\xf3n hist\xf3rica sobre c\xf3mo se formaron los dominios del saber a partir de pr\xe1cticas sociales, como parte de su proyecto de reelaborar una teor\xeda del sujeto.")
B.Lc=A.a(s(["El sociologismo resuelve la tensi\xf3n haciendo foco en la noci\xf3n de individuo y en lo psicol\xf3gico.","Que se resuelve por medio de la negaci\xf3n de ambas tendencias.","La tensi\xf3n responde al planteo antag\xf3nico entre individuo y sociedad.",""]),t.s)
B.a0l=new A.c("1","En relaci\xf3n a la tensi\xf3n entre psicologismo y sociologismo Ana Mar\xeda Fern\xe1ndez plantea que:",B.Lc,"C","Fern\xe1ndez explica que tanto el psicologismo como el sociologismo son dos caras de la misma moneda: un pensamiento antag\xf3nico que opone individuo y sociedad en lugar de pensar su articulaci\xf3n.")
B.KA=A.a(s(["La noci\xf3n de v\xednculo permite separar conceptualmente la realidad material de los err\xf3neos desv\xedos del subjetivismo.","La noci\xf3n de v\xednculo permite de abordar una relaci\xf3n directa entre estructura social y configuraci\xf3n del mundo interno del sujeto.","La noci\xf3n de v\xednculo permite discriminar claramente la radical diferencia entre el Aparato Ps\xedquico y las condiciones sociales.",""]),t.s)
B.a5e=new A.c("1","Para Alejandro Raggio, la importancia de Pich\xf3n-Rivi\xe8re radica en que:",B.KA,"B","Raggio valora el concepto de 'v\xednculo' de Pichon-Rivi\xe8re porque ofrece una herramienta para pensar la articulaci\xf3n entre lo social y lo subjetivo sin caer en un dualismo simplista.")
B.P9=A.a(s(["La constataci\xf3n en el siglo XXI del poder de las redes sociales.","Que se describi\xf3 la dimensi\xf3n constructiva del lenguaje en relaci\xf3n a la realidad.","El descubrimiento de la funci\xf3n de connotaci\xf3n en el lenguaje.",""]),t.s)
B.a7g=new A.c("2","En el art\xedculo de Gabriel Eira y Javier Romano se hace referencia al 'giro ling\xfc\xedstico'. Este se\xf1alamiento hist\xf3rico supone:",B.P9,"B","El 'giro ling\xfc\xedstico' es un movimiento filos\xf3fico que dej\xf3 de ver el lenguaje como un mero representante de una realidad externa, para pasar a considerarlo como el constructor de esa misma realidad. El lenguaje no refleja el mundo, lo crea.")
B.PI=A.a(s(["El olvido representa una expresi\xf3n de debilidad.","El olvidar no es necesario porque la funci\xf3n de la conciencia es recordar todo.","Esta capacidad de olvido es muy importante en el mantenimiento del orden an\xedmico.",""]),t.s)
