B.Sc=A.a(s(["Es una discusi\xf3n previa al inicio del trabajo grupal donde cada persona explicita desde donde se posiciona.","La antinomia a medida que transcurre el trabajo se diluye y no tiene un peso relativo.","Nuestra forma de entender y posicionarnos muchas veces forma parte no explicitada de nuestro trabajo y forma de entender el fen\xf3meno.",""]),t.s)
B.a29=new A.c("1","Cuando Ana Mar\xeda Fern\xe1ndez plantea que la antinomia individuo-sociedad opera como a priori conceptual. \xbfA qu\xe9 se refiere?",B.Sc,"C","Un 'a priori conceptual' es un supuesto no cuestionado que estructura el pensamiento. Fern\xe1ndez se\xf1ala que la divisi\xf3n individuo-sociedad opera de esta manera en el campo grupal.")
B.Mv=A.a(s(["La categor\xeda de intermediaci\xf3n que mantiene el polo social en su an\xe1lisis de la dimensi\xf3n grupal, reducciones psi y la negaci\xf3n de la especificidad de los acontecimientos grupales.","La noci\xf3n de mediadores del comportamiento y adiestramiento de lo grupal y la conducci\xf3n en base al liderazgo grupal.","La conformaci\xf3n de grupos operativos como intermediarios sociales y los enfoques mixtos que logran resolver la tensi\xf3n.",""]),t.s)
B.a4x=new A.c("1","Ana Mar\xeda Fern\xe1ndez plantea que la tensi\xf3n entre lo singular y lo colectivo se ha intentado resolver poniendo el foco en diferentes factores. Entre ellos destaca:",B.Mv,"A","La autora describe las diferentes formas en que hist\xf3ricamente se ha intentado resolver la tensi\xf3n: ver al grupo como intermediario, reducirlo a interacciones individuales, o negar su especificidad.")
B.Lv=A.a(s(["Bajo la forma del 'estado de derecho' no puede existir ninguna forma de injusticia social.","La polic\xeda moderna es mejor garant\xeda de la producci\xf3n que el derecho del m\xe1s fuerte.","La forma de gobierno no es ajena ni independiente al modo de producci\xf3n.",""]),t.s)
