B.JU=A.a(s(["Falta en todas las filosof\xedas un reconocimiento de la justificaci\xf3n de la voluntad de verdad.","El camino iniciado por Plat\xf3n es el \xfanico verdadero.","Se establece el sentido verdadero de conceptos como 'ser' o 'el reino de la verdad'.",""]),t.s)
