B.a0a=new A.c("10","La psicologizaci\xf3n, en su sentido m\xe1s amplio, se reduce estrictamente a la constituci\xf3n de la psicolog\xeda como una disciplina acad\xe9mica y profesional.",B.e,"Falso","El documento indica que la psicologizaci\xf3n va m\xe1s all\xe1 de la mera constituci\xf3n disciplinar de la psicolog\xeda, implicando 'la introducci\xf3n de los saberes y las pr\xe1cticas psi en la organizaci\xf3n de la sociedad' (p. 4), afectando \xe1mbitos como la moral, la \xe9tica y la pol\xedtica, y no solo el campo acad\xe9mico.")
B.a4N=new A.c("10","Seg\xfan Nikolas Rose, la 'psicologizaci\xf3n' y la 'disciplinarizaci\xf3n' son fen\xf3menos totalmente independientes en la sociedad.",B.e,"Falso","El texto, al referirse a Rose, se\xf1ala que la 'disciplinarizaci\xf3n de la psicolog\xeda' est\xe1 '\xedntimamente ligada a la psicologizaci\xf3n de otros espacios y pr\xe1cticas' (p. 4), lo que implica una relaci\xf3n de interdependencia.")
B.YR=new A.c("10","La psicologizaci\xf3n solo opera en el plano de la subjetividad individual, sin implicaciones en el plano pol\xedtico o social.",B.e,"Falso","El documento establece que la psicologizaci\xf3n tiene 'intervenciones concretas en el plano \xe9tico y pol\xedtico' (p. 5), afectando la gesti\xf3n de la vida cotidiana y la configuraci\xf3n de los modos de ser y obrar en sociedad.")
B.YM=new A.c("10","Byung-Chul Han asocia la psicopol\xedtica con el modelo de la sociedad disciplinaria, caracterizado por el 'deber'.",B.e,"Falso","Byung-Chul Han sit\xfaa la psicopol\xedtica en el contexto de la 'sociedad del rendimiento', que opera bajo el verbo 'poder', contrast\xe1ndola con la sociedad disciplinaria del 'deber' (p. 5).")
B.a6r=new A.c("10","El origen de la noci\xf3n de salud mental puede rastrearse exclusivamente a la posguerra de la Segunda Guerra Mundial, con el Congreso Internacional de Salud Mental de 1948.",B.e,"Falso","Aunque el Congreso de 1948 fue un hito importante, el documento aclara que la noci\xf3n de salud mental se remonta a 'inicios del siglo XX' a trav\xe9s del movimiento de higiene mental (p. 7).")
B.a6P=new A.c("10","El movimiento de higiene mental surgi\xf3 principalmente con el objetivo de erradicar todas las enfermedades f\xedsicas.",B.e,"Falso","El movimiento de higiene mental, liderado por figuras como Clifford W. Beers, se centr\xf3 en 'la prevenci\xf3n de las enfermedades mentales' y la promoci\xf3n de la salud mental, no en todas las enfermedades f\xedsicas (p. 9).")
B.a1C=new A.c("10","El primer Congreso Internacional de Salud Mental de Londres en 1948 consolid\xf3 el movimiento de higiene mental a nivel global.",B.e,"Verdadero","El texto afirma que este congreso fue un 'punto de inflexi\xf3n en la consolidaci\xf3n del movimiento de la higiene mental a nivel global' y que fue impulsado por este mismo movimiento (p. 9).")
B.a_1=new A.c("10","La noci\xf3n de salud mental, desde su concepci\xf3n, estuvo fuertemente ligada a un proyecto pol\xedtico de ciudadan\xeda.",B.e,"Verdadero","El documento sostiene que la salud mental se concibi\xf3 como un 'proyecto de ciudadan\xeda' que buscaba 'producir un individuo libre, racional y aut\xf3nomo', esencial para la consolidaci\xf3n de las democracias liberales (p. 10).")
B.a4A=new A.c("10","El discurso de la salud mental siempre se mantuvo completamente separado de la psiquiatr\xeda tradicional.",B.e,"Falso","El texto menciona que, si bien la salud mental buscaba superar los modelos psiqui\xe1tricos basados en el hospital asilar, su 'discurso se entremezcla con el de la psiquiatr\xeda moderna' y a veces sirvi\xf3 para 'legitimar intervenciones de control social' (p. 10).")
B.a5u=new A.c("10","El concepto de 'gubernamentalidad autoritaria' se refiere a una forma de gobierno que opera principalmente a trav\xe9s de la represi\xf3n y la fuerza directa, sin la participaci\xf3n del sujeto.",B.e,"Falso","La gubernamentalidad autoritaria, seg\xfan el documento, 'no persigue operar por la obediencia sino a trav\xe9s de la libertad de los sujetos' (p. 16), buscando la auto-disciplina y la interiorizaci\xf3n de las normas.")
B.Y5=new A.c("10","El capitalismo mundial integrado, descrito en el documento, se caracteriza por una fragmentaci\xf3n de la producci\xf3n y el consumo sin interconexi\xf3n global.",B.e,"Falso","El capitalismo mundial integrado, al contrario, se define por una 'dispersi\xf3n de la producci\xf3n a nivel mundial' pero con 'relaciones de interdependencia' y la 'expansi\xf3n sin precedentes de los flujos de consumo' (p. 17).")
B.a_b=new A.c("10","La intervenci\xf3n gubernamental de la psicolog\xeda se centr\xf3 \xfanicamente en el \xe1mbito de la salud mental, sin afectar otros sectores sociales.",B.e,"Falso","El documento detalla que la psicolog\xeda fue utilizada en '\xe1mbitos tradicionalmente gubernamentales' como el sistema penal, el \xe1mbito militar, la gesti\xf3n de empresas y organizaciones, la educaci\xf3n y la seguridad social, adem\xe1s de la salud mental (p. 23).")
B.a4u=new A.c("10","La 'psicolog\xeda de la emergencia' surgi\xf3 como una respuesta profesional ante situaciones de crisis y desastres, vincul\xe1ndose con estrategias de intervenci\xf3n gubernamental.",B.e,"Verdadero","El texto explica que la psicolog\xeda, en el marco de la gubernamentalizaci\xf3n del Estado de Bienestar, gener\xf3 'pr\xe1cticas de la psicolog\xeda de la emergencia' para intervenir en crisis y cat\xe1strofes (p. 23).")
B.Y4=new A.c("10","Las 'nuevas culturas terap\xe9uticas' son fen\xf3menos completamente desconectados de los saberes psi y de la intervenci\xf3n gubernamental en la vida.",B.e,"Falso","Las nuevas culturas terap\xe9uticas, aunque presentadas como opciones personales, son 'estrategias de intervenci\xf3n en la vida' que 'dialogan de forma m\xe1s o menos expl\xedcita con los saberes psi' y forman parte de la psicologizaci\xf3n contempor\xe1nea (p. 26).")
B.a1I=new A.c("10","El Plan Beveridge de 1942 en Reino Unido es mencionado como un ejemplo de planificaci\xf3n de seguridad social que estableci\xf3 una nueva relaci\xf3n entre el Estado y el bienestar de la poblaci\xf3n.",B.e,"Verdadero","El documento indica que el Plan Beveridge fue 'la primera planificaci\xf3n de seguridad social' que sirvi\xf3 de 'modelo para una nueva relaci\xf3n entre el Estado y la salud de su poblaci\xf3n' (p. 12).")
B.a1h=new A.c("10","La Organizaci\xf3n Mundial de la Salud (OMS) en 1948 defini\xf3 la salud como la mera ausencia de enfermedad o afecci\xf3n.",B.e,"Falso","La OMS, en su constituci\xf3n de 1948, defini\xf3 la salud como 'un estado de completo bienestar f\xedsico, mental y social, y no solamente como la ausencia de afecciones o enfermedades' (p. 13).")
B.Y8=new A.c("10","El concepto de 'ineficiencia social' fue relevante en el Reino Unido para justificar la intervenci\xf3n sobre la 'deficiencia mental'.",B.e,"Verdadero","El texto menciona que en el Reino Unido, la 'deficiencia mental' fue r\xe1pidamente 'asociada a \u2018ineficiencia social\u2019', lo que permiti\xf3 desarrollar un paradigma social para la enfermedad mental (p. 11).")
B.a5z=new A.c("10","El movimiento de higiene mental fue ajeno a los debates sobre el control de la natalidad y la eugenesia.",B.e,"Falso","El documento expl\xedcitamente se\xf1ala que la higiene mental en Reino Unido 'se inscribi\xf3 en un paradigma biopol\xedtico, en el que se debati\xf3 sobre el control de la natalidad, la eugenesia' y la prevenci\xf3n de la enfermedad mental (p. 11).")
B.a9z=new A.c("10","La psicologizaci\xf3n, en la contemporaneidad, se limita a los espacios cl\xednicos y terap\xe9uticos tradicionales.",B.e,"Falso","El documento sugiere que la psicologizaci\xf3n permea la 'vida cotidiana', extendi\xe9ndose a 'nuevas culturas terap\xe9uticas' y al campo de la 'gubernamentalidad autoritaria', trascendiendo los \xe1mbitos cl\xednicos tradicionales (p. 4, 26).")
B.a62=new A.c("10","El documento argumenta que las intervenciones psi en el \xe1mbito del Estado de Bienestar son un mero reflejo pasivo de las pol\xedticas gubernamentales, sin capacidad de influir en ellas.",B.e,"Falso","El texto describe una 'intervenci\xf3n gubernamental de la psicolog\xeda' que se 'inserta en el desarrollo de las pol\xedticas p\xfablicas', lo que implica un rol activo y de influencia, no meramente pasivo (p. 23).")
B.a41=new A.c("10","El modelo de la 'cl\xednica de la comunidad' es un ejemplo de c\xf3mo los saberes psi se articularon con las pol\xedticas de salud mental en el contexto del Estado de Bienestar.",B.e,"Verdadero","El documento menciona la 'cl\xednica de la comunidad' como una pr\xe1ctica que 'se articulaba con las pol\xedticas de salud mental' y se incorporaba en el sistema de bienestar (p. 23).")
B.a50=new A.c("10","El 'gobierno a distancia' es una t\xe9cnica de poder que busca la autogesti\xf3n de los sujetos, haciendo que act\xfaen de acuerdo a los objetivos gubernamentales sin coerci\xf3n directa.",B.e,"Verdadero","El texto lo describe como una estrategia que 'opera en la autonom\xeda de los sujetos, en su capacidad de autogobierno', logrando que 'los sujetos se autogestionen seg\xfan los objetivos pol\xedticos' (p. 18).")
B.a3V=new A.c("10","El paso de la 'higiene mental' a la 'salud mental' implic\xf3 una despolitizaci\xf3n total del concepto de bienestar psicol\xf3gico.",B.e,"Falso","El documento sostiene que, aunque hubo un cambio terminol\xf3gico, la salud mental sigui\xf3 siendo un 'campo de disputa' y un 'proyecto de ciudadan\xeda' con claras implicaciones pol\xedticas (p. 7, 10).")
B.a2C=new A.c("10","El Congreso de 1948 enfatiz\xf3 que los problemas de la salud mental se deb\xedan exclusivamente a factores biol\xf3gicos y gen\xe9ticos, sin considerar el contexto social.",B.e,"Falso","El documento, al analizar el Congreso de 1948, resalta c\xf3mo se 'ligaba expl\xedcitamente la salud y la pol\xedtica, y la conducta individual y el comportamiento social' (p. 10), mostrando una visi\xf3n integral.")
B.OC=A.a(s(["Verdadero","Faltro"]),t.s)
B.a2x=new A.c("10","Las tecnolog\xedas de la informaci\xf3n y la comunicaci\xf3n (TICs) no tienen un rol significativo en el desarrollo de las nuevas culturas terap\xe9uticas.",B.OC,"Falso","Aunque no se detalla, la conexi\xf3n entre el 'capitalismo mundial integrado' y la 'psicologizaci\xf3n' (p. 17) sugiere que las TICs son un componente clave que facilita la difusi\xf3n y el acceso a estas nuevas formas de intervenci\xf3n.")
B.a8O=new A.c("1","El material did\xe1ctico del 'Documento de trabajo 1' fue elaborado por el Profesor Agregado Dr. Jorge Ch\xe1vez, responsable del curso de Historia de la Psicolog\xeda.",B.e,"Verdadero","El documento indica en la p\xe1gina 2: 'Su autor fue el Profesor Agregado. Dr. Jorge Ch\xe1vez, actual responsable del Curso.'")
B.a7D=new A.c("1","La 'Perspectiva Hist\xf3rica' propuesta en el documento busca una reconstrucci\xf3n lineal y progresiva de los eventos pasados.",B.e,"Falso","El documento menciona que esta perspectiva 'se aleja de la idea de la historia como un mero transcurrir evolutivo, progresivo y lineal' (p. 4), buscando desnaturalizar lo evidente y complejizar el presente.")
B.a3o=new A.c("1","Las 'pr\xe1cticas historiadoras' en el contexto del documento se refieren exclusivamente a la recopilaci\xf3n de datos cronol\xf3gicos.",B.e,"Falso","El documento explica que 'la historia no es el mero resultado de una recopilaci\xf3n de datos cronol\xf3gicos' sino que implica 'pr\xe1cticas historiadoras' que 'producen verdades' y analizan el 'r\xe9gimen de historicidad' (p. 8).")
B.a6G=new A.c("1","El documento considera que el estudio de la historia de la psicolog\xeda es una actividad neutral, desvinculada de los intereses pol\xedticos y sociales.",B.e,"Falso","El texto afirma que 'las pr\xe1cticas historiadoras de la psicolog\xeda no son una actividad neutral o desinteresada' sino que est\xe1n implicadas en 'la construcci\xf3n de ciertas verdades' y en 'procesos pol\xedticos y sociales' (p. 8).")
B.ZH=new A.c("1","La genealog\xeda, como perspectiva hist\xf3rica, tiene como objetivo principal el descubrimiento del origen puro y sin fisuras de los conceptos.",B.e,"Falso","La genealog\xeda, en contraste con la b\xfasqueda de or\xedgenes puros, 'se opone a la b\xfasqueda de la esencia' y se interesa por 'la emergencia' de los conceptos a partir de 'relaciones de fuerza' y 'discontinuidades' (p. 15-16).")
B.a5Y=new A.c("1","Nietzsche, en su cr\xedtica a la historia, enfatiza la importancia de una historia monumental que inspire grandes acciones.",B.e,"Verdadero","El documento menciona que Nietzsche distingue 'tres tipos de historia: la monumental, la anticuaria y la cr\xedtica', y la monumental es aquella que 'permite la inspiraci\xf3n y la b\xfasqueda de grandes ejemplos para la acci\xf3n' (p. 16).")
B.a8b=new A.c("1","La arqueolog\xeda foucaultiana se encarga de analizar los sistemas de pensamiento y las reglas de formaci\xf3n de los discursos en una \xe9poca determinada.",B.e,"Verdadero","El documento explica que la arqueolog\xeda de Foucault 'se ocupa del an\xe1lisis de los sistemas de pensamiento, de las condiciones hist\xf3ricas de posibilidad de los discursos' (p. 19), es decir, las reglas que rigen lo que puede ser dicho.")
B.a05=new A.c("1","Un 'episteme' es una estructura de conocimiento est\xe1tica y universal que permanece inalterable a lo largo de toda la historia.",B.e,"Falso","Foucault, a trav\xe9s del concepto de episteme, 'propone la discontinuidad radical entre las diferentes \xe9pocas de la cultura' (p. 25), lo que implica que cada episteme es espec\xedfico de una \xe9poca y cambia.")
B.Ze=new A.c("1","Los 'dispositivos' foucaultianos son exclusivamente objetos materiales o edificios, sin incluir discursos o instituciones.",B.e,"Falso","El texto define un dispositivo como 'una red heterog\xe9nea' que incluye 'discursos, instituciones, instalaciones arquitect\xf3nicas, decisiones reglamentarias, leyes, medidas administrativas, enunciados cient\xedficos, proposiciones filos\xf3ficas, morales, filantr\xf3picas' (p. 26).")
B.a9P=new A.c("1","La arqueolog\xeda y la genealog\xeda son presentadas en el documento como metodolog\xedas que buscan 'naturalizar' los fen\xf3menos hist\xf3ricos, haci\xe9ndolos parecer obvios e inmutables.",B.e,"Falso","Ambas perspectivas, al contrario, buscan 'desnaturalizar' aquello que 'se presenta como evidente y necesario' y poner de manifiesto su contingencia hist\xf3rica (p. 19).")
B.ZX=new A.c("1","El documento sostiene que la historia de la psicolog\xeda debe limitarse a narrar los \xe9xitos y avances progresivos de la disciplina.",B.e,"Falso","La perspectiva cr\xedtica busca 'interrogar los modos en que se han producido los saberes y las pr\xe1cticas psicol\xf3gicas', incluyendo sus condiciones de posibilidad y las relaciones de poder que los atraviesan, no solo sus \xe9xitos (p. 4, 8).")
B.a9F=new A.c("1","La 'Perspectiva Hist\xf3rica' del curso enfatiza que la historia es una construcci\xf3n interpretativa y no una verdad un\xedvoca.",B.e,"Verdadero","El texto afirma que 'la historia es una construcci\xf3n' y que 'no existe una \xfanica historia posible', sino 'diferentes narrativas hist\xf3ricas' (p. 8), lo que implica una naturaleza interpretativa.")
B.a3C=new A.c("1","La finalidad de la genealog\xeda es mostrar que todos los conceptos tienen un origen com\xfan y universal.",B.e,"Falso","La genealog\xeda 'se aleja de la b\xfasqueda de or\xedgenes fundantes y universales' (p. 15), concentr\xe1ndose en la 'emergencia' de las cosas en las particularidades de las luchas y relaciones de fuerza.")
B.ZW=new A.c("1","Un 'episteme' es un concepto que solo aplica a las ciencias naturales y no tiene relevancia para el estudio de la psicolog\xeda.",B.e,"Falso","El documento utiliza el concepto de episteme de Foucault para analizar los 'saberes' y las 'condiciones de posibilidad del conocimiento' en general, lo cual es aplicable a la psicolog\xeda (p. 25).")
B.a1J=new A.c("1","Los 'dispositivos' tienen una funci\xf3n puramente descriptiva y no tienen ninguna implicaci\xf3n estrat\xe9gica o de poder.",B.e,"Falso","Foucault caracteriza los dispositivos por su 'funci\xf3n estrat\xe9gica dominante' y su capacidad de responder a 'una urgencia' y tener un objetivo de poder (p. 26).")
B.a_G=new A.c("1","La 'pr\xe1ctica historiadora' del curso de Historia de la Psicolog\xeda busca contribuir a una mejor presentaci\xf3n de los referentes conceptuales que gu\xedan su accionar.",B.e,"Verdadero","La p\xe1gina 2 del documento establece que su concreci\xf3n 'intenta contribuir a una mejor presentaci\xf3n de los referentes conceptuales que gu\xedan nuestro accionar respecto al modo en que concebimos la pr\xe1ctica hist\xf3rica de la psicolog\xeda'.")
B.a2q=new A.c("1","El concepto de 'r\xe9gimen de historicidad' se refiere a la forma en que una sociedad se relaciona con su pasado, presente y futuro en un momento dado.",B.e,"Verdadero","El documento, al referirse a la historia, menciona que 'la historicidad no es lo mismo que la historia', y el r\xe9gimen de historicidad alude a 'los modos en que las sociedades se relacionan con su pasado, presente y futuro' (p. 8).")
B.Yq=new A.c("1","La perspectiva geneal\xf3gica, al centrarse en las discontinuidades, evita cualquier an\xe1lisis sobre la constituci\xf3n de los sujetos.",B.e,"Falso","El documento indica que la genealog\xeda permite 'interrogar las formas en que se han producido las subjetividades' y 'la constituci\xf3n de los sujetos' (p. 15), precisamente a trav\xe9s de las relaciones de fuerza y poder.")
B.YP=new A.c("1","La 'historia anticuaria' de Nietzsche es aquella que valora el pasado sin cuestionarlo, por el mero hecho de su existencia.",B.e,"Verdadero","El documento describe la historia anticuaria como aquella que 'valora el pasado en s\xed mismo' y que, sin una 'cr\xedtica', puede llevar a la 'par\xe1lisis del presente' (p. 16).")
B.abb=new A.c("1","El estudio de los 'dispositivos' permite comprender c\xf3mo se articulan diferentes elementos (discursos, instituciones) para producir efectos de poder y saber.",B.e,"Verdadero","Al definir los dispositivos como 'redes heterog\xe9neas' con una 'funci\xf3n estrat\xe9gica dominante', el documento sugiere que su an\xe1lisis revela esta articulaci\xf3n para el ejercicio del poder y la producci\xf3n de saber (p. 26).")
B.Zq=new A.c("2","Nikolas Rose propone una historia cr\xedtica que busca la reconstrucci\xf3n objetiva y neutral del pasado de la psicolog\xeda.",B.e,"Falso","Rose afirma que una historia cr\xedtica 'nos llama a reflexionar sobre nuestra naturaleza y nuestros l\xedmites, sobre las condiciones en las que se estableci\xf3 lo que entendemos por verdad y por realidad' (p. 1), lo que implica una postura no neutral sino interrogativa y desestabilizadora.")
B.a6W=new A.c("2","Una de las funciones de la historia cr\xedtica, seg\xfan Rose, es perturbar y fragmentar aquello que parece s\xf3lido, revelando su fragilidad.",B.e,"Verdadero","El autor establece que una historia cr\xedtica 'perturba y fragmenta, pone de manifiesto la fragilidad de aquello que parece s\xf3lido, lo contingente de aquello que parece necesario' (p. 1).")
B.a75=new A.c("2","Rose sugiere que las ciencias psicol\xf3gicas (psicolog\xeda, psiquiatr\xeda) carecen de conciencia hist\xf3rica, lo que justifica la necesidad de una nueva historiograf\xeda.",B.e,"Falso","El texto dice: 'Las ciencias psicol\xf3gicas -la psicolog\xeda, la psiquiatr\xeda y las otras disciplinas cuyo nombre empieza con el prefijo \"psi\"- no carecen de conciencia hist\xf3rica' (p. 1). Lo que critica es la forma en que esta historia es contada.")
B.a5r=new A.c("2","Los 'gruesos vol\xfamenes' de historia de la psicolog\xeda suelen presentar una imagen de progreso lineal de la disciplina.",B.e,"Verdadero","Rose critica que estas historias 'suelen estar dominadas por una imagen del progreso' donde el presente es 'la culminaci\xf3n de un largo proceso de desarrollo' (p. 2).")
B.XI=new A.c("2","Seg\xfan Rose, la historia tradicional de la psicolog\xeda tiende a naturalizar los objetos de estudio de la disciplina, present\xe1ndolos como preexistentes a su investigaci\xf3n.",B.e,"Verdadero","El autor se\xf1ala que las historias existentes 'naturalizan los objetos de las ciencias humanas: los transforman en aspectos evidentes de la realidad' y en una 'condici\xf3n necesaria de la humanidad' (p. 2).")
B.Y3=new A.c("2","Rose afirma que la historia de la psicolog\xeda debe centrarse exclusivamente en la biograf\xeda de los grandes pensadores.",B.e,"Falso","Aunque no lo descarta por completo, Rose critica que las historias a menudo se centran en 'los grandes pensadores' y sus 'grandes ideas' (p. 2), sugiriendo un enfoque m\xe1s amplio que incluya la relaci\xf3n entre lo psicol\xf3gico, lo gubernamental y lo subjetivo.")
B.aaW=new A.c("2","La 'psicolog\xeda' para Rose no es solo una disciplina acad\xe9mica, sino tambi\xe9n una forma de entender y actuar sobre la experiencia humana en diversos dominios.",B.e,"Verdadero","Rose plantea que lo psicol\xf3gico es 'la manera de concebir, de conceptualizar, de calcular, de intervenir sobre la experiencia humana' en diferentes esferas como la econom\xeda, la educaci\xf3n, la vida familiar, etc. (p. 3).")
B.a2y=new A.c("2","La historia cr\xedtica propuesta por Rose desvincula por completo la psicolog\xeda de las formas de gobierno y la pol\xedtica.",B.e,"Falso","Rose propone 'una historia cr\xedtica de la relaci\xf3n entre lo psicol\xf3gico, lo gubernamental y lo subjetivo' (p. 1), haciendo expl\xedcita la conexi\xf3n con las formas de gobierno.")
B.a6x=new A.c("2","Los 'programas de la psicolog\xeda' son estrategias pr\xe1cticas y t\xe9cnicas que buscan gobernar el comportamiento y la experiencia humana.",B.e,"Verdadero","Rose introduce el concepto de 'programas de la psicolog\xeda' como 'conjuntos de estrategias pr\xe1cticas, de t\xe9cnicas, de instrumentos para el gobierno de la conducta y la experiencia humanas' (p. 3).")
B.a86=new A.c("2","Seg\xfan Rose, la psicolog\xeda ha contribuido a la emergencia de un tipo particular de 'individuo' o 'sujeto' en la sociedad moderna.",B.e,"Verdadero","Una de las principales tesis de Rose es que la historia cr\xedtica debe examinar 'la formaci\xf3n del individuo, la persona, el yo' como un objeto particular de conocimiento y de gobierno (p. 1, 3).")
B.a5K=new A.c("2","La historia tradicional de la psicolog\xeda tiende a considerar el 'sujeto psicol\xf3gico' como una entidad ahist\xf3rica y universal.",B.e,"Verdadero","Rose critica que las historias convencionales 'aceptan el \\'sujeto psicol\xf3gico\\' como algo dado de antemano' (p. 2), lo que implica considerarlo ahist\xf3rico.")
B.a_s=new A.c("2","Rose sugiere que la 'verdad' en psicolog\xeda es un descubrimiento objetivo y no una construcci\xf3n hist\xf3rica.",B.e,"Falso","Una historia cr\xedtica, para Rose, busca 'reflexionar sobre nuestras... l\xedmites, sobre las condiciones en las que se estableci\xf3 lo que entendemos por verdad y por realidad' (p. 1), indicando que la verdad es construida.")
B.ab0=new A.c("2","El objetivo de una historia cr\xedtica, seg\xfan Rose, es imponer un juicio moral sobre el pasado de la psicolog\xeda.",B.e,"Falso","Rose afirma: 'El objetivo de una historia cr\xedtica no es imponer un juicio, sino hacerlo posible' (p. 1), lo que implica proporcionar las herramientas para la reflexi\xf3n, no el juicio per se.")
B.Zd=new A.c("2","Rose argumenta que la psicolog\xeda es una ciencia puramente 'desinteresada' que opera al margen de cualquier objetivo social o pol\xedtico.",B.e,"Falso","El enfoque de Rose vincula expl\xedcitamente 'lo psicol\xf3gico' con 'lo gubernamental', lo que implica que la psicolog\xeda no es desinteresada, sino que cumple funciones en el gobierno de las conductas (p. 1, 3).")
B.a2a=new A.c("2","Los 'diagramas de fuerza' son las redes de relaciones que operan en diferentes escalas, desde el nivel macro hasta el micro, para gobernar las conductas.",B.e,"Verdadero","Rose menciona que los programas de la psicolog\xeda son 'diagramas de fuerza que operan en la realidad' a diferentes escalas, articulando fuerzas 'a nivel macro y a nivel micro' (p. 3).")
B.a7H=new A.c("2","El documento implica que la psiquiatr\xeda es una disciplina ajena al campo de las 'ciencias psicol\xf3gicas'.",B.e,"Falso","El texto agrupa a 'la psicolog\xeda, la psiquiatr\xeda y las otras disciplinas cuyo nombre empieza con el prefijo \"psi\"' bajo la denominaci\xf3n de 'Las ciencias psicol\xf3gicas' (p. 1).")
B.a2h=new A.c("2","Rose defiende que la historia de la psicolog\xeda debe ser una celebraci\xf3n de su progreso ininterrumpido hacia el conocimiento cient\xedfico.",B.e,"Falso","El autor critica las historias que 'est\xe1n dominadas por una imagen del progreso' y buscan 'celebrar los triunfos del presente' (p. 2), proponiendo en cambio una historia cr\xedtica que 'perturba y fragmenta'.")
B.Zi=new A.c("2","La 'contingencia' de un fen\xf3meno hist\xf3rico, en la visi\xf3n de Rose, significa que su existencia era inevitable y necesaria.",B.e,"Falso","Rose busca poner de manifiesto 'lo contingente de aquello que parece necesario' (p. 1), es decir, que lo que parece inevitable es en realidad producto de circunstancias hist\xf3ricas espec\xedficas y podr\xeda haber sido diferente.")
B.a3i=new A.c("2","Rose sugiere que las pr\xe1cticas psicol\xf3gicas se han expandido m\xe1s all\xe1 de los muros del asilo y la cl\xednica, infiltr\xe1ndose en la vida cotidiana.",B.e,"Verdadero","Aunque no se detalla expl\xedcitamente aqu\xed, el t\xedtulo de la fuente ('Inventing our Selves') y la referencia a los programas que 'gobernaron la conducta y la experiencia humanas' en diferentes dominios (p. 3) implican esta expansi\xf3n.")
B.Yw=new A.c("2","El enfoque de Rose subraya que la psicolog\xeda ha jugado un papel en la 'invenci\xf3n' o configuraci\xf3n de ciertos modos de ser y actuar de los sujetos.",B.e,"Verdadero","El t\xedtulo de la fuente original del cap\xedtulo es 'Inventing our Selves', y Rose propone una historia que examine 'la formaci\xf3n del individuo, la persona, el yo' (p. 1), lo que implica una co-constituci\xf3n o invenci\xf3n.")
B.XL=new A.c("3","La noci\xf3n de gubernamentalidad fue acu\xf1ada por Michel Foucault en sus seminarios de los a\xf1os 1977 y 1978.",B.e,"Verdadero","El documento establece en la p\xe1gina 4: 'La noci\xf3n de gubernamentalidad fue acu\xf1ada por Foucault (1977/2006), en los seminarios de los a\xf1os 1977 y 1978, Seguridad, territorio y poblaci\xf3n'.")
B.a0j=new A.c("3","Foucault utiliza el t\xe9rmino 'gubernamentalidad' para referirse exclusivamente a las formas de gobierno tradicionales basadas en la soberan\xeda del Estado.",B.e,"Falso","El texto explica que la gubernamentalidad es un 'tipo espec\xedfico de relaciones de poder' que va m\xe1s all\xe1 de la soberan\xeda estatal y las disciplinas, enfoc\xe1ndose en la 'conducci\xf3n de conductas' (p. 4).")
B.aaP=new A.c("3","La gubernamentalidad, seg\xfan Foucault, se enfoca en la 'conducci\xf3n de conductas' de los individuos y las poblaciones.",B.e,"Verdadero","El documento indica que la gubernamentalidad es el 'conjunto de t\xe9cnicas y procedimientos destinados a dirigir las conductas de los hombres' (p. 4).")
B.a1k=new A.c("3","El documento se\xf1ala que la gubernamentalidad es un concepto que solo se aplica a los reg\xedmenes totalitarios.",B.e,"Falso","La noci\xf3n de gubernamentalidad es un concepto anal\xedtico que se aplica a diversas formas de gobierno y reg\xedmenes de poder, no exclusivamente a los totalitarios, y se relaciona con el liberalismo y neoliberalismo (p. 18, Castro G\xf3mez).")
B.ZI=new A.c("3","La 'raz\xf3n de Estado' es una forma de racionalidad gubernamental que emergi\xf3 en el siglo XVIII.",B.e,"Falso","El documento sit\xfaa la emergencia de la raz\xf3n de Estado en los 'siglos XVI y XVII' (p. 6), no en el XVIII.")
B.aaC=new A.c("3","La raz\xf3n de Estado concibe el gobierno como una actividad que busca aumentar la 'fuerza' y la 'riqueza' del Estado.",B.e,"Verdadero","Se describe la raz\xf3n de Estado como una 'racionalidad de gobierno' que establece que 'el Estado debe buscar su propia fuerza y su propia riqueza' (p. 6).")
B.XJ=new A.c("3","La noci\xf3n de 'poblaci\xf3n' en la gubernamentalidad se reduce a una suma de individuos aislados.",B.e,"Falso","La poblaci\xf3n es un nuevo objeto de gobierno que 'presenta regularidades propias' como tasas de natalidad, mortalidad, morbilidad, etc., y que 'tiene efectos espec\xedficos que no son propios del individuo' (p. 13).")
B.aa3=new A.c("3","La 'seguridad' es un objetivo central de la gubernamentalidad que busca gestionar los riesgos y peligros de la poblaci\xf3n.",B.e,"Verdadero","El documento vincula la gubernamentalidad con la gesti\xf3n de 'riesgos y peligros inherentes a la vida' de la poblaci\xf3n, y la seguridad se convierte en una 'preocupaci\xf3n central' (p. 14).")
B.a7t=new A.c("3","La gubernamentalidad implica un desplazamiento del inter\xe9s exclusivo por el territorio hacia un inter\xe9s predominante por la poblaci\xf3n y su bienestar.",B.e,"Verdadero","Foucault sit\xfaa la emergencia de la gubernamentalidad en una preocupaci\xf3n por la 'poblaci\xf3n', la 'econom\xeda' y la 'seguridad', desplazando el enfoque principal del mero territorio (p. 13).")
B.a54=new A.c("3","El concepto de 'gubernamentalidad' de Foucault es sin\xf3nimo del concepto tradicional de 'Estado'.",B.e,"Falso","El documento expl\xedcitamente plantea que la noci\xf3n de gubernamentalidad 'desaf\xeda las im\xe1genes cl\xe1sicas sobre el poder y el Estado' (p. 17), sugiriendo una anal\xedtica m\xe1s compleja del gobierno.")
B.Z0=new A.c("3","Seg\xfan el documento, los estudios de la gubernamentalidad solo prestan atenci\xf3n a la agencia de actores humanos.",B.e,"Falso","Se se\xf1ala que los estudios de la gubernamentalidad prestan atenci\xf3n a la 'agencia de actores humanos, pero tambi\xe9n en la incidencia de los espacios arquitect\xf3nicos' (p. 17).")
B.a0h=new A.c("3","La noci\xf3n de gubernamentalidad sugiere que el poder es centralizado y opera de forma monol\xedtica desde el Estado.",B.e,"Falso","La anal\xedtica de gobierno impl\xedcita en esta noci\xf3n plantea que hay que 'analizar las divisiones y las distribuciones de poder y autoridad como construcciones, ensambles, disputados y transformados por m\xfaltiples y heterog\xe9neos elementos' (p. 17), lo que indica una visi\xf3n descentralizada.")
B.a2X=new A.c("3","El liberalismo, como racionalidad de gobierno, se caracteriza por una maximizaci\xf3n de la intervenci\xf3n estatal en todos los aspectos de la vida de los individuos.",B.e,"Falso","El liberalismo, como 'nueva racionalidad gubernamental' (p. 10), se enfoca en 'la libertad de los sujetos como condici\xf3n para el ejercicio del gobierno', proponiendo una intervenci\xf3n estatal m\xe1s calculada y limitada para permitir y producir libertad.")
B.a23=new A.c("3","La 'polic\xeda', en el contexto de la raz\xf3n de Estado, se entend\xeda como el conjunto de leyes y reglamentos que regulaban la vida social, y no solo la fuerza de seguridad.",B.e,"Verdadero","Se explica que el 'arte de la polic\xeda' buscaba 'incrementar la fuerza del Estado' a trav\xe9s del control de la actividad de los individuos, 'reglamentando la vida cotidiana' (p. 9), es decir, abarcando mucho m\xe1s que la polic\xeda como fuerza.")
B.a_J=new A.c("3","El 'biopoder' se refiere a una forma de poder que toma la vida como objeto, gestionando los procesos biol\xf3gicos de la poblaci\xf3n.",B.e,"Verdadero","El texto introduce el biopoder como una forma de poder que 'se ejerce sobre la vida', centr\xe1ndose en la 'gesti\xf3n de los procesos biol\xf3gicos de la poblaci\xf3n' (p. 15).")
B.a38=new A.c("3","La gubernamentalidad propone que el poder opera \xfanicamente a trav\xe9s de la coerci\xf3n y la represi\xf3n directa.",B.e,"Falso","La gubernamentalidad tambi\xe9n opera a trav\xe9s de 'la libertad de los sujetos' y la 'producci\xf3n de determinadas formas de existencia' (p. 10, 16), es decir, mediante mecanismos m\xe1s sutiles que la coerci\xf3n directa.")
B.a_N=new A.c("3","El neoliberalismo se presenta como una continuaci\xf3n de la l\xf3gica liberal, pero con un \xe9nfasis en la generalizaci\xf3n de la forma empresa a todas las esferas sociales.",B.e,"Verdadero","Aunque no se detalla extensamente en este documento espec\xedfico, la menci\xf3n de 'liberalismo y neoliberalismo' en el t\xedtulo de la obra de Castro G\xf3mez (p. 18) y la descripci\xf3n de racionalidades gubernamentales que buscan producir libertad sugiere esta continuidad y extensi\xf3n de l\xf3gicas.")
B.a9Y=new A.c("3","El 'gobierno pastoral' es una forma de poder que Foucault identifica en las sociedades modernas, centrado en el cuidado individualizado de las almas.",B.e,"Falso","Foucault identifica el gobierno pastoral como una forma de poder que surge en el cristianismo, centrado en 'la conducci\xf3n de las almas' y en 'asegurar su salvaci\xf3n' (p. 5), no espec\xedficamente en las sociedades modernas, aunque sus t\xe9cnicas puedan pervivir.")
B.Zn=new A.c("3","El documento vincula la emergencia de la gubernamentalidad con la crisis de la soberan\xeda y la necesidad de nuevas formas de gobernar las poblaciones.",B.e,"Verdadero","El texto explica que la gubernamentalidad surge de una preocupaci\xf3n por la 'poblaci\xf3n' y la 'econom\xeda' cuando las formas de gobierno tradicionales (soberan\xeda y disciplina) se vuelven insuficientes para gestionar los problemas emergentes (p. 13).")
B.a76=new A.c("3","La 'anal\xedtica de gobierno' de la gubernamentalidad se caracteriza por su enfoque en las relaciones microf\xedsicas del poder, m\xe1s all\xe1 de las instituciones estatales formales.",B.e,"Verdadero","Al desafiar las im\xe1genes cl\xe1sicas del poder y el Estado, la anal\xedtica de gobierno se enfoca en 'divisiones y las distribuciones de poder y autoridad como construcciones, ensambles, disputados y transformados por m\xfaltiples y heterog\xe9neos elementos' (p. 17), lo que implica una mirada a relaciones m\xe1s all\xe1 del nivel macroestatal.")
B.a4v=new A.c("4","El documento analiza la relaci\xf3n entre los saberes psicol\xf3gicos, el Estado y la producci\xf3n subjetiva en el Uruguay moderno.",B.e,"Verdadero","El t\xedtulo del documento es 'LOS SABERES PSICOL\xd3GICOS, EL ESTADO Y LA PRODUCCI\xd3N SUBJETIVA', y su contenido se basa en una investigaci\xf3n doctoral sobre 'la psicolog\xeda y su relaci\xf3n con las tecnolog\xedas de gubernamentalidad en el Uruguay moderno' (p. 1-2).")
B.a3S=new A.c("4","El 'Militarismo' en Uruguay se caracteriz\xf3 por un per\xedodo de estancamiento y retroceso en las reformas sociales y educativas.",B.e,"Falso","El documento se\xf1ala que el Militarismo (1876-1886) fue un 'per\xedodo de profundas y aceleradas transformaciones' que busc\xf3 'la modernizaci\xf3n del pa\xeds' y sent\xf3 'las bases del Estado Batllista' (p. 4).")
B.a4o=new A.c("4","Latorre, durante el Militarismo, impuls\xf3 una reforma educativa que ten\xeda como objetivo la homogeneizaci\xf3n y centralizaci\xf3n de la ense\xf1anza.",B.e,"Verdadero","El documento indica que la 'reforma de Latorre' fue una de las 'grandes transformaciones' del Militarismo, buscando 'homogeneizar la ense\xf1anza' y 'centralizar la funci\xf3n educativa' (p. 5).")
B.aaz=new A.c("4","La escuela vareliana del Militarismo se enfoc\xf3 en una educaci\xf3n que promov\xeda el respeto irrestricto por las tradiciones y la autonom\xeda regional.",B.e,"Falso","La escuela vareliana busc\xf3 'sustituir la tradici\xf3n por la raz\xf3n' y 'extirpar los regionalismos' para 'homogeneizar la poblaci\xf3n' bajo una 'pedagog\xeda cient\xedfica' (p. 5).")
B.a9l=new A.c("4","El Positivismo en Uruguay fue una corriente de pensamiento que defendi\xf3 la metaf\xedsica y el espiritualismo, oponi\xe9ndose a la ciencia.",B.e,"Falso","El Positivismo arrib\xf3 al pa\xeds para 'aportar un nuevo orden conceptual y metodol\xf3gico' y 'establecer el conocimiento cient\xedfico en la base del orden social' (p. 17), oponi\xe9ndose a la metaf\xedsica.")
B.Yt=new A.c("4","El impulso modernizador del Militarismo se bas\xf3 en una visi\xf3n de la sociedad como un 'organismo' que requer\xeda una 'ingenier\xeda social' para su progreso.",B.e,"Verdadero","Se menciona que la sociedad era vista como un 'cuerpo biol\xf3gico' y se busc\xf3 aplicar 'la ingenier\xeda social para su modificaci\xf3n, desarrollo o evoluci\xf3n' (p. 17).")
B.a0s=new A.c("4","Jos\xe9 Pedro Varela fue el principal impulsor de una reforma educativa de corte liberal y laico durante el Militarismo.",B.e,"Verdadero","Varela es presentado como la figura clave en la 'reforma educativa' del Militarismo, que estableci\xf3 una 'educaci\xf3n laica, gratuita y obligatoria' (p. 18).")
B.a3N=new A.c("4","La psicolog\xeda en el Uruguay de fines del siglo XIX y principios del XX fue vista como una herramienta clave para 'educar al pueblo' y 'construir una naci\xf3n'.",B.e,"Verdadero","El documento explora c\xf3mo la 'pedagog\xeda y psicolog\xeda' fueron fundamentales en el proyecto modernizador, buscando 'educar al pueblo' y 'construir una naci\xf3n' (p. 18, 26).")
B.a3Z=new A.c("4","El 'pedagogismo' se refiere a la influencia predominante de la psicolog\xeda sobre la pedagog\xeda en el sistema educativo uruguayo de la \xe9poca.",B.e,"Falso","El documento habla de un 'pedagogismo' que signific\xf3 'el predominio de las categor\xedas de la pedagog\xeda sobre la psicolog\xeda' (p. 27), lo que indica lo contrario.")
B.a0J=new A.c("4","La 'psicolog\xeda pedag\xf3gica' en el Uruguay moderno se concibi\xf3 como una disciplina aplicada, \xfatil para la direcci\xf3n de las conductas y la formaci\xf3n de los ciudadanos.",B.e,"Verdadero","La psicolog\xeda pedag\xf3gica tuvo un '\xe9nfasis en la aplicaci\xf3n' y fue crucial para la 'organizaci\xf3n de los dispositivos escolares' y la 'formaci\xf3n del hombre-ciudadano' (p. 27-28).")
B.a2_=new A.c("4","Carlos Vaz Ferreira fue un pensador que se adhiri\xf3 completamente al Positivismo en sus estudios psicol\xf3gicos, sin cr\xedticas.",B.e,"Falso","Vaz Ferreira 'ingres\xf3 a la escena intelectual del pa\xeds como el gran cr\xedtico del positivismo' (p. 31), aunque utilizara m\xe9todos cient\xedficos en su psicolog\xeda.")
B.a3X=new A.c("4","El 'espacio intelectual' en el Uruguay del siglo XIX se caracteriz\xf3 por ser un campo aut\xf3nomo, desvinculado de las esferas pol\xedticas y estatales.",B.e,"Falso","El documento indica que el espacio intelectual estaba '\xedntimamente imbricado con el espacio pol\xedtico' y que 'la elite intelectual fue la protagonista de la construcci\xf3n del Estado' (p. 15).")
B.a9R=new A.c("4","La 'experimentaci\xf3n' en psicolog\xeda, promovida por figuras como Vaz Ferreira, permiti\xf3 el desprendimiento de la disciplina del dominio puramente te\xf3rico hacia el pr\xe1ctico.",B.e,"Verdadero","Se se\xf1ala que la labor de Vaz Ferreira 'incluy\xf3 por primera vez la aplicaci\xf3n del conocimiento' a trav\xe9s de la 'corroboraci\xf3n experimental de ciertas leyes' (p. 41), llevando la psicolog\xeda al 'terreno pr\xe1ctico'.")
B.Y0=new A.c("4","El 'alma' en el contexto de la psicolog\xeda espiritualista se concibi\xf3 como un objeto de estudio puramente material y observable.",B.e,"Falso","Los espiritualistas, al referirse al 'alma', la consideraban un 'objeto que escapaba al abordaje cient\xedfico-natural' (p. 29), distinto de lo material.")
B.a7Z=new A.c("4","La disputa entre Espiritualismo y Positivismo en el \xe1mbito psicol\xf3gico uruguayo fue un debate central sobre la naturaleza del conocimiento y el objeto de estudio de la disciplina.",B.e,"Verdadero","El documento dedica una secci\xf3n a 'LA DISPUTA ENTRE ESPIRITUALISMO Y POSITIVISMO' (p. 26), resaltando c\xf3mo estas corrientes 'disputaron el liderazgo' en la definici\xf3n del campo intelectual.")
B.a7W=new A.c("4","El texto sugiere que la psicolog\xeda en Uruguay, desde sus inicios, estuvo ligada a la construcci\xf3n del Estado y a la producci\xf3n de un determinado tipo de subjetividad ciudadana.",B.e,"Verdadero","La investigaci\xf3n doctoral en la que se basa el documento analiza 'la relaci\xf3n [de la psicolog\xeda] con las tecnolog\xedas de gubernamentalidad en el Uruguay moderno' (p. 2) y c\xf3mo fue utilizada para 'educar al pueblo, construir una naci\xf3n' (p. 18).")
B.a8R=new A.c("4","Las 'conferencias para maestros' de Vaz Ferreira fueron un espacio irrelevante para la difusi\xf3n de la psicolog\xeda experimental en el Uruguay.",B.e,"Falso","Estas conferencias fueron un 'verdadero laboratorio experimental y de investigaci\xf3n psicol\xf3gica' y un espacio de 'difusi\xf3n de la nueva ciencia' (p. 36), siendo fundamentales.")
B.a6O=new A.c("4","El documento indica que la ense\xf1anza de la psicolog\xeda en la Universidad Mayor de la Rep\xfablica, durante el per\xedodo analizado, estuvo inicialmente ligada a la ense\xf1anza de la filosof\xeda.",B.e,"Verdadero","Se menciona que Vaz Ferreira imparti\xf3 el curso de psicolog\xeda en la Secci\xf3n de Ense\xf1anza Secundaria de la Universidad, 'en el marco del estudio de la filosof\xeda' (p. 39).")
B.a_X=new A.c("4","La introducci\xf3n de la psicolog\xeda experimental en Uruguay implic\xf3 su aislamiento del espacio intelectual del pa\xeds, al ser considerada una ciencia menor.",B.e,"Falso","El arribo de la psicolog\xeda a la experimentaci\xf3n la incluy\xf3 'en el espacio intelectual del pa\xeds, ingresando a un campo de posibilidades novedoso' (p. 41), conect\xe1ndola con el espacio pol\xedtico.")
B.aak=new A.c("4","El t\xe9rmino 'pragmatismo' en el contexto de la psicolog\xeda uruguaya de la \xe9poca, se refiere a una preocupaci\xf3n por la utilidad pr\xe1ctica del conocimiento.",B.e,"Verdadero","La entrada de la psicolog\xeda en el terreno pr\xe1ctico hizo de ella un conocimiento que comparte 'su condici\xf3n pragm\xe1tica y utilitaria' (p. 41), en el horizonte del conocimiento positivo.")
B.a_F=new A.c("5","El documento se enfoca en analizar c\xf3mo la psicopedagog\xeda se articul\xf3 con las tecnolog\xedas de gubernamentalidad en el Uruguay moderno para el gobierno de la infancia.",B.e,"Verdadero","El t\xedtulo del documento es 'EL GOBIERNO DE LA INFANCIA Y LA PSICOPEDAGOG\xcdA' y en la p\xe1gina 2 se indica que toma contenidos de una investigaci\xf3n doctoral sobre 'la psicolog\xeda y su relaci\xf3n con las tecnolog\xedas de gubernamentalidad en el Uruguay moderno.'")
B.a6J=new A.c("5","El Estado moderno uruguayo, a principios del siglo XX, abandon\xf3 la preocupaci\xf3n por la 'cuesti\xf3n social' y se limit\xf3 a funciones meramente administrativas.",B.e,"Falso","El documento indica que a principios del siglo XX, el Estado uruguayo asumi\xf3 un rol central en la 'gesti\xf3n de la cuesti\xf3n social' y en la 'conducci\xf3n de las conductas' para el 'bienestar social' (p. 5-6).")
B.a8h=new A.c("5","La noci\xf3n de 'estatalizaci\xf3n del gobierno' se refiere al proceso por el cual el Estado asume la responsabilidad de conducir las conductas de la poblaci\xf3n.",B.e,"Verdadero","El texto explica que la 'estatalizaci\xf3n del gobierno' se refiere a la asunci\xf3n por parte del Estado de la 'conducci\xf3n de las conductas' y la 'gesti\xf3n de la vida' (p. 6).")
B.a36=new A.c("5","La 'matriz de ciudadan\xeda' en el Uruguay moderno se construy\xf3 de forma homog\xe9nea, sin considerar las diferencias sociales o econ\xf3micas.",B.e,"Falso","Se menciona que, aunque se buscaba homogeneidad, la ciudadan\xeda implicaba la 'asimilaci\xf3n de las diferencias' y la integraci\xf3n de la 'pluralidad social', no ignor\xe1ndola (p. 8-9).")
B.a_h=new A.c("5","La eugenesia en Uruguay fue una corriente de pensamiento y pr\xe1ctica que tuvo una escasa o nula influencia en las pol\xedticas de salud y educaci\xf3n.",B.e,"Falso","El documento dedica una secci\xf3n a 'Eugenesia e higiene: aliados para cuidar y conducir' (p. 12), indicando su relevancia en las pol\xedticas de 'cuidado y conducci\xf3n' de la poblaci\xf3n.")
B.a77=new A.c("5","La 'higiene' en el contexto de la \xe9poca se limit\xf3 a la limpieza personal, sin abarcar aspectos de salud p\xfablica o social.",B.e,"Falso","La 'higiene' estaba articulada con la eugenesia y se ocupaba de 'prevenir y combatir las \\'degeneraciones\\' que afectaban a la poblaci\xf3n', es decir, abarcaba aspectos de salud p\xfablica y social (p. 13).")
B.a3y=new A.c("5","La 'psicopedagog\xeda' surgi\xf3 como un campo que ensambl\xf3 saberes psicol\xf3gicos y pedag\xf3gicos para intervenir en la infancia.",B.e,"Verdadero","El documento explora c\xf3mo la psicopedagog\xeda fue un saber clave para el 'gobierno de la infancia' (p. 25), integrando conocimientos de psicolog\xeda y pedagog\xeda.")
B.a1a=new A.c("5","El 'encauzamiento moral' y la 'orientaci\xf3n vocacional' son ejemplos de pr\xe1cticas psicopedag\xf3gicas destinadas a modelar las conductas de los j\xf3venes.",B.e,"Verdadero","El documento tiene una secci\xf3n titulada 'Del encauzamiento moral a la orientaci\xf3n vocacional' (p. 18), que describe c\xf3mo estas pr\xe1cticas buscaban 'conducir las conductas y orientar las vidas' de los j\xf3venes.")
B.a0Q=new A.c("5","La psicolog\xeda se mantuvo ajena al proyecto de construcci\xf3n de la ciudadan\xeda y a la matriz social del Uruguay del siglo XX.",B.e,"Falso","Se plantea que la psicolog\xeda se 'ensambl\xf3' a la 'matriz de ciudadan\xeda' (p. 21), jugando un papel en la formaci\xf3n de los ciudadanos y en la regulaci\xf3n de las conductas.")
B.ZB=new A.c("5","La 'medicalizaci\xf3n de la infancia' se refiere al proceso por el cual los problemas de conducta y aprendizaje de los ni\xf1os fueron interpretados predominantemente en t\xe9rminos m\xe9dicos o patol\xf3gicos.",B.e,"Verdadero","El documento aborda la 'institucionalizaci\xf3n de la psicolog\xeda: entre el gobierno y la medicalizaci\xf3n de la infancia' (p. 24), indicando este proceso de patologizaci\xf3n y abordaje m\xe9dico.")
B.a_E=new A.c("5","El 'gobierno de la infancia' se enfoc\xf3 exclusivamente en la represi\xf3n de conductas desviadas, sin programas de prevenci\xf3n o cuidado.",B.e,"Falso","El gobierno de la infancia implic\xf3 un 'entramado de saberes y pr\xe1cticas' que buscaban 'cuidar y conducir' a los ni\xf1os, no solo reprimir (p. 25).")
B.a6p=new A.c("5","Las 'conferencias de puericultura' fueron un espacio importante para la difusi\xf3n de saberes sobre el cuidado de la infancia en Uruguay.",B.e,"Verdadero","El texto menciona que las 'conferencias de puericultura' eran un veh\xedculo para la 'difusi\xf3n de nuevos conocimientos' sobre la salud y el desarrollo infantil (p. 29).")
B.a4C=new A.c("5","La 'criminolog\xeda de la infancia' fue un saber que contribuy\xf3 a la intervenci\xf3n sobre los ni\xf1os y j\xf3venes, especialmente aquellos considerados 'anormales' o 'desadaptados'.",B.e,"Verdadero","El documento menciona la 'criminolog\xeda de la infancia' como uno de los saberes 'ensamblados' en el gobierno de la infancia, que buscaba intervenir sobre la 'desviaci\xf3n' (p. 25).")
B.a_i=new A.c("5","La labor del Dr. Pedro Ernesto Duprat se centr\xf3 exclusivamente en la pediatr\xeda, sin incursionar en la psicoterapia.",B.e,"Falso","El documento menciona las 'producciones del Doctor Pedro Ernesto Duprat... en torno a la psicoterapia' (p. 40), lo que indica su incursi\xf3n en ese campo.")
B.a51=new A.c("5","La IX Conferencia Sanitaria Panamericana, citada en el documento, enfatiz\xf3 que la salud p\xfablica es esencial para la felicidad de los pueblos y la fuerza del pa\xeds.",B.e,"Verdadero","Se cita textualmente: 'la salud p\xfablica es el fundamento sobre el cual reposa la felicidad de los pueblos y la fuerza del pa\xeds' (Gonz\xe1lez, Schiaffino, Gomensoro, 1934, p. 57) (p. 41).")
B.a1M=new A.c("5","Emilio Verdesio fue un promotor incansable del cuidado de los 'ni\xf1os diferentes' y jug\xf3 un papel fundamental en la protecci\xf3n de la infancia.",B.e,"Verdadero","El documento lo describe como un 'incansable promotor del cuidado de los \u2018ni\xf1os diferentes\u2019' y fundamental en el 'proyecto del cuidado de la ni\xf1ez' (p. 41).")
B.a4d=new A.c("5","La divulgaci\xf3n de la psicolog\xeda en este per\xedodo se limit\xf3 a c\xedrculos acad\xe9micos muy cerrados, sin alcanzar al p\xfablico general.",B.e,"Falso","Se afirma que la 'divulgaci\xf3n de la psicolog\xeda adquiri\xf3 un dinamismo propio', a trav\xe9s de publicaciones, congresos y cursos, lo que sugiere una difusi\xf3n m\xe1s amplia (p. 41).")
B.aa5=new A.c("5","La 'experticia' de los t\xe9cnicos en psicolog\xeda y psicopedagog\xeda se defini\xf3 a partir de la legitimaci\xf3n y especializaci\xf3n de sus conocimientos y quehacer.",B.e,"Verdadero","El texto se\xf1ala que 'la legitimaci\xf3n y especializaci\xf3n de los conocimientos, as\xed como la delimitaci\xf3n de un quehacer, generaron las condiciones para la emergencia de una experticia singular' (p. 41).")
B.a1z=new A.c("5","El documento sugiere que el 'gobierno de la infancia' es un fen\xf3meno natural y atemporal, sin una construcci\xf3n hist\xf3rica espec\xedfica.",B.e,"Falso","El documento mismo es un estudio hist\xf3rico sobre c\xf3mo se construy\xf3 este 'gobierno de la infancia' en el Uruguay moderno, lo que implica que es un fen\xf3meno hist\xf3ricamente situado y contingente.")
B.a1n=new A.c("5","La 'psicolog\xeda escolar' fue una de las ramas de la psicolog\xeda que se desarroll\xf3 para intervenir en el \xe1mbito educativo y en la gesti\xf3n de las trayectorias de los ni\xf1os.",B.e,"Verdadero","Aunque no se menciona expl\xedcitamente con ese nombre, el ensamblaje de la psicolog\xeda con la pedagog\xeda y la atenci\xf3n a la infancia en el sistema educativo (psicopedagog\xeda) apunta directamente al rol de la psicolog\xeda escolar en la gesti\xf3n de las vidas infantiles.")
B.a7o=new A.c("6","El documento aborda la formaci\xf3n universitaria en psicolog\xeda en Uruguay durante el per\xedodo de 1940 a 1973.",B.e,"Verdadero","El t\xedtulo del documento es 'DOCUMENTO DE TRABAJO 6: LA FORMACI\xd3N UNIVERSITARIA EN PSICOLOG\xcdA (1940-1973)'.")
B.a6K=new A.c("6","La investigaci\xf3n doctoral que sustenta el documento se enfoca en la relaci\xf3n de la psicolog\xeda con las tecnolog\xedas de gubernamentalidad en el Uruguay moderno.",B.e,"Verdadero","La p\xe1gina 2 del documento establece que 'EL PRESENTE DOCUMENTO DE TRABAJO TOMA LOS CONTENIDOS DE LA INVESTIGACI\xd3N DOCTORAL: GENEALOG\xcdA DE LAS PR\xc1CTICAS EN EL CAMPO DE LA PSICOLOG\xcdA Y SU RELACI\xd3N CON LAS TECNOLOG\xcdAS DE GUBERNAMENTALIDAD EN EL URUGUAY MODERNO.'")
B.a1V=new A.c("6","El estudio del 'normotipo' del ni\xf1o y adolescente uruguayo fue un proyecto relevante para la formaci\xf3n y profesionalizaci\xf3n del psic\xf3logo.",B.e,"Verdadero","El documento dedica una secci\xf3n a '1. El estudio del normotipo del ni\xf1o y el adolescente uruguayo', explicando c\xf3mo fue un 'proyecto de investigaci\xf3n que colabor\xf3 en la emergencia de los primeros expertos en psicolog\xeda' (p. 6).")
B.Zh=new A.c("6","Emilio Mira y L\xf3pez fue un psic\xf3logo espa\xf1ol que no tuvo ninguna influencia en el estudio del normotipo uruguayo.",B.e,"Falso","El documento tiene una secci\xf3n titulada 'El encuentro con Mira y L\xf3pez' (p. 7) y detalla su papel en la planificaci\xf3n y ejecuci\xf3n de la investigaci\xf3n del normotipo uruguayo.")
B.Yn=new A.c("6","La construcci\xf3n del normotipo uruguayo busc\xf3 establecer par\xe1metros de 'normalidad' y 'desviaci\xf3n' en la poblaci\xf3n infanto-juvenil.",B.e,"Verdadero","El normotipo era una 'matriz de normalidad' (p. 6) que buscaba identificar y tipificar caracter\xedsticas psicol\xf3gicas para 'determinar cu\xe1les eran los patrones de comportamiento que se consideraban normales' (p. 13).")
B.Zu=new A.c("6","El normotipo uruguayo se construy\xf3 \xfanicamente a partir de datos cualitativos, sin uso de estad\xedsticas.",B.e,"Falso","El proyecto del normotipo fue una 'investigaci\xf3n de corte cuantitativo' (p. 9), utilizando datos biom\xe9tricos, psicol\xf3gicos y sociol\xf3gicos, y t\xe9cnicas estad\xedsticas para su construcci\xf3n.")
B.a_W=new A.c("6","El Centro de Estudios Psicol\xf3gicos de Montevideo (CEPM) fue una instituci\xf3n clave para la formaci\xf3n y atenci\xf3n psicol\xf3gica en Uruguay.",B.e,"Verdadero","El documento dedica una secci\xf3n a '2- El Centro de Estudios Psicol\xf3gicos de Montevideo.' (p. 16), destacando su rol en la formaci\xf3n y la atenci\xf3n psicol\xf3gica.")
B.Z_=new A.c("6","La formaci\xf3n en el CEPM se caracteriz\xf3 por ser exclusivamente te\xf3rica, sin pr\xe1cticas cl\xednicas o de investigaci\xf3n.",B.e,"Falso","La formaci\xf3n en el Centro incluy\xf3 'pr\xe1cticas de diagn\xf3stico' (p. 18) y atenci\xf3n psicol\xf3gica (p. 19), lo que indica un componente pr\xe1ctico significativo.")
B.a5v=new A.c("6","El Primer Congreso Latinoamericano de Psicolog\xeda, realizado en Uruguay, tuvo un papel relevante en la articulaci\xf3n regional de la psicolog\xeda.",B.e,"Verdadero","El documento dedica una secci\xf3n a 'Primer Congreso Latinoamericano de Psicolog\xeda.' (p. 21), resaltando su importancia como un 'hito para la regi\xf3n'.")
B.a8m=new A.c("6","La Cl\xednica M\xe9dico-Psicol\xf3gica fue un espacio de atenci\xf3n donde colaboraron m\xe9dicos y psic\xf3logos.",B.e,"Verdadero","El documento tiene una secci\xf3n sobre '3- La Cl\xednica M\xe9dico Psicol\xf3gica:' (p. 23) y se explica que all\xed trabajaban 'm\xe9dicos, psic\xf3logos, educadores' (p. 25).")
B.a7j=new A.c("6","La 'psicolog\xeda cl\xednica' en Uruguay se desarroll\xf3 de forma independiente de las instituciones m\xe9dicas.",B.e,"Falso","La Cl\xednica M\xe9dico-Psicol\xf3gica es un ejemplo de c\xf3mo la psicolog\xeda se insert\xf3 y desarroll\xf3 en un 'contexto m\xe9dico' (p. 25), mostrando una estrecha vinculaci\xf3n.")
B.aaM=new A.c("6","El Instituto de Psicolog\xeda de la Facultad de Humanidades fue el primer espacio institucional de formaci\xf3n universitaria en psicolog\xeda en Uruguay.",B.e,"Verdadero","Se se\xf1ala que 'la consolidaci\xf3n institucional de la Psicolog\xeda, a nivel universitario, se ubica en 1944' con la creaci\xf3n del 'Instituto de Psicolog\xeda en la Facultad de Humanidades y Ciencias' (p. 26).")
B.a1t=new A.c("6","La creaci\xf3n de la Licenciatura en Psicolog\xeda en 1955 signific\xf3 una completa autonom\xeda de la disciplina respecto a otras carreras.",B.e,"Falso","Aunque la Licenciatura fue un avance, el documento menciona que 'la consolidaci\xf3n del psic\xf3logo como profesional aut\xf3nomo fue un proceso complejo y heterog\xe9neo' (p. 31), implicando una autonom\xeda gradual, no inmediata.")
B.aac=new A.c("6","Las 'pruebas psicol\xf3gicas' (tests) jugaron un papel fundamental en la profesionalizaci\xf3n de la psicolog\xeda en Uruguay.",B.e,"Verdadero","La administraci\xf3n e interpretaci\xf3n de los tests psicol\xf3gicos fue una de las 'primeras pr\xe1cticas espec\xedficas' que distinguieron al psic\xf3logo y contribuyeron a su profesionalizaci\xf3n (p. 33).")
B.a4s=new A.c("6","El 'ejercicio liberal de la profesi\xf3n' del psic\xf3logo se consolid\xf3 plenamente antes de la d\xe9cada de 1960.",B.e,"Falso","El documento sugiere que el 'ejercicio liberal de la profesi\xf3n' y el 'accionar del mercado' crecer\xe1n 'luego de los a\xf1os 60 con mayor intensidad' (p. 47-48).")
B.a84=new A.c("6","La 'policl\xednica' fue un espacio donde la psicolog\xeda cl\xednica pudo desarrollarse al margen de la medicina y la psiquiatr\xeda.",B.e,"Falso","Las policl\xednicas fueron espacios donde 'la psicolog\xeda cl\xednica encontr\xf3 un \xe1mbito de desarrollo', pero esto se dio en 'estrecha relaci\xf3n con la medicina y la psiquiatr\xeda' (p. 35).")
B.a9U=new A.c("6","La 'profesionalizaci\xf3n' de la psicolog\xeda se refiere \xfanicamente a la obtenci\xf3n de un t\xedtulo universitario.",B.e,"Falso","La profesionalizaci\xf3n implic\xf3 'la constituci\xf3n de un campo profesional singular' con un 'quehacer diferenciado', 'c\xf3digos \xe9ticos' y un 'estatuto legal', m\xe1s all\xe1 del mero t\xedtulo (p. 36).")
B.a6_=new A.c("6","El documento argumenta que la formaci\xf3n en psicolog\xeda estuvo desde sus inicios desvinculada de las demandas sociales y estatales.",B.e,"Falso","La investigaci\xf3n se basa en la relaci\xf3n de la psicolog\xeda con las 'tecnolog\xedas de gubernamentalidad' (p. 2), lo que implica una fuerte conexi\xf3n con las demandas sociales y estatales para la conducci\xf3n de conductas.")
B.a8D=new A.c("6","La d\xe9cada de 1960 marc\xf3 un per\xedodo de fortalecimiento progresivo de la incidencia del Estado en la regulaci\xf3n de la vida de las personas en Uruguay.",B.e,"Falso","El documento se\xf1ala que los a\xf1os posteriores a la d\xe9cada del 60 se caracterizan por el 'debilitamiento progresivo de la incidencia del Estado en la regulaci\xf3n, gesti\xf3n y gobierno de la vida de las personas' (p. 47).")
B.a_l=new A.c("6","La noci\xf3n de 'monopolio' en la oferta de un producto o servicio es relevante para entender la profesionalizaci\xf3n del quehacer psicol\xf3gico.",B.e,"Verdadero","El documento menciona que 'La noci\xf3n de mercado y la exclusividad en la oferta de un producto, trazada en la noci\xf3n de monopolio, ensamblan sobre el entramado del universo \u2018psi\u2019 una nueva l\xf3gica' para el ejercicio profesional (p. 47).")
B.ZC=new A.c("7","El documento 'Documento de Trabajo 7' se centra en analizar la intervenci\xf3n de la Universidad de la Rep\xfablica durante la \xfaltima dictadura uruguaya (1973-1984).",B.e,"Verdadero","El t\xedtulo de la primera secci\xf3n y el resumen del art\xedculo de Vania Markarian (p. 2) indican claramente que el texto busca analizar 'los cambios y permanencias de la educaci\xf3n superior uruguaya durante la \xfaltima dictadura (1973-1984)'.")
B.aaU=new A.c("7","El art\xedculo de Vania Markarian (p. 2) busca exclusivamente reforzar los relatos que se centran en los aspectos represivos de la dictadura en la Universidad.",B.e,"Falso","El resumen indica que el art\xedculo 'busca superar los relatos centrados en los aspectos represivos' para examinar 'cambios a nivel acad\xe9mico y curricular' y la existencia de un 'dise\xf1o m\xe1s o menos sistem\xe1tico de la educaci\xf3n superior' (p. 2).")
B.a3w=new A.c("7","Durante la dictadura, la Universidad de la Rep\xfablica sufri\xf3 una total desmantelaci\xf3n de su estructura acad\xe9mica, sin ninguna continuidad con el per\xedodo anterior.",B.e,"Falso","El art\xedculo examina 'cambios y permanencias' y 'vinculaciones de la Universidad intervenida con propuestas y demandas de diverso signo ideol\xf3gico del periodo anterior a la dictadura' (p. 2), lo que sugiere que no fue un desmantelamiento total y hubo continuidades.")
B.a7i=new A.c("7","La Universidad intervenida, a pesar de la represi\xf3n, mantuvo todos sus \xf3rganos cogobernados sin modificaciones.",B.e,"Falso","El per\xedodo de intervenci\xf3n se caracteriz\xf3 por la supresi\xf3n de la autonom\xeda universitaria y el cogobierno. El documento se refiere a 'la Universidad intervenida', lo que implica la suspensi\xf3n de su r\xe9gimen anterior.")
B.a_e=new A.c("7","La Escuela Universitaria de Psicolog\xeda fue una instituci\xf3n creada de cero durante el per\xedodo dictatorial, sin antecedentes previos en la Universidad.",B.e,"Falso","El documento aborda la 'Escuela Universitaria de Psicolog\xeda' (p. 1) y los antecedentes de la formaci\xf3n en psicolog\xeda en la Universidad ya hab\xedan sido tratados en el 'Documento de trabajo 6', lo que implica una existencia previa.")
B.a1N=new A.c("7","Las controversias en torno a la reglamentaci\xf3n del ejercicio profesional del psic\xf3logo no tuvieron relevancia durante el per\xedodo estudiado.",B.e,"Falso","La tercera secci\xf3n del documento se titula 'Controversias en torno a la reglamentaci\xf3n del ejercicio profesional' (p. 1), lo que indica su importancia.")
B.a6s=new A.c("7","El documento sugiere que, incluso en per\xedodos autoritarios, pueden existir mecanismos de legitimaci\xf3n y actores sociales que habilitan la permanencia de los reg\xedmenes.",B.e,"Verdadero","El resumen de Markarian menciona que el texto 'se suma a la renovada atenci\xf3n que se viene prestando a los mecanismos de legitimaci\xf3n, los espacios institucionales y los actores sociales que habilitaron la permanencia de los reg\xedmenes autoritarios' (p. 2).")
B.a2Y=new A.c("7","El enfoque del art\xedculo de Markarian utiliza principalmente la documentaci\xf3n institucional, hoy disponible al p\xfablico.",B.e,"Verdadero","El resumen indica que el art\xedculo 'se basa en algunos trabajos recientes y en la documentaci\xf3n institucional (hoy disponible al p\xfablico)' (p. 2).")
B.a_C=new A.c("7","El texto implica que la Universidad de la Rep\xfablica, a pesar de la dictadura, mantuvo su funci\xf3n cr\xedtica y su autonom\xeda acad\xe9mica intactas.",B.e,"Falso","Una universidad 'intervenida' y bajo un r\xe9gimen dictatorial inherentemente pierde gran parte de su autonom\xeda y capacidad cr\xedtica, lo cual es el objeto de estudio del documento.")
B.a4q=new A.c("7","La Sociedad de Psicolog\xeda del Uruguay es mencionada en las referencias bibliogr\xe1ficas, lo que sugiere su relevancia en el per\xedodo.",B.e,"Verdadero","Las referencias bibliogr\xe1ficas incluyen m\xfaltiples entradas de la 'SOCIEDAD DE PSICOLOG\xcdA DEL URUGUAY' (p. 57), lo que indica que es una fuente consultada y una entidad relevante para el estudio de la psicolog\xeda en el per\xedodo.")
B.a1Z=new A.c("7","El art\xedculo de Markarian tambi\xe9n considera la existencia de un dise\xf1o 'm\xe1s o menos sistem\xe1tico' de la educaci\xf3n superior durante la dictadura.",B.e,"Verdadero","El resumen de Markarian busca 'evaluar hasta qu\xe9 punto existi\xf3 un dise\xf1o m\xe1s o menos sistem\xe1tico de la educaci\xf3n superior en la nueva etapa' (p. 2).")
B.a5L=new A.c("7","El documento 'Documento de Trabajo 7' es un art\xedculo cient\xedfico completo y auto-contenido, sin referencia a otras investigaciones doctorales.",B.e,"Falso","El 'Documento de Trabajo 7' es un material para el curso de Historia de la Psicolog\xeda, y contiene un art\xedculo de Vania Markarian, que es una publicaci\xf3n espec\xedfica y no la totalidad del documento de trabajo que podr\xeda incluir otros apartados del curso.")
B.a6X=new A.c("7","La dictadura uruguaya no realiz\xf3 cambios significativos en el curr\xedculo universitario, manteniendo los planes de estudio del per\xedodo predicatorial.",B.e,"Falso","El resumen de Markarian menciona la necesidad de examinar 'una serie de cambios a nivel acad\xe9mico y curricular' (p. 2), lo que contradice la idea de que no hubo cambios.")
B.a2D=new A.c("7","La reglamentaci\xf3n del ejercicio profesional del psic\xf3logo fue un tema conflictivo debido a la diversidad de perspectivas sobre la identidad y funciones de la profesi\xf3n.",B.e,"Verdadero","La existencia de 'Controversias en torno a la reglamentaci\xf3n del ejercicio profesional' (p. 1) inherentemente implica debates y diferencias de perspectivas sobre c\xf3mo deb\xeda definirse y regularse la profesi\xf3n.")
B.aas=new A.c("7","El art\xedculo de Markarian es un ejemplo de c\xf3mo los estudios sobre la dictadura en Uruguay est\xe1n evolucionando hacia an\xe1lisis m\xe1s complejos y matizados.",B.e,"Verdadero","El resumen de Markarian declara que el art\xedculo 'busca superar los relatos centrados en los aspectos represivos' y se suma a una 'renovada atenci\xf3n' (p. 2), lo que indica una evoluci\xf3n en los enfoques historiogr\xe1ficos.")
B.a1w=new A.c("7","La Universidad de la Rep\xfablica, durante la dictadura, experiment\xf3 una reducci\xf3n dr\xe1stica de su presupuesto, impactando directamente en la calidad educativa.",B.e,"Verdadero","Aunque no se detalla en el fragmento inicial, la intervenci\xf3n dictatorial en las universidades hist\xf3ricamente ha implicado recortes presupuestarios significativos como forma de control. (Impl\xedcito en la naturaleza de una intervenci\xf3n autoritaria).")
B.a3K=new A.c("7","El documento sugiere que el estudio de la dictadura en la Universidad no debe limitarse a los aspectos puramente pol\xedticos, sino tambi\xe9n a los cambios acad\xe9micos y curriculares.",B.e,"Verdadero","El resumen de Markarian enfatiza que el objetivo es 'examinar una serie de cambios a nivel acad\xe9mico y curricular', no solo los aspectos represivos (p. 2).")
B.a0w=new A.c("7","La Revista Uruguaya de Psicolog\xeda es una publicaci\xf3n mencionada en las referencias bibliogr\xe1ficas, lo que la posiciona como fuente de informaci\xf3n relevante.",B.e,"Verdadero","Las referencias incluyen 'TUANA, Elida. Reconocimiento legal del campo profesional del psic\xf3logo. Revista Uruguaya de Psicolog\xeda 1 (4) pp. 12- 18. Montevideo, 1980.' (p. 57).")
B.a9s=new A.c("7","La dictadura en Uruguay, al igual que en otros pa\xedses del Cono Sur, busc\xf3 controlar la educaci\xf3n superior para consolidar el r\xe9gimen autoritario.",B.e,"Verdadero","El resumen de Markarian se inserta en el contexto de la 'permanencia de los regimenes autoritarios del Cono Sur durante periodos relativamente prolongados, incluyendo de modo muy especial el \xe1rea educativa' (p. 2), lo que implica este control.")
B.a2v=new A.c("7","El documento se enfoca en la etapa de pos-dictadura, analizando la restauraci\xf3n de la autonom\xeda universitaria.",B.e,"Falso","El per\xedodo central de estudio del art\xedculo de Markarian es 'durante la \xfaltima dictadura (1973-1984)' (p. 2), no la pos-dictadura.")
B.a9a=new A.c("8","El 'Documento de trabajo 8' se enfoca en el per\xedodo de la dictadura uruguaya y sus impactos en la educaci\xf3n superior en psicolog\xeda.",B.e,"Falso","El documento aborda los 'ACONTECIMIENTOS INSTITUCIONALES Y DISCIPLINARES QUE SE DESTACAN EN EL PER\xcdODO DE RECUPERACI\xd3N DEMOCR\xc1TICA' (p. 2), lo que se sit\xfaa despu\xe9s de la dictadura.")
B.ab4=new A.c("8","La creaci\xf3n de la Facultad de Psicolog\xeda fue aprobada por el Consejo Directivo Central de la Universidad de la Rep\xfablica en marzo de 1994.",B.e,"Verdadero","El documento establece: 'El 15 de marzo de 1994 el Consejo Directivo Central de la Universidad de la Rep\xfablica aprueba, por unanimidad, la creaci\xf3n de la Facultad de Psicolog\xeda' (p. 3).")
B.a_p=new A.c("8","La creaci\xf3n de la Facultad de Psicolog\xeda fue un evento aislado, sin antecedentes ni procesos previos que la gestaran.",B.e,"Falso","El texto se\xf1ala que la creaci\xf3n de la Facultad 'es parte de un proceso cuya procedencia se puede buscar en las m\xfaltiples acciones que diferentes agentes fueron realizando en torno al saber de la psicolog\xeda' a lo largo del siglo XX (p. 3).")
B.ZD=new A.c("8","El documento destaca la creaci\xf3n de la Facultad de Psicolog\xeda, la reglamentaci\xf3n del ejercicio profesional y las transformaciones acad\xe9micas en el nuevo siglo.",B.e,"Verdadero","El documento indica que se destacan 'LA CREACION DE LA FACULTAD DE PSICOLOG\xcdA, LA REGLAMENTACI\xd3N DEL EJERCICIO PROFESIONAL DE LA PSICOLOG\xcdA Y LAS TRANSFORMACIONES ACAD\xc9MICAS EN EL NUEVO SIGLO' (p. 2).")
B.a0M=new A.c("8","El 'Proyecto de Transformaci\xf3n Acad\xe9mica' de la Facultad de Psicolog\xeda busca separar la investigaci\xf3n de grado del desarrollo de posgrados y carrera docente.",B.e,"Falso","Uno de los objetivos del proyecto es que el desarrollo de la investigaci\xf3n y los posgrados 'establezca una relaci\xf3n necesaria y complementaria con el cuidado y mejora de las actividades de ense\xf1anza de grado' (p. 49).")
B.a_V=new A.c("8","La Universidad de la Rep\xfablica, en el per\xedodo post-dictadura, mantuvo la intervenci\xf3n del Estado en su autonom\xeda.",B.e,"Falso","El documento se sit\xfaa en el 'per\xedodo de recuperaci\xf3n democr\xe1tica' (p. 2), lo que implica la restauraci\xf3n de la autonom\xeda universitaria.")
B.YI=new A.c("8","El documento menciona que el plan de estudio de la Licenciatura en Psicolog\xeda se cre\xf3 en 1989.",B.e,"Verdadero","El documento tiene una secci\xf3n titulada 'El plan de estudio de la Licenciatura de 1989' (p. 1) y se refiere a este como el primer plan de estudios de la carrera.")
B.a9C=new A.c("8","La Facultad de Psicolog\xeda, al ser creada, abandon\xf3 por completo la misi\xf3n de formar profesionales para el \xe1mbito p\xfablico, centr\xe1ndose solo en el ejercicio liberal.",B.e,"Falso","Uno de los objetivos estrat\xe9gicos es 'Promover un proyecto de desarrollo universitario de la Psicolog\xeda en el pa\xeds que integre el \xe1mbito acad\xe9mico y el desempe\xf1o profesional, estableciendo sinergias y complementariedades' (p. 49), lo que incluye el \xe1mbito p\xfablico.")
B.Ym=new A.c("8","La 'transformaci\xf3n acad\xe9mica' busca una mayor apertura al di\xe1logo con el desarrollo de la disciplina a nivel mundial.",B.e,"Verdadero","Uno de los objetivos es 'Producir los cambios necesarios en la cultura acad\xe9mica para posibilitar mayores niveles de di\xe1logo con el desarrollo de la disciplina en el mundo' (p. 49).")
B.a0g=new A.c("8","El documento aborda la creaci\xf3n del Instituto de Psicolog\xeda del Uruguay (IPUR) como antecedente de la Facultad.",B.e,"Verdadero","El t\xedtulo mismo del documento es 'Del IPUR a la Facultad de Psicolog\xeda', y la introducci\xf3n se\xf1ala el proceso que lleva a la creaci\xf3n de la Facultad (p. 3).")
B.a20=new A.c("8","La 'reglamentaci\xf3n de la profesi\xf3n' del psic\xf3logo en Uruguay no fue un tema conflictivo en el per\xedodo de recuperaci\xf3n democr\xe1tica.",B.e,"Falso","La reglamentaci\xf3n del ejercicio profesional es uno de los temas destacados del documento, lo que implica su relevancia y posible conflictividad.")
B.aax=new A.c("8","El incremento en el n\xfamero anual de graduados es uno de los objetivos de la reforma universitaria en la Facultad de Psicolog\xeda.",B.e,"Verdadero","Uno de los objetivos estrat\xe9gicos es 'Incrementar el n\xfamero anual de graduados en el marco del proyecto de desarrollo acad\xe9mico de la Facultad y de los objetivos de la Reforma Universitaria' (p. 49).")
B.a6w=new A.c("8","El documento sugiere que los cambios en la Facultad de Psicolog\xeda no requerir\xe1n de la participaci\xf3n activa de sus integrantes.",B.e,"Falso","Uno de los objetivos es 'Aumentar los niveles de involucramiento de los integrantes de la Facultad de Psicolog\xeda con el proyecto institucional, dado que el mismo requiere de su creciente participaci\xf3n' (p. 49).")
B.abe=new A.c("8","La autonom\xeda universitaria, una vez recuperada la democracia, implic\xf3 que la Facultad de Psicolog\xeda pudiera definir su propio plan de estudios sin intervenci\xf3n externa.",B.e,"Verdadero","En un contexto de recuperaci\xf3n democr\xe1tica y autonom\xeda universitaria, las facultades adquieren la potestad de definir sus planes de estudio, como se evidencia con la creaci\xf3n del plan de 1989 y las posteriores transformaciones acad\xe9micas.")
B.a1H=new A.c("8","La b\xfasqueda de una 'psicolog\xeda de calidad al servicio de nuestra sociedad' es un objetivo expl\xedcito de la Facultad de Psicolog\xeda.",B.e,"Verdadero","Uno de los objetivos es 'profundizar los componentes identitarios que nos permitan desarrollar una psicolog\xeda de calidad al servicio de nuestra sociedad' (p. 49).")
B.ZJ=new A.c("8","El documento analiza en detalle la historia de los diferentes departamentos y c\xe1tedras de la Facultad de Psicolog\xeda.",B.e,"Falso","El documento se centra en hitos institucionales m\xe1s amplios como la creaci\xf3n de la Facultad, la reglamentaci\xf3n profesional y los planes de estudio, no en la estructura interna detallada.")
B.a5E=new A.c("8","La 'Reforma Universitaria' mencionada en el documento se refiere a un proceso ajeno a la Facultad de Psicolog\xeda, que solo afect\xf3 a otras facultades.",B.e,"Falso","La 'Reforma Universitaria' es un marco general que afecta a toda la Universidad de la Rep\xfablica, y los objetivos de la Facultad de Psicolog\xeda se insertan en este marco (p. 49).")
B.XW=new A.c("8","El documento hace un an\xe1lisis profundo de las diferentes corrientes te\xf3ricas que coexistieron en la formaci\xf3n de la psicolog\xeda en este per\xedodo.",B.e,"Falso","Aunque la diversidad te\xf3rica es impl\xedcita en una facultad de psicolog\xeda, el documento se enfoca m\xe1s en los aspectos institucionales, de reglamentaci\xf3n y de planes de estudio que en un an\xe1lisis detallado de las corrientes te\xf3ricas.")
B.a1f=new A.c("8","Uno de los desaf\xedos de la Facultad de Psicolog\xeda es lograr que los resultados procurados alcancen niveles de estabilidad a mediano y largo plazo.",B.e,"Verdadero","Uno de los objetivos es 'Establecer modalidades de gesti\xf3n que posibiliten que los resultados procurados alcancen niveles de estabilidad de mediano y largo plazo' (p. 49).")
B.a6e=new A.c("8","El documento proporciona una perspectiva sobre c\xf3mo la psicolog\xeda uruguaya se ha ido consolidando como una disciplina madura en el contexto democr\xe1tico.",B.e,"Verdadero","Al abordar la creaci\xf3n de la Facultad, la reglamentaci\xf3n y las transformaciones acad\xe9micas en el per\xedodo democr\xe1tico, el documento ilustra el proceso de consolidaci\xf3n de la disciplina.")
B.ab1=new A.c("9","El 'Documento de trabajo 9' fue elaborado por el Profesor Adjunto Dr. Gonzalo Correa.",B.e,"Verdadero","El documento indica en la p\xe1gina 2: 'SU AUTOR ES EL PROFESOR ADJUNTO DR. GONZALO CORREA.'")
B.aav=new A.c("9","El documento tiene como uno de sus objetivos principales describir la producci\xf3n acad\xe9mica en psicolog\xeda en Uruguay, incluyendo l\xedneas de investigaci\xf3n y desarrollo.",B.e,"Verdadero","El t\xedtulo del documento es 'PRODUCCI\xd3N LOCAL: L\xcdNEAS DE INVESTIGACI\xd3N, TEMAS, PROBLEMAS Y PRODUCCI\xd3N ACAD\xc9MICA, DESARROLLO E INNOVACI\xd3N', lo que refleja su objetivo.")
B.a5j=new A.c("9","La investigaci\xf3n en psicolog\xeda latinoamericana es un campo homog\xe9neo, sin diferencias significativas entre pa\xedses.",B.e,"Falso","El documento cita a Vera-Villarroel et al. (2011) en su an\xe1lisis de la 'producci\xf3n cient\xedfica en psicolog\xeda latinoamericana: Un an\xe1lisis de la investigaci\xf3n por pa\xedses' (p. 21), lo que implica diferencias entre ellos. Adem\xe1s, el propio documento se centra en la 'producci\xf3n local' uruguaya.")
B.YY=new A.c("9","El documento sugiere que la autonom\xeda de la disciplina psicol\xf3gica en Uruguay se ha logrado plenamente, sin tensiones con el campo profesional.",B.e,"Falso","Una de las secciones se titula 'ACADEMIA Y PROFESI\xd3N: TENSIONES Y CRUCES' (p. 13), lo que indica la existencia de tensiones entre ambos \xe1mbitos.")
B.a_q=new A.c("9","La Universidad de la Rep\xfablica ha sido la \xfanica instituci\xf3n que ha contribuido a la consolidaci\xf3n de espacios de formaci\xf3n de profesionales en psicolog\xeda en Uruguay.",B.e,"Falso","La p\xe1gina 4 del documento dice: 'EN ESTE DOCUMENTO SE PRESENTAN LAS DIFERENTES EXPERIENCIAS QUE APORTARON A LA CONSOLIDACI\xd3N DE ESPACIOS DE FORMACI\xd3N DE PROFESIONALES EN EL CAMPO DE LA PSICOLOG\xcdA...', lo que sugiere pluralidad de experiencias y no exclusividad de la UdelaR.")
B.Z1=new A.c("9","La investigaci\xf3n psicol\xf3gica en la regi\xf3n ha mostrado un crecimiento sostenido, con un aumento en la cantidad de publicaciones.",B.e,"Verdadero","Se se\xf1ala que las investigaciones sobre la producci\xf3n cient\xedfica en Am\xe9rica Latina 'han evidenciado un incremento en la cantidad de publicaciones' (p. 6).")
B.a_2=new A.c("9","El 'incipiente despertar de la academia' en la psicolog\xeda uruguaya se refiere al per\xedodo de la pos-dictadura, donde la investigaci\xf3n comenz\xf3 a ganar terreno.",B.e,"Verdadero","La secci\xf3n 'EL INCIPIENTE DESPERTAR DE LA ACADEMIA EN LA PSICOLOG\xcdA EN URUGUAY' se sit\xfaa cronol\xf3gicamente en el per\xedodo de recuperaci\xf3n democr\xe1tica y la creaci\xf3n de la Facultad de Psicolog\xeda, donde la investigaci\xf3n acad\xe9mica comienza a consolidarse (p. 15).")
B.a2H=new A.c("9","La publicaci\xf3n de art\xedculos en revistas indexadas es un indicador de la producci\xf3n acad\xe9mica en psicolog\xeda.",B.e,"Verdadero","El documento menciona que los estudios sobre la producci\xf3n cient\xedfica en la regi\xf3n se basan en el 'an\xe1lisis de art\xedculos en revistas indexadas' (p. 6), lo que lo valida como indicador.")
B.aa1=new A.c("9","La relaci\xf3n entre la academia y la profesi\xf3n en psicolog\xeda se ha caracterizado por una completa armon\xeda y colaboraci\xf3n desde los inicios de la disciplina.",B.e,"Falso","La secci\xf3n 'ACADEMIA Y PROFESI\xd3N: TENSIONES Y CRUCES' (p. 13) indica que ha habido conflictos y desaf\xedos en esta relaci\xf3n, no una armon\xeda total.")
B.a00=new A.c("9","El documento solo se enfoca en la investigaci\xf3n cuantitativa, sin considerar la producci\xf3n acad\xe9mica cualitativa.",B.e,"Falso","Aunque menciona estudios sobre producci\xf3n cient\xedfica con m\xe9tricas cuantitativas (como art\xedculos indexados), el documento en s\xed mismo no excluye la importancia de la producci\xf3n cualitativa y aborda 'temas' y 'problemas' que pueden ser objeto de ambos tipos de investigaci\xf3n.")
B.a27=new A.c("9","Las 'nuevas din\xe1micas del conocimiento cient\xedfico' han impactado la psicolog\xeda latinoamericana.",B.e,"Verdadero","El documento cita a Alarc\xe3o y L\xf3pez L\xf3pez (2014) sobre 'Las nuevas din\xe1micas del conocimiento cient\xedfico y su impacto en la Psicolog\xeda Latinoamericana' (p. 21).")
B.YA=new A.c("9","La Facultad de Psicolog\xeda, una vez creada, se dedic\xf3 exclusivamente a la formaci\xf3n de grado, sin impulsar posgrados o investigaci\xf3n.",B.e,"Falso","La secci\xf3n 'EL INCIPIENTE DESPERTAR DE LA ACADEMIA...' (p. 15) se refiere a la consolidaci\xf3n de la investigaci\xf3n y producci\xf3n acad\xe9mica, lo que implica desarrollo de posgrados y l\xedneas de investigaci\xf3n.")
B.YC=new A.c("9","La 'producci\xf3n acad\xe9mica' en psicolog\xeda se limita a la publicaci\xf3n de libros.",B.e,"Falso","La producci\xf3n acad\xe9mica incluye 'l\xedneas de investigaci\xf3n, temas, problemas y producci\xf3n acad\xe9mica, desarrollo e innovaci\xf3n' (t\xedtulo del documento), lo que abarca m\xe1s que solo libros, como art\xedculos, proyectos, etc.")
B.a81=new A.c("9","El documento sugiere que la autonom\xeda de la investigaci\xf3n psicol\xf3gica en Uruguay ha sido un proceso r\xe1pido y sin obst\xe1culos.",B.e,"Falso","El t\xe9rmino 'incipiente despertar' (p. 15) sugiere que el proceso ha sido gradual y en desarrollo, no algo ya completamente consolidado y sin desaf\xedos.")
B.abf=new A.c("9","La Revista Uruguaya de Psicolog\xeda es mencionada en las referencias bibliogr\xe1ficas, lo que la posiciona como un medio de difusi\xf3n importante.",B.e,"Verdadero","Las referencias bibliogr\xe1ficas incluyen a 'TUANA, E (1983) Panorama de la Psicolog\xeda en el Uruguay en el momento de la creaci\xf3n de la Sociedad de Psicolog\xeda del Uruguay, en Psicolog\xeda, AAVV, Multiplicidades, Uruguay' (p. 21). Esto indica su existencia y relevancia.")
B.XK=new A.c("9","El texto aborda la relaci\xf3n entre la psicolog\xeda y el 'capitalismo mundial integrado'.",B.e,"Verdadero","El documento cita a Guattari (2004) 'Plan sobre el planeta: Capitalismo mundial integrado y revoluciones moleculares' (p. 21), lo que indica la consideraci\xf3n de esta relaci\xf3n en el contexto de la producci\xf3n acad\xe9mica.")
B.YU=new A.c("9","Las 'l\xedneas de investigaci\xf3n' en psicolog\xeda uruguaya son est\xe1ticas y no han evolucionado a lo largo del tiempo.",B.e,"Falso","El documento aborda la 'producci\xf3n local: l\xedneas de investigaci\xf3n, temas, problemas...' (t\xedtulo), lo que implica una din\xe1mica y evoluci\xf3n de estos aspectos en el tiempo.")
B.a5P=new A.c("9","El 'desarrollo' y la 'innovaci\xf3n' son considerados aspectos relevantes de la producci\xf3n acad\xe9mica en psicolog\xeda.",B.e,"Verdadero","El t\xedtulo del documento incluye expl\xedcitamente 'DESARROLLO E INNOVACI\xd3N' como parte de la producci\xf3n local, lo que confirma su relevancia.")
B.a9N=new A.c("9","La 'producci\xf3n local' se refiere exclusivamente a la publicaci\xf3n de tesis de grado.",B.e,"Falso","La producci\xf3n local abarca 'l\xedneas de investigaci\xf3n, temas, problemas y producci\xf3n acad\xe9mica, desarrollo e innovaci\xf3n', que es un concepto mucho m\xe1s amplio que solo las tesis de grado.")
B.a_w=new A.c("9","El documento de Nikolas Rose 'A critical history of psychology' es referenciado, lo que sugiere una perspectiva cr\xedtica en el an\xe1lisis de la producci\xf3n local.",B.e,"Verdadero","Rose, N. (1996) 'Chapter 2: A critical history of psychology. En: N. Rose, Inventing our Selves: Psychology, Power, and Personhood. Cambridge: Cambridge University Press.' es una de las referencias (p. 21), lo que indica la influencia de esta perspectiva.")
B.a2b=new A.c("Parcial 1","A fines del XVII se instala una tecnolog\xeda disciplinar que son t\xe9cnicas de cuidado y aumento de la fuerza del cuerpo a trav\xe9s del trabajo y t\xe9cnicas de racionalizaci\xf3n y de econom\xeda de poder.",B.e,"Falso","Las tecnolog\xedas disciplinares de las que habla Foucault se desarrollan principalmente a partir del siglo XVIII y se consolidan en el XIX, no a fines del XVII. Se enfocan en la vigilancia, la normalizaci\xf3n y la productividad de los cuerpos.")
B.a3q=new A.c("Parcial 1","Augusto Comte propondr\xe1 la idea de una ciencia de la sociedad, similar a las ciencias naturales llamada: la f\xedsica social.",B.e,"Verdadero","Augusto Comte es el padre del positivismo y propuso la 'f\xedsica social' o sociolog\xeda como la ciencia que estudiar\xeda la sociedad con m\xe9todos cient\xedficos, similares a los de las ciencias naturales.")
B.a2U=new A.c("Parcial 1","Danziger no hace acuerdo con la idea que los objetos como 'la inteligencia', las 'actitudes', 'la personalidad', sean el producto de una construcci\xf3n humana.",B.e,"Falso","Danziger es un historiador de la psicolog\xeda que precisamente argumenta que las categor\xedas psicol\xf3gicas son construcciones hist\xf3ricas y sociales, no entidades naturales o preexistentes.")
B.aan=new A.c("Parcial 1","Danziger sostiene que el ahistoricismo de la psicolog\xeda consiste en suponer que la investigaci\xf3n psicol\xf3gica est\xe1 interesada en objetos que son naturales y universales y en el empleo de m\xe9todos propios de los de las ciencias naturales.",B.e,"Verdadero","Danziger critica el ahistoricismo en psicolog\xeda, que precisamente consiste en naturalizar los objetos de estudio (considerarlos universales y atemporales) y aplicar m\xe9todos de las ciencias naturales sin reconocer su construcci\xf3n hist\xf3rica.")
B.a4W=new A.c("Parcial 1","Danziger sostiene que todas las categor\xedas psicol\xf3gicas han cambiado su significado a lo largo de la historia al igual que el discurso del cual eran parte.",B.e,"Verdadero","Esta es una idea central del trabajo de Danziger: las categor\xedas psicol\xf3gicas no son est\xe1ticas, sino que su significado evoluciona y se construye hist\xf3ricamente dentro de discursos espec\xedficos.")
B.Yh=new A.c("Parcial 1","Danziger sugiere que los textos de contenido psicol\xf3gico toman sus t\xe9rminos del lenguaje coloquial, precisamente esto es lo que les permiten comunicar cosas significativas a quienes est\xe1n dirigidos.",B.e,"Verdadero","Danziger analiza c\xf3mo la psicolog\xeda a menudo utiliza t\xe9rminos del lenguaje com\xfan, lo que facilita su difusi\xf3n y comprensi\xf3n, pero tambi\xe9n puede generar ambig\xfcedad y mistificaci\xf3n sobre su estatus cient\xedfico.")
B.a9Q=new A.c("Parcial 1","De acuerdo a Rose (1996), que los saberes psicol\xf3gicos tengan, seg\xfan Foucault, un 'bajo perfil epistemol\xf3gico' tiene como consecuencia que las cuestiones \xe9ticas que afectan la tarea del psic\xf3logo sean m\xe1s pueriles, menos presentes y permanentes.",B.e,"Falso","Un 'bajo perfil epistemol\xf3gico' para Foucault y Rose no significa que las cuestiones \xe9ticas sean menos importantes. Al contrario, al no ser una ciencia 'neutra', las pr\xe1cticas psi est\xe1n inherentemente imbricadas en relaciones de poder, lo que hace que las dimensiones \xe9ticas sean cruciales.")
B.XU=new A.c("Parcial 1","De la lectura de Danziger se puede deducir que el conocimiento es un producto cultural, m\xe1s que un reflejo pasivo de la realidad.",B.e,"Verdadero","Danziger, como historiador cr\xedtico, adopta una perspectiva constructivista del conocimiento, entendiendo que las verdades cient\xedficas son productos de contextos culturales, sociales e hist\xf3ricos.")
B.a2O=new A.c("Parcial 1","Desde la perspectiva de la gubernamentalidad de Foucault y Rose, las tecnolog\xedas de poder se preocupan por el gobierno de los cuerpos para producir vidas \xfatiles y d\xf3ciles.",B.e,"Verdadero","La gubernamentalidad, las disciplinas y el biopoder buscan precisamente la producci\xf3n de cuerpos y vidas \xfatiles, d\xf3ciles y productivos para los fines de gobierno.")
B.a2i=new A.c("Parcial 1","El m\xe9todo de Foucault, a trav\xe9s de la arqueolog\xeda, tiene como objetivo identificar las estructuras discursivas y las formaciones de saber que posibilitan la emergencia de objetos y sujetos en un momento hist\xf3rico dado.",B.e,"Verdadero","La arqueolog\xeda foucaultiana busca desenterrar las reglas y condiciones de posibilidad de lo que se puede decir y conocer en una \xe9poca determinada, es decir, las 'formaciones discursivas' o 'epistemes'.")
B.a2I=new A.c("Parcial 1","El positivismo fue una corriente filos\xf3fica y cient\xedfica que tuvo como objetivo la separaci\xf3n de la ciencia de la metaf\xedsica, dejando de lado los prejuicios y la especulaci\xf3n teol\xf3gica.",B.e,"Verdadero","El positivismo de Comte busc\xf3 establecer el conocimiento cient\xedfico como la \xfanica forma v\xe1lida de conocimiento, rechazando la metaf\xedsica y la teolog\xeda.")
B.a01=new A.c("Parcial 1","El Positivismo se caracteriz\xf3 por su confianza en la raz\xf3n y la experiencia, y por el impulso de la investigaci\xf3n cient\xedfica en todos los campos del saber.",B.e,"Verdadero","El positivismo se basa en la observaci\xf3n y la experiencia (empirismo) y en la aplicaci\xf3n del m\xe9todo cient\xedfico para el progreso del conocimiento.")
B.a9O=new A.c("Parcial 1","El surgimiento de la sociedad moderna, a fines del siglo XIX, se caracteriz\xf3 por una profunda transformaci\xf3n en las relaciones de poder que dej\xf3 de lado la coerci\xf3n f\xedsica.",B.e,"Falso","Aunque la sociedad moderna desarrolla nuevas formas de poder (disciplinar, biopol\xedtico), la coerci\xf3n f\xedsica no desaparece por completo. Las nuevas formas de poder se superponen o complementan a las anteriores.")
B.ZE=new A.c("Parcial 1","El 'acontecimiento', desde la perspectiva de la genealog\xeda, tiene un car\xe1cter singular, aleatorio y contingente.",B.e,"Verdadero","La genealog\xeda foucaultiana enfatiza la contingencia y la discontinuidad de los 'acontecimientos' hist\xf3ricos, oponi\xe9ndose a la idea de un progreso lineal o una esencia.")
B.a_L=new A.c("Parcial 1","En la historia cr\xedtica de la psicolog\xeda, lo que se debe analizar son los intereses pol\xedticos y econ\xf3micos que se esconden detr\xe1s de la producci\xf3n de saber y de las pr\xe1cticas de la disciplina.",B.e,"Verdadero","Una historia cr\xedtica busca precisamente desvelar las relaciones entre saber, poder e inter\xe9s, y c\xf3mo la psicolog\xeda se ha imbricado en agendas pol\xedticas y econ\xf3micas.")
B.ZK=new A.c("Parcial 1","En la investigaci\xf3n geneal\xf3gica, seg\xfan Foucault, no existen verdades universales, solo se puede conocer la verdad que est\xe1 situada hist\xf3ricamente.",B.e,"Verdadero","La genealog\xeda foucaultiana sostiene que las 'verdades' son efectos de reg\xedmenes de poder-saber hist\xf3ricamente situados y contingentes, no universales o atemporales.")
B.XM=new A.c("Parcial 1","Es propio de la perspectiva geneal\xf3gica el cuestionamiento de las esencias, los fundamentos y la b\xfasqueda de los or\xedgenes primeros de los fen\xf3menos.",B.e,"Falso","La genealog\xeda cuestiona la b\xfasqueda de esencias y or\xedgenes primeros, buscando en cambio la contingencia, las rupturas y las discontinuidades.")
B.a1O=new A.c("Parcial 1","Foucault sostiene que la arqueolog\xeda y la genealog\xeda son una misma cosa, un m\xe9todo que busca lo universal.",B.e,"Falso","Arqueolog\xeda y genealog\xeda son m\xe9todos complementarios pero distintos. Ninguno busca lo universal; se enfocan en lo particular, lo singular y lo discontinuo.")
B.a_R=new A.c("Parcial 1","Foucault, en sus an\xe1lisis, presenta el poder como una red de relaciones que atraviesa todo el cuerpo social y no se reduce al Estado.",B.e,"Verdadero","Una idea central de Foucault es que el poder no es solo represivo o centralizado en el Estado, sino una 'microf\xedsica del poder', una red productiva que circula por todo el cuerpo social.")
B.a3b=new A.c("Parcial 1","La anal\xedtica de gobierno, que propone Foucault, busca analizar las divisiones y las distribuciones de poder y autoridad como construcciones, ensambles, disputados y transformados por m\xfaltiples y heterog\xe9neos elementos.",B.e,"Verdadero","Esta es una descripci\xf3n precisa de c\xf3mo la anal\xedtica de gobierno de Foucault va m\xe1s all\xe1 de una visi\xf3n cl\xe1sica del Estado para entender el poder como un entramado de relaciones.")
B.XO=new A.c("Parcial 1","La aproximaci\xf3n hist\xf3rico-cr\xedtica busca la reconstrucci\xf3n del pasado de la psicolog\xeda como la historia de un progreso lineal y acumulativo del conocimiento.",B.e,"Falso","La historia cr\xedtica se opone a las historias de progreso lineal y acumulativo, buscando en cambio la contingencia y las rupturas.")
B.a9c=new A.c("Parcial 1","La Biopol\xedtica de Foucault refiere a una tecnolog\xeda de poder que tiene por objeto la vida del individuo, con el objetivo de aumentar sus capacidades, su utilidad y su docilidad.",B.e,"Falso","La biopol\xedtica se refiere al gobierno de la poblaci\xf3n como especie. La tecnolog\xeda que tiene por objeto la vida del individuo es la disciplina.")
B.a1u=new A.c("Parcial 1","La gubernamentalidad no se interesa por las formas de racionalidad que gu\xedan las acciones de gobierno.",B.e,"Falso","La gubernamentalidad es precisamente el estudio de las 'racionalidades de gobierno', es decir, las formas en que se piensa y se justifican las pr\xe1cticas de gobierno.")
B.a1q=new A.c("Parcial 1","La gubernamentalidad se limita a analizar las relaciones entre gobernantes y gobernados en el \xe1mbito estatal.",B.e,"Falso","La gubernamentalidad abarca una 'conducci\xf3n de conductas' mucho m\xe1s amplia, que incluye una multiplicidad de actores y dominios m\xe1s all\xe1 del mero \xe1mbito estatal.")
B.a8o=new A.c("Parcial 1","La historia tradicional de la psicolog\xeda se preocupa por mostrar un progreso acumulativo de la ciencia, donde las ideas del pasado son el antecedente de las ideas del presente.",B.e,"Verdadero","Esta es la cr\xedtica central que Rose hace a las historias 'recurrentes' o tradicionales de la psicolog\xeda.")
B.a46=new A.c("Parcial 1","Las 'ciencias humanas' (psicolog\xeda, sociolog\xeda, etc.) son saberes con un alto perfil epistemol\xf3gico, por lo que no requieren de una historia cr\xedtica.",B.e,"Falso","Para Foucault y Rose, las ciencias humanas tienen un 'bajo perfil epistemol\xf3gico', lo que precisamente justifica la necesidad de una historia cr\xedtica.")
B.a7v=new A.c("Parcial 1","Las disciplinas tienen como objetivo el gobierno del alma, mientras que la biopol\xedtica tiene como objetivo el gobierno del cuerpo.",B.e,"Falso","Las disciplinas tienen como objetivo el gobierno del cuerpo individual. La biopol\xedtica tiene como objetivo el gobierno del cuerpo-especie/poblaci\xf3n.")
B.Yf=new A.c("Parcial 1","Las pr\xe1cticas historiadoras que tienen un 'bajo perfil epistemol\xf3gico' son aquellas que se caracterizan por una escasa rigurosidad metodol\xf3gica en la reconstrucci\xf3n del pasado.",B.e,"Falso","El 'bajo perfil epistemol\xf3gico' no se refiere a la rigurosidad metodol\xf3gica, sino a que los objetos de estudio y las verdades de una disciplina son construcciones hist\xf3ricas y contingentes.")
B.a83=new A.c("Parcial 1","Los estudios cr\xedticos en historia de la psicolog\xeda se caracterizan por asumir un enfoque presentista, en la medida que busca mostrar la historia como un progreso acumulativo y lineal del conocimiento.",B.e,"Falso","Un enfoque cr\xedtico se opone al presentismo y a las historias de progreso lineal. El presentismo es una caracter\xedstica de las historias tradicionales.")
B.a7F=new A.c("Parcial 1","Los 'objetos' de la psicolog\xeda, como la inteligencia, la personalidad, la conducta, son creaciones hist\xf3ricas y sociales y no esencias de la naturaleza humana.",B.e,"Verdadero","Esta es una postura fundamental de Danziger y de la historia cr\xedtica: los objetos de estudio psicol\xf3gicos son construcciones, no entidades naturales o universales.")
B.aao=new A.c("Parcial 1","Para Foucault, la noci\xf3n de 'episteme' refiere al suelo de positividad, es decir, al conjunto de las condiciones que hacen posible una determinada formaci\xf3n discursiva en una \xe9poca dada.",B.e,"Verdadero","La episteme es la configuraci\xf3n de saber que determina lo que es pensable, enunciable y posible en una \xe9poca.")
B.ZL=new A.c("Parcial 1","Para Foucault, la noci\xf3n de 'dispositivo' da cuenta de un conjunto heterog\xe9neo de elementos que se entrecruzan y se articulan en el gobierno de las conductas.",B.e,"Verdadero","El dispositivo foucaultiano es una red que establece entre discursos, instituciones, reglamentos, etc., para responder a una urgencia en el gobierno de las conductas.")
B.a0p=new A.c("Parcial 1","Para Nikolas Rose, una historia cr\xedtica no debe ser una reflexi\xf3n sobre la verdad de la psicolog\xeda, sino sobre las condiciones hist\xf3ricas de posibilidad de que determinadas afirmaciones hayan sido consideradas verdaderas.",B.e,"Verdadero","Rose plantea que la historia cr\xedtica reflexiona sobre las condiciones en las que se estableci\xf3 lo que entendemos por verdad y realidad, implicando una historicidad de la verdad.")
B.a6I=new A.c("Parcial 1","Para Nikolas Rose, los saberes 'psi' tienen un 'alto perfil epistemol\xf3gico' en la medida que est\xe1n fuertemente imbricados en las relaciones de poder.",B.e,"Falso","Para Rose, los saberes 'psi' tienen un 'bajo perfil epistemol\xf3gico' porque son contingentes y est\xe1n imbricados en relaciones de poder, diferenci\xe1ndolos de ciencias con pretensiones de verdades universales.")
B.a0P=new A.c("Parcial 1","Para Paul Veyne, el historiador tiene como tarea principal encontrar las leyes que rigen el desarrollo de los acontecimientos, para poder comprender la historia.",B.e,"Falso","Paul Veyne rechaza la b\xfasqueda de leyes universales en la historia, enfatizando la singularidad y contingencia de los acontecimientos.")
B.YT=new A.c("Parcial 1","Para Nikolas Rose, la 'psicolog\xeda' es una ciencia desinteresada y universal que se ha mantenido al margen de las relaciones de poder.",B.e,"Falso","Rose expl\xedcitamente plantea una 'historia cr\xedtica de la relaci\xf3n entre lo psicol\xf3gico, lo gubernamental y lo subjetivo', implicando que la psicolog\xeda est\xe1 imbricada en las relaciones de poder.")
B.aa_=new A.c("Parcial 1","Desde el siglo XIX en adelante, se instala una nueva forma de poder que ya no se focaliza en el cuerpo individual, sino en el cuerpo-especie, con el objetivo de regular las poblaciones.",B.e,"Verdadero","Esto describe el paso de las disciplinas (foco en el cuerpo individual) al biopoder (foco en el cuerpo-especie/poblaci\xf3n), un concepto clave de Foucault.")
B.a7E=new A.c("Parcial 1","Seg\xfan Foucault, el pasaje de Estado de polic\xeda a gobierno liberal incluir\xe1 la gesti\xf3n de la poblaci\xf3n en base a la conducci\xf3n de su deseo y a sus efectos en inter\xe9s colectivo.",B.e,"Verdadero","La l\xf3gica liberal intenta gobernar a trav\xe9s de la libertad de los individuos, buscando conducir sus deseos para que produzcan efectos deseables para el colectivo.")
B.a2c=new A.c("Parcial 1","Seg\xfan Nikolas Rose el proceso de disciplinarizaci\xf3n de la psicolog\xeda refiere a la elaboraci\xf3n de una gran variedad de t\xe9cnicas y pr\xe1cticas para disciplinar, vigilar y formar a las poblaciones y a los seres humanos que las conforman.",B.e,"Falso","La 'disciplinarizaci\xf3n' de la psicolog\xeda se refiere a su constituci\xf3n como disciplina acad\xe9mica y profesional, no a las t\xe9cnicas de poder en s\xed mismas.")
B.a25=new A.c("Parcial 1","Seg\xfan Nikolas Rose los objetos de la psicolog\xeda adquieren existencia por fuera del entramado de elementos que configura una red compleja y heterog\xe9nea, integrada por t\xe9cnicas y artefactos.",B.e,"Falso","Para Rose, los objetos de la psicolog\xeda son producidos dentro de este 'entramado' o 'dispositivo' de elementos heterog\xe9neos. No existen 'por fuera'.")
B.Ya=new A.c("Parcial 1","Seg\xfan Nikolas Rose, hasta la d\xe9cada de 1960 casi todas las historias de la psicolog\xeda pertenec\xedan en g\xe9nero de la 'historia recurrente', y en esa \xe9poca tales historias comenzaron a ser cuestionadas por soci\xf3logos y cr\xedticos de la cultura.",B.e,"Verdadero","Rose se\xf1ala que las historias recurrentes dominaron hasta los 60, cuando comenzaron a ser criticadas con la 'revoluci\xf3n historicista' y los Estudios de Ciencia y Tecnolog\xeda (STS).")
B.Z9=new A.c("Parcial 1","Seg\xfan Rose las historias recurrentes tienen un doble rol, por un lado establecen lo que entra en el universo pensable de una disciplina y por otro usan el presente para demarcar el r\xe9gimen de verdad a futuro.",B.e,"Falso","Las historias recurrentes usan el presente para demarcar el r\xe9gimen de verdad del pasado, mostrando las ideas actuales como la culminaci\xf3n de un progreso.")
B.a1W=new A.c("Parcial 1","Seg\xfan afirma Rose, las posiciones espiritualistas y positivistas, de modo alternado, han dominado el debate en torno a la 'construcci\xf3n social' del objeto de la psicolog\xeda.",B.e,"Falso","La 'construcci\xf3n social' es una tesis de la historia cr\xedtica. Espiritualismo y positivismo son corrientes que disputaron sobre la naturaleza de la psicolog\xeda en Uruguay.")
B.a1X=new A.c("Parcial 1","Siguiendo el planteo de Paul Veyne, investigar en historia exige dispersarse en singularidades en busca de encontrar y elegir el mejor modo de abordar una tem\xe1tica.",B.e,"Verdadero","Paul Veyne enfatiza la singularidad de los acontecimientos hist\xf3ricos y la necesidad de dispersarse en ellos para comprenderlos, en lugar de buscar leyes generales.")
B.XT=new A.c("Parcial 2","La formaci\xf3n del ciudadano en Uruguay al principio del siglo XX, tuvo en su horizonte la modelizaci\xf3n moral del sujeto, conductas y afectos.",B.e,"Verdadero","El Estado modernizador busc\xf3 modelar al ciudadano a trav\xe9s de la educaci\xf3n, la higiene, la psicopedagog\xeda y el 'encauzamiento moral'.")
B.a1P=new A.c("Parcial 2","A fines del XIX, el estado permanente de enfrentamiento b\xe9lico era acompa\xf1ado de una producci\xf3n inexistente, se importaban todo tipo de productos. En el plano intelectual las ideas que rigen la vida social tambi\xe9n reflejan atraso.",B.e,"Verdadero","El 'Militarismo' de fines del XIX fue un per\xedodo de gran atraso y enfrentamiento, donde se buscaba 'modernizar' el pa\xeds.")
B.a2W=new A.c("Parcial 2","El espiritualismo representado por Carlos Mar\xeda Ram\xedrez, critica severamente la inspiraci\xf3n darwinista y spenceriana de la obra de Varela y el cuestionamiento con sa\xf1a que realiza a la Universidad en la Legislaci\xf3n Escolar.",B.e,"Verdadero","Existi\xf3 una fuerte 'disputa entre espiritualismo y positivismo', donde figuras como Ram\xedrez se opon\xedan a las ideas positivistas y evolucionistas de Varela.")
B.a6F=new A.c("Parcial 2","La confrontaci\xf3n entre Carlos Mar\xeda Ram\xedrez con Varela, generaron un campo de disputa donde los espiritualistas fueron ganando cada vez m\xe1s espacio en la vida del pa\xeds. Muestra de esto el establecimiento de las primeras c\xe1tedras de la Facultad de Medicina y el ingreso de las ciencias naturales en la Universidad.",B.e,"Falso","La confrontaci\xf3n result\xf3 en el predominio del positivismo y el avance de las ciencias naturales en la Universidad, no en una ganancia de espacio para los espiritualistas.")
B.aaK=new A.c("Parcial 2","En 1945, Vaz Ferreira es designado catedr\xe1tico para el primer a\xf1o del curso de filosof\xeda y publica el Curso Expositivo de Psicolog\xeda. Esta Psicolog\xeda se distancia de toda influencia experimental y del positivismo, realizando un rechazo a la perspectiva que estudia las funciones ps\xedquicas.",B.e,"Falso","Vaz Ferreira fue cr\xedtico del positivismo dogm\xe1tico, pero impuls\xf3 la aplicaci\xf3n experimental de la psicolog\xeda. El 'Curso Expositivo de Psicolog\xeda' es de 1897.")
B.aam=new A.c("Parcial 2","Para Vaz Ferreira puede inferirse que el m\xe9todo de experimentaci\xf3n no permite conocer los hechos complejos y de la vida, y se debe utilizar solo el m\xe9todo de la observaci\xf3n.",B.e,"Falso","Vaz Ferreira valoraba la experimentaci\xf3n como forma de avanzar en el conocimiento psicol\xf3gico y no se limit\xf3 solo a la observaci\xf3n.")
B.a5t=new A.c("Parcial 2","Carlos Mar\xeda Ram\xedrez fue el gran impulsor del m\xe9todo experimental en la psicolog\xeda en Uruguay.",B.e,"Falso","Carlos Mar\xeda Ram\xedrez era una figura del espiritualismo, cr\xedtico de las corrientes experimentales. El impulsor fue Vaz Ferreira.")
B.Zj=new A.c("Parcial 2","El conocimiento positivo se caracteriz\xf3 por su utilidad y pragmatismo, lo que permiti\xf3 dar una soluci\xf3n a los problemas del atraso del pa\xeds y promover el desarrollo.",B.e,"Verdadero","El positivismo en Uruguay fue adoptado por su car\xe1cter 'pragm\xe1tico y utilitario' para solucionar los problemas del atraso y promover el desarrollo.")
B.Zt=new A.c("Parcial 2","La eugenesia fue una corriente de pensamiento que tuvo como objetivo la mejora de la calidad de vida de la poblaci\xf3n en base a la herencia gen\xe9tica.",B.e,"Verdadero","La eugenesia busca mejorar la especie humana controlando la reproducci\xf3n con base en la herencia gen\xe9tica.")
B.a4P=new A.c("Parcial 2","A principios del siglo XX, el Estado uruguayo se caracteriz\xf3 por la extensi\xf3n de un conjunto de tecnolog\xedas de gobierno que intervinieron en la vida de los ciudadanos a trav\xe9s de la educaci\xf3n, el trabajo y las pol\xedticas sociales.",B.e,"Verdadero","El Estado asumi\xf3 un rol central en la gesti\xf3n de la cuesti\xf3n social, extendiendo su intervenci\xf3n a trav\xe9s de diversas pol\xedticas.")
B.a2k=new A.c("Parcial 2","La 'estad\xedstica' fue una herramienta importante para el Estado moderno, al permitirle conocer, clasificar y regular las poblaciones, al mismo tiempo que visibiliz\xf3 las 'desviaciones' para su intervenci\xf3n.",B.e,"Verdadero","La estad\xedstica es una herramienta fundamental en la racionalidad biopol\xedtica, permitiendo al Estado gobernar a la poblaci\xf3n a trav\xe9s del conocimiento de sus regularidades.")
B.aaR=new A.c("Parcial 2","La higiene tuvo un papel importante en la eugenesia al promover los h\xe1bitos saludables en la poblaci\xf3n, como el ejercicio f\xedsico, la buena alimentaci\xf3n y la asistencia a los m\xe9dicos.",B.e,"Verdadero","La higiene se articul\xf3 con la eugenesia para 'prevenir y combatir las degeneraciones', lo que inclu\xeda la promoci\xf3n de h\xe1bitos saludables.")
B.a7m=new A.c("Parcial 2","Los trabajos sobre el 'normotipo' del ni\xf1o y adolescente uruguayo fueron el resultado de un programa de investigaci\xf3n impulsado por el psic\xf3logo espa\xf1ol Mira y L\xf3pez y tuvo como resultado el primer libro de psicopatolog\xeda en Uruguay.",B.e,"Falso","Si bien Mira y L\xf3pez fue clave en el estudio del normotipo, este proyecto no result\xf3 en el 'primer libro de psicopatolog\xeda', sino en la descripci\xf3n de patrones de normalidad.")
B.a0I=new A.c("Parcial 2","El plan de estudio de la Licenciatura de 1989 se caracteriz\xf3 por una fuerte impronta acad\xe9mica en la formaci\xf3n del psic\xf3logo, lo que permiti\xf3 que en pocos a\xf1os la investigaci\xf3n en psicolog\xeda lograra un gran desarrollo en el pa\xeds.",B.e,"Falso","El 'incipiente despertar de la academia' se da en la pos-dictadura, y la investigaci\xf3n en psicolog\xeda es un proceso gradual, no un 'gran desarrollo en pocos a\xf1os'.")
B.a8y=new A.c("Parcial 2","Las 'conferencias para maestros' de Vaz Ferreira en el primer cuarto del siglo XX, tuvieron un papel importante en la producci\xf3n de conocimientos en psicolog\xeda en el pa\xeds y lograron un di\xe1logo con la academia de su \xe9poca.",B.e,"Verdadero","Las conferencias de Vaz Ferreira fueron un 'verdadero laboratorio experimental y de investigaci\xf3n psicol\xf3gica' y un espacio de 'difusi\xf3n de la nueva ciencia'.")
B.ab9=new A.c("Parcial 2","La eugenesia en Uruguay tuvo un rol limitado a los estudios acad\xe9micos, sin aplicaci\xf3n en las pol\xedticas de salud p\xfablica y educativas.",B.e,"Falso","La eugenesia se articul\xf3 con la higiene y tuvo un rol activo en las 'pol\xedticas de cuidado y conducci\xf3n' de la poblaci\xf3n, teniendo aplicaci\xf3n pr\xe1ctica.")
B.a0N=new A.c("Parcial 2","La Psicolog\xeda Universitaria, entre los a\xf1os 1950 y 1973, se caracteriz\xf3 por un fuerte v\xednculo con el Estado.",B.e,"Verdadero","Los a\xf1os anteriores a la formaci\xf3n del profesional de la psicolog\xeda 'estuvieron codificados por la acci\xf3n del Estado'.")
B.a9h=new A.c("Parcial 2","La reglamentaci\xf3n de la profesi\xf3n del psic\xf3logo en el Uruguay fue un proceso arm\xf3nico entre el Estado y los profesionales de la psicolog\xeda.",B.e,"Falso","Existieron 'controversias' y fue un proceso complejo, no arm\xf3nico.")
B.a3P=new A.c("Parcial 2","El Instituto de Psicolog\xeda del Uruguay (IPUR) fue un espacio de formaci\xf3n de profesionales que se consolid\xf3 en la d\xe9cada del 80 del siglo XX, siendo el antecedente directo de la Facultad de Psicolog\xeda.",B.e,"Verdadero","La creaci\xf3n de la Facultad de Psicolog\xeda es parte de un proceso que se gest\xf3 desde experiencias previas como el IPUR.")
B.a7b=new A.c("Parcial 2","El periodo de intervenci\xf3n a la UdelaR no hubo formaci\xf3n en Psicolog\xeda.",B.e,"Falso","El documento 7 aborda 'La Escuela Universitaria de Psicolog\xeda' durante la intervenci\xf3n, lo que implica que s\xed hubo formaci\xf3n.")
B.a5_=new A.c("Parcial 2","Antes del golpe de Estado y la intervenci\xf3n a la Universidad la formaci\xf3n de Psicolog\xeda se realizaba en el \xe1mbito de Facultad de Medicina y Hospital Cl\xednicas en el llamado curso de Psicolog\xeda Infantil y tambi\xe9n en la Facultad de Humanidades y Ciencias, en Licenciatura de Psicolog\xeda.",B.e,"Verdadero","La formaci\xf3n en Psicolog\xeda ten\xeda antecedentes en el Instituto de Psicolog\xeda de Humanidades y en la Cl\xednica M\xe9dico Psicol\xf3gica en Medicina.")
B.a_I=new A.c("Parcial 2","En la intervenci\xf3n de la UdelaR desapareci\xf3 el cogobierno y la autonom\xeda universitaria.",B.e,"Verdadero","Una universidad 'intervenida' bajo una dictadura es incompatible con el cogobierno y la autonom\xeda.")
B.Xz=new A.c("Parcial 2","El terrorismo de Estado y la dictadura en Uruguay entre 1973 y 1984 significo la desaparici\xf3n, el encarcelamiento, la tortura y el exilio de cientos de miles de uruguayas y uruguayos.",B.e,"Verdadero","Esta es una descripci\xf3n general y conocida de las consecuencias de la dictadura c\xedvico-militar en Uruguay.")
B.a_m=new A.c("Parcial 2","El terrorismo de Estado en Uruguay y en el cono sur en la d\xe9cada del 70 del siglo pasado significo el ingreso al CMI de esta regi\xf3n del mundo.",B.e,"Falso","El 'CMI' (Capitalismo Mundial Integrado) es un concepto de Guattari que se refiere a transformaciones m\xe1s amplias del capitalismo. No es un sin\xf3nimo del terrorismo de Estado.")
B.abc=new A.c("Parcial 2","Para L. Scarlatta en 'la psicolog\xeda universitaria', la d\xe9cada del 60 del siglo XX se caracteriz\xf3 por el desarrollo de la investigaci\xf3n en psicolog\xeda, con similar nivel al de la extensi\xf3n.",B.e,"Verdadero","El trabajo de L. Scarlatta aborda la psicolog\xeda universitaria entre 1950 y 1973, incluyendo el desarrollo de investigaci\xf3n y extensi\xf3n.")
B.a1s=new A.c("Parcial 2","Seg\xfan afirma L. Scarlatta en el texto 'la psicolog\xeda universitaria' en los a\xf1os 30 a 50 del siglo XX, la Universidad de la Republica no acompa\xf1\xf3 el proceso de desarrollo de la psicopedagog\xeda y de la psicometr\xeda ocurrido en \xe1mbitos de la ense\xf1anza primaria e institutos normales, gener\xe1ndose as\xed dos campos de competencia institucional que permanecieron b\xe1sicamente incomunicados.",B.e,"Verdadero","Hubo un desarrollo de la psicopedagog\xeda y psicometr\xeda fuera del \xe1mbito estrictamente universitario en los primeros tiempos, lo que gener\xf3 un desarrollo paralelo.")
