B.a6Q=new A.c("4","\xbfQu\xe9 se entiende por 'biologizaci\xf3n' de los problemas mentales?",B.IX,"B","La biologizaci\xf3n es una cr\xedtica a la reducci\xf3n de la complejidad de los problemas mentales a explicaciones puramente biol\xf3gicas, lo que puede llevar a la sobremedicalizaci\xf3n y a la desatenci\xf3n de las dimensiones psicol\xf3gicas y sociales.")
