B.a5H=new A.c("4","La 'industria de la felicidad' es un concepto cr\xedtico que se refiere a:",B.RQ,"B","Critica c\xf3mo la b\xfasqueda de la felicidad se ha convertido en un negocio, promoviendo soluciones individuales y de consumo para problemas que pueden tener ra\xedces sociales o estructurales.")
B.Qu=A.a(s(["El desarrollo de nuevos f\xe1rmacos para tratar enfermedades mentales.","La tendencia a resolver problemas emocionales o conductuales mediante el uso de medicamentos, incluso cuando otras intervenciones podr\xedan ser m\xe1s apropiadas.","La investigaci\xf3n sobre los efectos de los f\xe1rmacos en el cerebro.",""]),t.s)
B.a5V=new A.c("4","\xbfQu\xe9 implica la 'psicofarmacologizaci\xf3n' de la sociedad?",B.Qu,"B","Se refiere a la creciente dependencia de los psicof\xe1rmacos como la principal o \xfanica soluci\xf3n para una amplia gama de problemas de la vida, lo que puede llevar a una medicalizaci\xf3n excesiva y a la desatenci\xf3n de las causas subyacentes.")
B.Rh=A.a(s(["A la falta de acuerdo en los m\xe9todos de investigaci\xf3n.","A la diversidad de tradiciones cient\xedficas, objetos, m\xe9todos, t\xe9cnicas y usos de la psicolog\xeda.","A la complejidad de la mente humana.",""]),t.s)
B.a1g=new A.c("5","\xbfA qu\xe9 refiere Vezzetti con la heterogeneidad del campo de la psicolog\xeda?",B.Rh,"B","Vezzetti destaca que la psicolog\xeda se caracteriza por una pluralidad de enfoques y pr\xe1cticas que se han configurado hist\xf3ricamente entre la filosof\xeda, la biolog\xeda y las ciencias sociales.")
B.Ms=A.a(s(["Psicoan\xe1lisis, Conductismo y Humanismo.","Psicof\xedsica y psicolog\xedas experimentales; evolucionismo y psicolog\xeda comparada; psicopatolog\xeda y cl\xednica.","Funcionalismo, Estructuralismo y Gestalt.",""]),t.s)
B.Zp=new A.c("5","\xbfCu\xe1les son las tres tradiciones que sirven para esquematizar la diversidad en los inicios de la psicolog\xeda hacia fines del siglo XIX?",B.Ms,"B","Vezzetti organiza los inicios de la psicolog\xeda en tres grandes tradiciones: la psicof\xedsica y experimental, el evolucionismo y la psicopatolog\xeda cl\xednica.")
B.P7=A.a(s(["Que es dif\xedcil de entender para el p\xfablico general.","Que su estudio hist\xf3rico debe considerar m\xfaltiples problemas, preguntas y abordajes debido a su pluralidad de impactos en el pensamiento y las pr\xe1cticas.","Que solo puede ser estudiada por expertos.",""]),t.s)
B.a37=new A.c("5","\xbfQu\xe9 significa que la psicolog\xeda se presenta como un objeto complejo y qu\xe9 consecuencias tiene en el estudio de su historia?",B.P7,"B","La complejidad de la psicolog\xeda como objeto de estudio implica que su historia no es lineal y que requiere un an\xe1lisis que contemple la diversidad de sus formaciones y sus impactos culturales y cient\xedficos.")
B.NM=A.a(s(["Porque cada autor tiene su propia interpretaci\xf3n.","Porque no hay una \xfanica historia de la psicolog\xeda, sino diversas psicolog\xedas y pluralidad de historias que se ajustan a diferentes problemas y fuentes.","Porque la historia de la psicolog\xeda es muy larga.",""]),t.s)
B.a0F=new A.c("5","\xbfPor qu\xe9 puede hablarse de pluralidad de historias en psicolog\xeda?",B.NM,"B","La pluralidad de historias se debe a que la psicolog\xeda es un campo heterog\xe9neo con m\xfaltiples tradiciones, que se pueden abordar desde diferentes preguntas y recortes del pasado.")
B.Lb=A.a(s(["Solo los conceptos internos de la disciplina.","Que la psicolog\xeda recibe y transforma conceptos de otras disciplinas y contextos culturales, ampliando el horizonte epist\xe9mico.","Solo el orden cronol\xf3gico de los conceptos.",""]),t.s)
B.a4K=new A.c("5","\xbfQu\xe9 debemos tener en cuenta en una investigaci\xf3n hist\xf3rica de los conceptos en psicolog\xeda?",B.Lb,"B","Es fundamental considerar que los conceptos psicol\xf3gicos no surgen de forma aislada, sino que son influenciados y transformados por saberes y contextos culturales m\xe1s amplios.")
B.Rw=A.a(s(["Ninguna, son campos separados.","Permite comprender c\xf3mo el pasado act\xfaa sobre el presente, revelando la perduraci\xf3n de ciertas formaciones y lazos entre la disciplina y su contexto.","Solo para entender las modas pasajeras.",""]),t.s)
B.a3O=new A.c("5","\xbfQu\xe9 importancia tiene vincular el estudio de la historia de la psicolog\xeda con la historia social y cultural?",B.Rw,"B","La vinculaci\xf3n con la historia social y cultural es crucial para entender c\xf3mo la psicolog\xeda se ha configurado como disciplina y c\xf3mo sus conceptos y pr\xe1cticas est\xe1n arraigados en contextos espec\xedficos.")
B.Nd=A.a(s(["A la biograf\xeda de psic\xf3logos famosos.","A los modelos de profesionalizaci\xf3n de la psicolog\xeda en diferentes \xe1mbitos (universidad, salud, educaci\xf3n, etc.) y las condiciones de su edificaci\xf3n como dispositivo profesional.","A la historia de las asociaciones de psic\xf3logos.",""]),t.s)
B.a09=new A.c("5","\xbfA qu\xe9 refiere Vezzetti con historia de la profesi\xf3n?",B.Nd,"B","La historia de la profesi\xf3n se enfoca en c\xf3mo la psicolog\xeda se ha establecido como una pr\xe1ctica profesional en diversos campos, considerando las condiciones hist\xf3ricas y los modelos de profesionalizaci\xf3n.")
B.Rf=A.a(s(["Un registro cronol\xf3gico de ideas.","Un enfoque inclusivo que explora procesos y acontecimientos m\xfaltiples y heterog\xe9neos, evitando la reducci\xf3n a l\xf3gicas cient\xedficas o descripciones de usos sociales, y oponi\xe9ndose a la memoria hegem\xf3nica que busca certezas.","Un estudio de la vida de los grandes pensadores.",""]),t.s)
B.a6k=new A.c("5","\xbfQu\xe9 es la historia intelectual? \xbfC\xf3mo la caracteriza el autor? \xbfEn qu\xe9 se opone al modelo de la memoria?",B.Rf,"B","La historia intelectual, seg\xfan Vezzetti, es un dominio plural que busca problemas y no certezas, explorando las construcciones socioculturales y conceptuales, y desafiando las memorias establecidas.")
B.NU=A.a(s(["La invenci\xf3n de herramientas.","La diferencia entre las cosas vivientes y las no vivientes.","La construcci\xf3n de edificios.",""]),t.s)
B.a_P=new A.c("5","Seg\xfan Leahey, \xbfcu\xe1l es uno de los objetivos de la antigua curiosidad humana en relaci\xf3n con la psicolog\xeda?",B.NU,"B","La curiosidad humana temprana buscaba entender la distinci\xf3n entre lo animado y lo inanimado, lo que sent\xf3 las bases para la comprensi\xf3n del 'esp\xedritu de la vida' o 'psuche'.")
B.N7=A.a(s(["La mente o personalidad completa.","El aliento de vida, que puede dejar el cuerpo durante el sue\xf1o o desmayo y sobrevivir a la muerte corporal, pero no es un elemento activo en la conducta consciente.","El alma inmortal y racional.",""]),t.s)
B.a_7=new A.c("5","\xbfQu\xe9 significa 'psuche' en los poemas hom\xe9ricos?",B.N7,"B","En la concepci\xf3n hom\xe9rica, la 'psuche' es el aliento vital, distinto de la mente o el alma individual en su totalidad, y no se considera la causa del comportamiento consciente.")
B.Ou=A.a(s(["A la mente consciente.","A diferentes entidades parecidas al alma que operan de forma independiente y residen en diferentes partes del cuerpo.","A la voluntad de los dioses.",""]),t.s)
B.a_o=new A.c("5","\xbfC\xf3mo se atribu\xeda el comportamiento en la antigua psicolog\xeda popular de la Edad de Bronce (Homero)?",B.Ou,"B","El comportamiento se explicaba por la acci\xf3n de 'almas' corporales localizadas en distintas partes del cuerpo, las cuales no sobreviv\xedan a la muerte.")
B.Lk=A.a(s(["Vivir honorablemente seg\xfan el c\xf3digo de los guerreros y lograr la inmortalidad demostrando las capacidades en la batalla.","Buscar el conocimiento y la sabidur\xeda.","Ayudar a los dem\xe1s y ser compasivo.",""]),t.s)
B.a_0=new A.c("5","\xbfCu\xe1l era la concepci\xf3n heroica de la virtud (la buena vida) en la Edad de Bronce, seg\xfan Leahey?",B.Lk,"A","La virtud en la Edad de Bronce estaba ligada al honor en la batalla y la inmortalidad a trav\xe9s de las haza\xf1as heroicas, siendo accesible solo para unos pocos afortunados.")
B.KV=A.a(s(["Posee la verdad m\xe1s all\xe1 de toda cr\xedtica.","Las ideas son consideradas en s\xed mismas, independientemente de la personalidad, car\xe1cter, origen \xe9tnico o fe de la persona que las propone, y se progresa mediante la cr\xedtica y correcci\xf3n de errores.","Es un dogma inmutable.",""]),t.s)
B.a4h=new A.c("5","\xbfQu\xe9 caracter\xedstica distingue a un 'sistema abierto de pensamiento' seg\xfan Leahey?",B.KV,"B","En un sistema abierto, la cr\xedtica es fundamental para el progreso de las ideas, y estas son evaluadas por su propio valor, no por la autoridad de quien las propone.")
B.LU=A.a(s(["Que el universo est\xe1 compuesto por muchos elementos diferentes.","Que solo existe un elemento, el agua, que adopta m\xfaltiples formas y es el elemento esencial del que surgen todas las cosas.","Que la realidad es incognoscible.",""]),t.s)
B.XA=new A.c("5","\xbfQu\xe9 propuso Tales de Mileto sobre la naturaleza fundamental de la realidad?",B.LU,"B","Tales fue el primero en proponer una explicaci\xf3n naturalista del universo, identificando el agua como el principio fundamental de todas las cosas.")
B.QM=A.a(s(["La creencia en poderes sobrenaturales.","La explicaci\xf3n de objetos y acontecimientos sin hacer referencia a poderes o entidades sobrenaturales de ning\xfan tipo, lo que en psicolog\xeda implica un cambio en las concepciones dualistas.","El estudio de la naturaleza en su estado puro.",""]),t.s)
B.a7I=new A.c("5","\xbfQu\xe9 es el 'naturalismo' en la ciencia, seg\xfan Leahey?",B.QM,"B","El naturalismo busca explicaciones dentro del \xe1mbito de los fen\xf3menos naturales, sin recurrir a lo sobrenatural, lo que en psicolog\xeda desaf\xeda las visiones dualistas de la mente y el cuerpo.")
B.P1=A.a(s(["Que son inseparables.","Que el alma pod\xeda existir sin el cuerpo y que el cuerpo era una prisi\xf3n corrupta en la que estaba prisionera el alma.","Que solo existe el cuerpo.",""]),t.s)
B.a3h=new A.c("5","\xbfQu\xe9 sostuvo Pit\xe1goras sobre el alma y el cuerpo?",B.P1,"B","Los pitag\xf3ricos establecieron una distinci\xf3n n\xedtida entre el alma y el cuerpo, afirmando la preexistencia y la posibilidad de existencia del alma sin el cuerpo.")
B.T_=A.a(s(["Que la realidad es cambio constante.","Que la realidad que subyace al universo es una sustancia permanente, un Ser puro e inmutable, y que el cambio es una ilusi\xf3n.","Que la verdad es relativa.",""]),t.s)
B.YH=new A.c("5","\xbfQu\xe9 postula Parm\xe9nides en su filosof\xeda del Ser?",B.T_,"B","Parm\xe9nides defendi\xf3 la existencia de un Ser \xfanico, inmutable y eterno como la verdadera realidad, considerando el cambio como una mera apariencia.")
B.Jj=A.a(s(["Que la physis era el agua y el mundo era est\xe1tico.","Que la physis era el fuego y que lo \xfanico constante en el universo era el cambio, siempre deviniendo en algo diferente.","Que el cambio es una ilusi\xf3n.",""]),t.s)
B.a69=new A.c("5","\xbfQu\xe9 afirm\xf3 Her\xe1clito sobre la physis y el cambio?",B.Jj,"B","Her\xe1clito, conocido por su aforismo 'nadie puede entrar dos veces en el mismo r\xedo', sostuvo que el cambio es la esencia de la realidad y que todo est\xe1 en constante flujo.")
B.L1=A.a(s(["Descubrir la importancia del coraz\xf3n.","Considerar que la sensaci\xf3n y el pensamiento tienen lugar en el cerebro.","Desarrollar una teor\xeda de la percepci\xf3n.",""]),t.s)
B.ZR=new A.c("5","\xbfCu\xe1l fue la contribuci\xf3n de Alcme\xf3n a la psicolog\xeda temprana?",B.L1,"B","Alcme\xf3n fue uno de los primeros en ubicar las funciones mentales en el cerebro, un avance significativo para la \xe9poca.")
B.Sx=A.a(s(["Que los objetos emiten efluvios que penetran en el cuerpo a trav\xe9s de los canales de los sentidos, sentando las bases del empirismo.","Que la percepci\xf3n es puramente subjetiva.","Que la percepci\xf3n se basa en ideas innatas.",""]),t.s)
B.a7S=new A.c("5","\xbfQu\xe9 propuso Emp\xe9docles sobre la percepci\xf3n?",B.Sx,"A","Emp\xe9docles desarroll\xf3 una teor\xeda de la percepci\xf3n basada en la idea de que los objetos emiten 'efluvios' que interact\xfaan con los sentidos, lo que lo convierte en un precursor del empirismo.")
B.Rx=A.a(s(["Que la mente est\xe1 compuesta por \xe1tomos.","Que las ideas complejas pueden ser analizadas como un conjunto de ideas simples o sensaciones asociadas.","Que el alma es indivisible.",""]),t.s)
B.aaZ=new A.c("5","\xbfQu\xe9 sostiene el 'atomismo psicol\xf3gico'?",B.Rx,"B","El atomismo psicol\xf3gico postula que las ideas complejas se forman a partir de la asociaci\xf3n de ideas o sensaciones m\xe1s simples, siguiendo el modelo de la composici\xf3n at\xf3mica de la materia.")
B.Tm=A.a(s(["La b\xfasqueda del conocimiento.","Una doctrina \xe9tica que rechaza la existencia de Dios y del alma, y establece la b\xfasqueda del placer y la evitaci\xf3n del dolor como gu\xeda de vida.","La creencia en un alma inmortal.",""]),t.s)
B.abd=new A.c("5","\xbfQu\xe9 es el 'hedonismo' propuesto por Dem\xf3crito?",B.Tm,"B","El hedonismo de Dem\xf3crito se centra en la b\xfasqueda del placer y la evitaci\xf3n del dolor como los \xfanicos fines de la vida, en un universo sin Dios ni alma.")
B.J2=A.a(s(["Su inter\xe9s por el cosmos.","Su preocupaci\xf3n por la naturaleza humana y la forma de vida del hombre, marcando un giro hacia el humanismo y el relativismo cultural.","Su defensa de verdades absolutas.",""]),t.s)
B.Yu=new A.c("5","\xbfQu\xe9 caracteriz\xf3 a los sofistas en la antigua Grecia?",B.J2,"B","Los sofistas se centraron en el hombre como medida de todas las cosas, promoviendo un relativismo en la verdad y en las normas culturales.")
B.PK=A.a(s(["La may\xe9utica.","El Elenchus (dial\xe9ctica o demostraci\xf3n l\xf3gica para la indagaci\xf3n de ideas).","La introspecci\xf3n.",""]),t.s)
B.aal=new A.c("5","\xbfQu\xe9 m\xe9todo socr\xe1tico se considera el punto de partida de algunas psicoterapias como el psicoan\xe1lisis?",B.PK,"B","El Elenchus socr\xe1tico, al buscar la verdad a trav\xe9s de interrogantes y el descubrimiento del conocimiento oculto, se asocia con el proceso de exploraci\xf3n en psicoterapias.")
B.Jp=A.a(s(["El estudio del alma.","El estudio del conocimiento, de c\xf3mo es posible y c\xf3mo se puede justificar, dando lugar a la psicolog\xeda cognitiva.","El estudio de la conducta.",""]),t.s)
B.a0e=new A.c("5","\xbfQu\xe9 es la 'epistemolog\xeda' seg\xfan Plat\xf3n?",B.Jp,"B","Plat\xf3n fue el creador de la epistemolog\xeda, buscando la verdad y el conocimiento perfecto a trav\xe9s de la raz\xf3n y las Formas.")
B.SN=A.a(s(["El conocimiento de las cosas en s\xed mismas.","El conocimiento de las Formas de las cosas, que son eternas e inmutables, a diferencia de sus copias materiales.","El conocimiento emp\xedrico.",""]),t.s)
B.Zl=new A.c("5","\xbfQu\xe9 es el 'conocimiento genuino' para Plat\xf3n?",B.SN,"B","Para Plat\xf3n, el conocimiento verdadero se encuentra en el mundo de las Formas, que son la esencia perfecta de las cosas, y no en las apariencias del mundo sensible.")
B.QF=A.a(s(["La importancia de la luz solar.","Una met\xe1fora de la condici\xf3n humana, donde las almas est\xe1n prisioneras en cuerpos imperfectos y deben ascender al mundo de las Formas para alcanzar la verdadera realidad y liberarse de la ignorancia.","Un relato sobre la vida en la antig\xfcedad.",""]),t.s)
B.a4m=new A.c("5","\xbfQu\xe9 representa la 'Alegor\xeda de la Caverna' de Plat\xf3n?",B.QF,"B","La alegor\xeda simboliza el camino del conocimiento, desde la ignorancia de las apariencias hasta la iluminaci\xf3n de la verdadera realidad (las Formas).")
B.PF=A.a(s(["La creencia en la importancia del entorno.","La idea de que el car\xe1cter y el conocimiento son innatos, contenidos en el alma debido a la visi\xf3n previa de las Formas y las reencarnaciones, y que el aprendizaje es una recuperaci\xf3n de lo ya conocido.","La negaci\xf3n de la existencia del alma.",""]),t.s)
B.aaL=new A.c("5","\xbfQu\xe9 es el 'nativismo' en Plat\xf3n?",B.PF,"B","Plat\xf3n es considerado el primer gran exponente del nativismo, al postular que el conocimiento es inherente al alma y se 'recuerda' a trav\xe9s de la experiencia.")
B.NH=A.a(s(["El caballo indomable.","El conductor del carro, la forma superior del alma, inmortal, localizada en la cabeza, que gu\xeda hacia el bien y busca el conocimiento de las Formas.","El deseo irracional.",""]),t.s)
B.Y9=new A.c("5","\xbfQu\xe9 representa el 'Alma Racional' en la psicolog\xeda de Plat\xf3n (Met\xe1fora del Carro Alado)?",B.NH,"B","El Alma Racional es la parte m\xe1s elevada del alma, encargada de la raz\xf3n y la gu\xeda hacia la virtud, controlando las otras dos almas (irascible y apetitiva).")
B.Mt=A.a(s(["La dificultad de explicar el comportamiento de un individuo proponiendo la existencia de una peque\xf1a persona en su interior, ya que las acciones de este personaje interior permanecen sin explicar.","La idea de que el alma es muy peque\xf1a.","La imposibilidad de controlar las pasiones.",""]),t.s)
B.Yb=new A.c("5","\xbfQu\xe9 es el 'problema del hom\xfanculo' en psicolog\xeda, en relaci\xf3n con la met\xe1fora del carro alado?",B.Mt,"A","El problema del hom\xfanculo critica las explicaciones que postulan un 'peque\xf1o hombre' dentro de la cabeza para explicar la conducta, ya que esto solo traslada el problema sin resolverlo.")
B.KS=A.a(s(["Una entidad separada del cuerpo.","La forma de un cuerpo natural que posee la vida en potencia, siendo el conjunto de capacidades del cuerpo viviente y la causa esencial, eficiente y final del organismo.","Una ilusi\xf3n.",""]),t.s)
B.a9m=new A.c("5","\xbfQu\xe9 es el 'alma' para Arist\xf3teles?",B.KS,"B","Para Arist\xf3teles, el alma no es una entidad separada, sino la forma que da vida y prop\xf3sito al cuerpo, siendo inseparable de \xe9l.")
B.T1=A.a(s(["Alma buena, alma mala, alma neutra.","Alma nutritiva (plantas), alma sensitiva (animales), y alma racional (humanos).","Alma consciente, alma inconsciente, alma preconsciente.",""]),t.s)
B.a70=new A.c("5","\xbfCu\xe1les son los tres niveles del alma que distingui\xf3 Arist\xf3teles?",B.T1,"B","Arist\xf3teles clasific\xf3 las almas seg\xfan las capacidades de los seres vivos, desde la nutrici\xf3n en plantas hasta la raz\xf3n en humanos.")
B.Pz=A.a(s(["La capacidad de tener opiniones populares.","El lugar donde la informaci\xf3n de los sentidos espec\xedficos se coordina en una imagen unificada del mundo, integrando las sensaciones.","Un sentido externo.",""]),t.s)
B.a0_=new A.c("5","\xbfQu\xe9 es el 'sentido com\xfan' en la teor\xeda de la percepci\xf3n de Arist\xf3teles?",B.Pz,"B","El sentido com\xfan es la facultad que Arist\xf3teles ubicaba en el coraz\xf3n, encargada de integrar las diferentes sensaciones para formar una percepci\xf3n coherente del mundo.")
B.Ku=A.a(s(["Causa-efecto, espacio-tiempo, frecuencia.","Semejanza, contig\xfcidad y contraste.","Recuerdo, olvido, reconocimiento.",""]),t.s)
B.a2P=new A.c("5","\xbfCu\xe1les son las tres leyes de asociaci\xf3n que propuso Arist\xf3teles para la memoria?",B.Ku,"B","Arist\xf3teles fue uno de los primeros en formular leyes de asociaci\xf3n para explicar c\xf3mo se conectan las ideas en la memoria.")
B.Tn=A.a(s(["El intelecto que muere con el cuerpo.","Puro pensamiento que act\xfaa sobre los contenidos del intelecto paciente para alcanzar el conocimiento racional de los universales, siendo inmutable e inmortal y id\xe9ntico en todos los seres humanos.","La capacidad de sentir emociones.",""]),t.s)
B.a_O=new A.c("5","\xbfQu\xe9 es el 'intelecto agente' para Arist\xf3teles?",B.Tn,"B","El intelecto agente es la parte inmortal y universal del alma humana, encargada de actualizar el conocimiento de los universales.")
B.LE=A.a(s(["La riqueza material.","La ataraxia (libertad a partir de la inseguridad y autocontrol personal) en un mundo incierto, a trav\xe9s de la filosof\xeda como terapia del alma.","El poder pol\xedtico.",""]),t.s)
B.a43=new A.c("5","\xbfQu\xe9 buscaban las 'filosof\xedas terap\xe9uticas de la felicidad' en el mundo helen\xedstico y romano?",B.LE,"B","Estas filosof\xedas, como el epicure\xedsmo y el estoicismo, ofrec\xedan caminos para alcanzar la tranquilidad del alma y la felicidad individual frente a las adversidades del mundo.")
B.Qn=A.a(s(["Una filosof\xeda que buscaba el poder.","Una doctrina filos\xf3fica que sosten\xeda que el placer (ausencia de dolor y perturbaci\xf3n) es el bien supremo y la meta m\xe1s importante es la vida tranquila, a menudo a trav\xe9s de la retirada del mundo.","Una filosof\xeda que promov\xeda el conflicto.",""]),t.s)
B.a3c=new A.c("5","\xbfQu\xe9 era el 'Epicure\xedsmo'?",B.Qn,"B","El epicure\xedsmo se centraba en la b\xfasqueda de una vida tranquila y libre de perturbaciones, a menudo a trav\xe9s de la moderaci\xf3n y la amistad.")
B.Oz=A.a(s(["La acumulaci\xf3n de riquezas.","Vivir de la manera m\xe1s natural posible, rechazando todas las convenciones mundanas y despreciando cualquier opini\xf3n de la gente (todo era physis en vez de nomos), buscando la felicidad en una vida simple y acorde con la naturaleza.","El lujo y la comodidad.",""]),t.s)
B.a_t=new A.c("5","\xbfQu\xe9 defend\xeda el 'Cinismo' como estilo de vida?",B.Oz,"B","Los c\xednicos abogaban por una vida simple y natural, despoj\xe1ndose de las convenciones sociales y buscando la autonom\xeda individual.")
B.O_=A.a(s(["Que la verdad se puede alcanzar f\xe1cilmente.","Que la verdad no se puede alcanzar, por lo que todo lo que se puede lograr es un estado de apor\xeda reflexiva (suspensi\xf3n del juicio) para alcanzar la ataraxia (evitar la desdicha de estar equivocado).","Que la percepci\xf3n sensorial es infalible.",""]),t.s)
B.a1F=new A.c("5","\xbfQu\xe9 sosten\xedan los 'Esc\xe9pticos' de Pirr\xf3n de Elis?",B.O_,"B","El escepticismo pirr\xf3nico defend\xeda la suspensi\xf3n del juicio sobre la verdad para alcanzar la tranquilidad del alma, ya que la verdad es incognoscible.")
B.MF=A.a(s(["La b\xfasqueda de la fama y la gloria.","Dos aspectos interconectados: el determinismo absoluto (todo est\xe1 predestinado) y la exclusi\xf3n completa de las emociones (consideradas opiniones equivocadas que causan infelicidad).","La libertad total de elecci\xf3n.",""]),t.s)
B.a1m=new A.c("5","\xbfQu\xe9 defendi\xf3 el 'Estoicismo' como terapia del alma?",B.MF,"B","Los estoicos cre\xedan en el destino y en el control de las emociones para alcanzar la tranquilidad, aceptando racionalmente el orden del universo.")
B.O3=A.a(s(["Negando la existencia de Dios.","Describiendo el universo como una jerarqu\xeda que comenzaba con un Dios supremo y emanaba criaturas divinas hasta el ser humano, influyendo en la teolog\xeda cristiana y preparando el terreno para su aceptaci\xf3n.","Promoviendo el materialismo.",""]),t.s)
B.a5x=new A.c("5","\xbfC\xf3mo influy\xf3 el 'Neoplatonismo' en el pensamiento cristiano?",B.O3,"B","El neoplatonismo, con su visi\xf3n jer\xe1rquica del universo y la importancia del mundo espiritual, fue fundamental para la formaci\xf3n de la teolog\xeda cristiana.")
B.Rq=A.a(s(["Religiones p\xfablicas y abiertas a todos.","Cultos con ritos especiales que se manten\xedan en secreto y solo se revelaban a los iniciados, buscando la ataraxia y a veces experiencias ext\xe1ticas.","Religiones monote\xedstas.",""]),t.s)
B.a71=new A.c("5","\xbfQu\xe9 eran las 'religiones mist\xe9ricas' en el mundo antiguo?",B.Rq,"B","Las religiones mist\xe9ricas ofrec\xedan una experiencia religiosa m\xe1s personal e \xedntima a trav\xe9s de ritos secretos y la promesa de una vida mejor.")
B.Pd=A.a(s(["La idea de que el conocimiento se adquiere solo por experiencia.","La cuesti\xf3n de hasta qu\xe9 punto nacemos equipados con el conocimiento y las capacidades necesarias, o si las aprendemos, sugiriendo que si no se adquiere por aprendizaje, debe ser innato.","La creencia en la reencarnaci\xf3n.",""]),t.s)
B.a8C=new A.c("5","\xbfQu\xe9 es el 'innatismo' en Santamar\xeda?",B.Pd,"B","El innatismo plantea que parte de nuestro conocimiento y capacidades son inherentes desde el nacimiento, no adquiridas a trav\xe9s de la experiencia.")
B.Lx=A.a(s(["Que el mundo real es la base del conocimiento.","Que el mundo real no es la base del conocimiento, sino un mero reflejo de este, y que nuestro conocimiento incluye universales que no se encuentran en la experiencia.","Que el conocimiento se basa en la observaci\xf3n directa.",""]),t.s)
B.a94=new A.c("5","\xbfCu\xe1l es la esencia del 'racionalismo' en Plat\xf3n, seg\xfan Santamar\xeda?",B.Lx,"B","El racionalismo plat\xf3nico postula que el verdadero conocimiento proviene de ideas innatas y universales, no de la experiencia sensorial, que es imperfecta.")
B.OE=A.a(s(["Aceptando la existencia de un mundo de ideas separadas.","Considerando que la idea \xfanica de animal es imposible y que los universales aristot\xe9licos no tienen propiedades ontol\xf3gicas, bas\xe1ndose en nombres comunes y adjetivos cuyo fundamento est\xe1 en el mundo real.","Negando la existencia de universales.",""]),t.s)
B.aaN=new A.c("5","\xbfC\xf3mo critic\xf3 Arist\xf3teles la doctrina plat\xf3nica de las ideas?",B.OE,"B","Arist\xf3teles rechaz\xf3 la separaci\xf3n de las ideas de Plat\xf3n, argumentando que los universales existen en las cosas mismas como abstracciones de la experiencia.")
B.Ld=A.a(s(["La invenci\xf3n del telescopio.","La creaci\xf3n de un m\xe9todo para distinguir a la ciencia de otros acercamientos al conocimiento de la realidad, basado en la duda radical para llegar a verdades autoevidentes ('pienso, luego existo').","El descubrimiento de la circulaci\xf3n de la sangre.",""]),t.s)
B.a8z=new A.c("5","\xbfCu\xe1l fue el aporte de Descartes a la ciencia moderna?",B.Ld,"B","Descartes es considerado el fundador de la filosof\xeda moderna por su \xe9nfasis en la raz\xf3n y la duda met\xf3dica como camino hacia el conocimiento cient\xedfico.")
B.Nv=A.a(s(["Que nac\xeda con ideas innatas.","Que era una 'tabula rasa' (pizarra en blanco) sobre la cual se imprimir\xeda el conocimiento una vez que fuese adquirido por medio de la experiencia sensible (sensaci\xf3n y reflexi\xf3n).","Que era un alma racional perfecta.",""]),t.s)
B.a3D=new A.c("5","\xbfQu\xe9 propuso John Locke sobre la mente de un reci\xe9n nacido?",B.Nv,"B","Locke, como empirista, defendi\xf3 que la mente al nacer es una 'tabula rasa' y que todo conocimiento se adquiere a trav\xe9s de la experiencia.")
B.L9=A.a(s(["Ambas son innatas.","Las impresiones son los datos de la experiencia (sentir calor, ver el color azul), y las ideas son im\xe1genes borrosas de las impresiones.","Las ideas son m\xe1s claras que las impresiones.",""]),t.s)
B.a3U=new A.c("5","\xbfQu\xe9 son las 'impresiones' y las 'ideas' para David Hume?",B.L9,"B","Hume distingui\xf3 entre impresiones (experiencias vivas) e ideas (copias m\xe1s d\xe9biles de las impresiones), siendo todas derivadas de la experiencia.")
B.RB=A.a(s(["Que no es universal.","Que dos fen\xf3menos que hayan sucedido siempre juntos no indica que tenga que surgir siendo as\xed en el futuro, y que la experiencia no siempre proporciona una pista para detectar tal relaci\xf3n causal.","Que es demasiado simple.",""]),t.s)
B.a0H=new A.c("5","\xbfCu\xe1l es la principal cr\xedtica de Santamar\xeda a la ley de 'causa-efecto' de Hume?",B.RB,"B","Santamar\xeda se\xf1ala la limitaci\xf3n de la inducci\xf3n para garantizar la causalidad futura, incluso si los eventos se han correlacionado en el pasado.")
B.Qw=A.a(s(["Los juicios a priori necesitan experiencia y los a posteriori no.","Los juicios a priori se comprueban sin necesidad de la experiencia y los a posteriori la necesitan para su demostraci\xf3n, y los juicios sint\xe9ticos a priori aportan conocimiento sin recurrir a la experiencia.","Todos los juicios son a priori.",""]),t.s)
B.a22=new A.c("5","\xbfQu\xe9 distingue Kant en sus juicios 'a priori' y 'a posteriori'?",B.Qw,"B","Kant introdujo la noci\xf3n de juicios sint\xe9ticos a priori para explicar c\xf3mo es posible el conocimiento universal y necesario sin depender completamente de la experiencia.")
B.No=A.a(s(["Que la mente y el cuerpo interact\xfaan directamente.","Que la mente y el cuerpo no tienen causalidad alguna, y Dios ser\xeda la \xfanica causa que interviene en todas las acciones humanas y de la naturaleza.","Que solo existe la mente.",""]),t.s)
B.Zm=new A.c("5","\xbfQu\xe9 es el 'ocasionalismo' como respuesta al dualismo cartesiano?",B.No,"B","El ocasionalismo postula que Dios es la causa directa de la correspondencia entre los eventos mentales y f\xedsicos, ya que no hay interacci\xf3n causal entre ellos.")
B.LF=A.a(s(["Que la mente y el cuerpo son dos sustancias distintas.","Que lo mental y lo f\xedsico son simplemente aspectos de la misma sustancia (Dios), negando su existencia como entidades separadas.","Que solo existe el cuerpo.",""]),t.s)
B.ZQ=new A.c("5","\xbfQu\xe9 propone Baruch Spinoza con su 'teor\xeda del doble aspecto'?",B.LF,"B","La teor\xeda del doble aspecto de Spinoza concibe la mente y el cuerpo como atributos diferentes de una misma sustancia subyacente (Dios o la Naturaleza).")
B.OA=A.a(s(["La defensa de que solo existe la materia.","La defensa de que solo existe la mente, y que la materia no puede existir en ausencia de la percepci\xf3n o actividad mental.","La creencia en el dualismo.",""]),t.s)
B.a7f=new A.c("5","\xbfQu\xe9 es el 'inmaterialismo' de George Berkeley?",B.OA,"B","Berkeley sostuvo que 'ser es ser percibido', lo que implica que la existencia de los objetos materiales depende de que sean percibidos por una mente.")
B.N2=A.a(s(["La b\xfasqueda de conocimiento por la gloria de Dios.","La modificaci\xf3n de los objetivos de la ciencia hacia un tipo de conocimiento que permitiera dominar y controlar la naturaleza, en lugar de solo comprenderla.","El retorno a la filosof\xeda antigua.",""]),t.s)
B.Zo=new A.c("5","\xbfQu\xe9 fue el 'esp\xedritu baconiano' en la investigaci\xf3n cient\xedfica?",B.N2,"B","Bacon promovi\xf3 una ciencia orientada a la utilidad y el control de la naturaleza a trav\xe9s de la experimentaci\xf3n.")
B.Oe=A.a(s(["Una nueva forma de medir \xe1ngulos.","Una nueva rama de las matem\xe1ticas que establece una correlaci\xf3n entre el \xe1lgebra y la geometr\xeda, aplicando relaciones num\xe9ricas a figuras geom\xe9tricas.","Un m\xe9todo para resolver ecuaciones.",""]),t.s)
B.a4t=new A.c("5","\xbfQu\xe9 es la 'geometr\xeda anal\xedtica' descubierta por Descartes?",B.Oe,"B","La geometr\xeda anal\xedtica de Descartes permiti\xf3 unir la geometr\xeda y el \xe1lgebra, sentando las bases para el desarrollo de las matem\xe1ticas modernas.")
B.MO=A.a(s(["Un tipo de pizarra para escribir.","Una met\xe1fora que compara la mente de un reci\xe9n nacido con una pizarra en blanco sobre la cual se imprimir\xeda el conocimiento una vez que fuese adquirido por medio de la experiencia sensible.","Una teor\xeda sobre la memoria.",""]),t.s)
B.a93=new A.c("5","\xbfQu\xe9 es la 'tabula rasa' de John Locke?",B.MO,"B","La 'tabula rasa' es un concepto central del empirismo de Locke, que postula que la mente no tiene ideas innatas y todo conocimiento se forma a partir de la experiencia.")
B.Na=A.a(s(["Una teor\xeda sobre la electricidad est\xe1tica.","Una teor\xeda que culmin\xf3 en el descubrimiento de que la luz era un campo electromagn\xe9tico que alternaba a gran velocidad y viajaba en el espacio en forma de ondas, destronando la mec\xe1nica newtoniana como teor\xeda de mayor validez.","Una rama de la mec\xe1nica.",""]),t.s)
B.a8P=new A.c("5","\xbfQu\xe9 es la 'electrodin\xe1mica' y qu\xe9 culmin\xf3 su desarrollo?",B.Na,"B","La electrodin\xe1mica, desarrollada por Faraday y Maxwell, revolucion\xf3 la f\xedsica al demostrar la naturaleza electromagn\xe9tica de la luz y la existencia de campos de fuerza.")
B.PC=A.a(s(["Conceptos relacionados con el orden y el desorden en los sistemas, mostrando que el universo tiende al desorden y que el modelo mecanicista newtoniano era demasiado simple para aplicarse a la evoluci\xf3n de la vida.","Leyes que explican el movimiento de los planetas.","Teor\xedas sobre la creaci\xf3n del universo.",""]),t.s)
B.Ye=new A.c("5","\xbfQu\xe9 es la 'entrop\xeda' y la 'segunda ley de la termodin\xe1mica' en el contexto de la evoluci\xf3n?",B.PC,"A","La entrop\xeda y la segunda ley de la termodin\xe1mica introdujeron la idea de irreversibilidad y aumento del desorden en los sistemas, desafiando la visi\xf3n mecanicista y est\xe1tica del universo.")
B.S2=A.a(s(["Un tipo de experimento psicol\xf3gico.","Los h\xe1bitos de pensamiento que se presentan en una cultura de cualquier regi\xf3n y per\xedodo, que pueden limitar o favorecer la aceptaci\xf3n de nuevas ideas cient\xedficas.","Un concepto de tiempo.",""]),t.s)
B.a4E=new A.c("5","\xbfQu\xe9 es el 'Zeitgest' en la historia de la psicolog\xeda seg\xfan Boring?",B.S2,"B","El Zeitgest (esp\xedritu de la \xe9poca) se refiere al clima intelectual y cultural que influye en el desarrollo y la aceptaci\xf3n de las teor\xedas cient\xedficas.")
B.OZ=A.a(s(["La personalista se enfoca en el contexto cultural y la naturalista en los individuos.","La personalista atribuye el progreso cient\xedfico a la inspiraci\xf3n y el coraje de individuos geniales (ej. Cop\xe9rnico), mientras que la naturalista afirma que el cambio es inevitable y el individuo es un agente o s\xedntoma de un cambio cultural inexorable.","Ambas son id\xe9nticas.",""]),t.s)
B.a9e=new A.c("5","\xbfCu\xe1l es la diferencia entre la teor\xeda 'personalista' y la 'naturalista' en la historia de la ciencia (Boring)?",B.OZ,"B","La teor\xeda personalista enfatiza el papel de los individuos excepcionales, mientras que la naturalista subraya la influencia de las condiciones socioculturales en el avance cient\xedfico.")
B.Re=A.a(s(["Descubrimiento de Am\xe9rica, invenci\xf3n de la imprenta, ca\xedda de Constantinopla, uso de la p\xf3lvora, teor\xeda de Cop\xe9rnico.","Guerras, enfermedades, hambrunas, migraciones, cambios clim\xe1ticos.","Invenci\xf3n del telescopio, microscopio, br\xfajula, reloj, imprenta.",""]),t.s)
B.a_D=new A.c("5","\xbfCu\xe1les fueron las 5 causas que hicieron posible la 'nueva erudici\xf3n' (Renacimiento) seg\xfan Boring?",B.Re,"A","Estos eventos clave marcaron el fin de la Edad Media y el inicio de la Modernidad, impulsando el desarrollo cient\xedfico y cultural.")
B.J4=A.a(s(["La competencia entre cient\xedficos.","La comunicaci\xf3n y el intercambio de informaci\xf3n entre cient\xedficos a trav\xe9s de correspondencia y sociedades cient\xedficas, en contraste con el autoritarismo medieval.","El aislamiento de los investigadores.",""]),t.s)
B.a82=new A.c("5","\xbfQu\xe9 caracteriz\xf3 el 'car\xe1cter cooperativo' de la ciencia moderna en sus comienzos?",B.J4,"B","La cooperaci\xf3n y la comunicaci\xf3n fueron fundamentales para el avance de la ciencia moderna, permitiendo la difusi\xf3n de ideas y la colaboraci\xf3n entre investigadores.")
B.LK=A.a(s(["El estudio de los fen\xf3menos paranormales.","La descripci\xf3n de las experiencias inmediatas con los m\xednimos prejuicios cient\xedficos posibles, adoptada por la escuela de la Gestalt, y considerada una disciplina proped\xe9utica para la ciencia.","El an\xe1lisis de los sue\xf1os.",""]),t.s)
B.aaY=new A.c("5","\xbfQu\xe9 es la 'fenomenolog\xeda' en la psicolog\xeda, seg\xfan Boring?",B.LK,"B","La fenomenolog\xeda busca describir la experiencia tal como se presenta, sin interpretaciones previas, lo que fue importante para la Gestalt en su estudio de la percepci\xf3n.")
B.KE=A.a(s(["El movimiento de objetos reales.","El fen\xf3meno en el que dos luces que se encienden y apagan alternativamente se perciben como una sola luz en movimiento, lo que llev\xf3 a descartar explicaciones basadas en movimientos oculares o inferencias l\xf3gicas inconscientes.","El movimiento de las estrellas.",""]),t.s)
B.a1B=new A.c("5","\xbfQu\xe9 es el 'movimiento aparente' estudiado por Max Wertheimer (fundador de la Gestalt)?",B.KE,"B","El movimiento aparente, o fen\xf3meno phi, demostr\xf3 que la percepci\xf3n no es una suma de sensaciones, sino una organizaci\xf3n activa del campo visual.")
B.RI=A.a(s(["La observaci\xf3n de la conducta externa.","Un m\xe9todo de autoobservaci\xf3n de los propios estados mentales y experiencias conscientes, utilizado por las primeras escuelas de psicolog\xeda como el estructuralismo.","La experimentaci\xf3n con animales.",""]),t.s)
B.a96=new A.c("5","\xbfQu\xe9 es la 'introspecci\xf3n' en psicolog\xeda?",B.RI,"B","La introspecci\xf3n fue un m\xe9todo clave en los inicios de la psicolog\xeda experimental para estudiar la conciencia, aunque luego fue criticada por su subjetividad.")
B.Rg=A.a(s(["Una escuela que se enfoca en la funci\xf3n de la mente.","Una escuela de pensamiento que buscaba analizar la mente en sus componentes m\xe1s b\xe1sicos (sensaciones, sentimientos, im\xe1genes) a trav\xe9s de la introspecci\xf3n, para descubrir la estructura de la conciencia.","Una teor\xeda sobre la estructura del cerebro.",""]),t.s)
B.a4Y=new A.c("5","\xbfQu\xe9 es el 'estructuralismo' en psicolog\xeda?",B.Rg,"B","El estructuralismo, con Wundt y Titchener, se centr\xf3 en descomponer la conciencia en sus elementos m\xe1s simples para entender su estructura.")
B.R3=A.a(s(["Una escuela que se enfoca en la estructura de la mente.","Una escuela de pensamiento que se interes\xf3 en el prop\xf3sito y la funci\xf3n de la mente y el comportamiento en la adaptaci\xf3n del organismo al entorno, influenciada por Darwin y el pragmatismo.","Una teor\xeda sobre las funciones cerebrales.",""]),t.s)
B.a6n=new A.c("5","\xbfQu\xe9 es el 'funcionalismo' en psicolog\xeda?",B.R3,"B","El funcionalismo, con James y Dewey, se centr\xf3 en el 'para qu\xe9' de la mente y el comportamiento, es decir, su valor adaptativo.")
B.Rv=A.a(s(["Una escuela que estudia la conciencia.","Una escuela que sostiene que la psicolog\xeda cient\xedfica debe estudiar solo las manifestaciones externas (motoras, glandulares y verbales) de la conducta observable y medible, rechazando la introspecci\xf3n y la conciencia como objeto de estudio.","Una teor\xeda sobre los procesos mentales internos.",""]),t.s)
B.a2t=new A.c("5","\xbfQu\xe9 es el 'conductismo' de John B. Watson?",B.Rv,"B","El conductismo de Watson revolucion\xf3 la psicolog\xeda al proponer que solo la conducta observable y medible era un objeto de estudio v\xe1lido para una ciencia.")
B.IY=A.a(s(["Amor, alegr\xeda, tristeza.","Amor, miedo e ira, que son heredadas y pueden ser condicionadas para formar respuestas complejas.","Sorpresa, asco, desprecio.",""]),t.s)
B.a_T=new A.c("5","\xbfQu\xe9 son las 'reacciones emocionales innatas' seg\xfan Watson?",B.IY,"B","Watson propuso que solo unas pocas emociones b\xe1sicas eran innatas y que las emociones m\xe1s complejas se aprend\xedan a trav\xe9s del condicionamiento.")
B.LQ=A.a(s(["Que el comportamiento es determinado por rasgos de personalidad fijos.","Que el comportamiento es una funci\xf3n de la persona y el ambiente (C = f(P,A)), donde todas las variables que influyen en un individuo en cada momento constituyen el 'espacio vital'.","Que el comportamiento es aleatorio.",""]),t.s)
B.ZO=new A.c("5","\xbfQu\xe9 postula la 'teor\xeda de campo' de Kurt Lewin?",B.LQ,"B","La teor\xeda de campo de Lewin enfatiza la interacci\xf3n din\xe1mica entre el individuo y su entorno psicol\xf3gico (espacio vital) para explicar el comportamiento.")
B.S7=A.a(s(["Un concepto similar al inconsciente freudiano.","El concepto central en la personalidad, similar al 'yo' freudiano, que incluye todo aquello que es \xfanico en un individuo y se desarrolla con las relaciones y experiencias.","Un rasgo de personalidad universal.",""]),t.s)
B.a8e=new A.c("5","\xbfQu\xe9 es el 'proprium' en la teor\xeda de la personalidad de Gordon Allport?",B.S7,"B","El proprium es el aspecto central y \xfanico de la personalidad de cada individuo, que se desarrolla a lo largo de la vida.")
B.Lr=A.a(s(["Un test de personalidad, Binet.","Un t\xe9rmino acu\xf1ado por Lewis M. Terman, utilizado para medir la inteligencia, adoptando el test de Binet para estudiantes americanos y siendo una de las m\xe1s utilizadas en el mundo.","Un concepto de creatividad, Freud.",""]),t.s)
B.a5F=new A.c("5","\xbfQu\xe9 es el 'Cociente de Inteligencia (CI)' y qui\xe9n lo acu\xf1\xf3?",B.Lr,"B","Terman adapt\xf3 el test de Binet y populariz\xf3 el concepto de CI para la medici\xf3n de la inteligencia.")
B.Qo=A.a(s(["Un campo que se ocupa de la investigaci\xf3n pura, Wundt.","El punto inicial de las aplicaciones de la psicolog\xeda al bienestar humano, con Lightner Witmer como pionero, quien fund\xf3 la primera cl\xednica psicol\xf3gica en 1896 y se ocup\xf3 de la atenci\xf3n de personas y el entrenamiento en el m\xe9todo cl\xednico.","Un \xe1rea de la psicolog\xeda social, Lewin.",""]),t.s)
B.a_c=new A.c("5","\xbfQu\xe9 es la 'psicolog\xeda cl\xednica' y qui\xe9n fue su pionero?",B.Qo,"B","La psicolog\xeda cl\xednica, con Witmer, marc\xf3 el inicio de la aplicaci\xf3n de los conocimientos psicol\xf3gicos para el diagn\xf3stico y tratamiento de problemas individuales.")
B.JM=A.a(s(["Un modelo que explica los problemas de salud mental en t\xe9rminos de causas sociales.","Un modelo que se basa en explicar los or\xedgenes de las desviaciones que afectan la conducta en t\xe9rminos de causalidades ex\xf3genas (s\xedntomas, diagn\xf3stico, patolog\xeda), contrapuesto al modelo biopsicosocial.","Un enfoque que integra lo biol\xf3gico, psicol\xf3gico y social.",""]),t.s)
B.a4k=new A.c("5","\xbfQu\xe9 es el 'modelo m\xe9dico' en el contexto de la psicolog\xeda de la salud?",B.JM,"B","El modelo m\xe9dico se centra en la identificaci\xf3n de s\xedntomas y el diagn\xf3stico de patolog\xedas como causas de los problemas de conducta, a menudo sin considerar factores psicosociales.")
B.Ps=A.a(s(["Un modelo que solo considera factores biol\xf3gicos.","Una idea que dice que los procesos biol\xf3gicos, psicol\xf3gicos y sociales est\xe1n involucrados en la enfermedad f\xedsica y en la salud, contrapuesto al modelo m\xe9dico.","Un modelo que ignora la mente.",""]),t.s)
B.a4I=new A.c("5","\xbfQu\xe9 es el 'modelo biopsicosocial' en salud?",B.Ps,"B","El modelo biopsicosocial reconoce la interacci\xf3n de factores biol\xf3gicos, psicol\xf3gicos y sociales en la comprensi\xf3n de la salud y la enfermedad.")
B.SJ=A.a(s(["Una rama de la medicina.","Un campo aut\xf3nomo que comparte terreno con la psicolog\xeda cl\xednica, comunicativa y la medicina comportamental, formando su propio camino en el \xe1mbito acad\xe9mico para el logro del bienestar humano.","El estudio de la enfermedad mental.",""]),t.s)
B.ZU=new A.c("5","\xbfQu\xe9 es la 'psicolog\xeda de la salud'?",B.SJ,"B","La psicolog\xeda de la salud es un campo interdisciplinario que busca promover la salud y prevenir enfermedades, considerando los factores psicol\xf3gicos y sociales.")
B.Ro=A.a(s(["Un movimiento que valora solo la investigaci\xf3n emp\xedrica.","Un movimiento asociado al uso de la experiencia cl\xednica y el juicio subjetivo en la adquisici\xf3n del conocimiento necesario para operar en los contextos aplicados, aunque advierte sobre los peligros de las psicoterapias marginales.","Una corriente que niega la validez de la experiencia personal.",""]),t.s)
B.a5a=new A.c("5","\xbfQu\xe9 es el 'postmodernismo' en relaci\xf3n con la experiencia cl\xednica?",B.Ro,"B","El postmodernismo, si bien valora la experiencia y el juicio subjetivo, tambi\xe9n advierte sobre los riesgos de las pr\xe1cticas no basadas en la evidencia.")
B.RT=A.a(s(["El estudio de la anatom\xeda.","La ciencia biol\xf3gica que comenz\xf3 como ciencia m\xe9dica y se enfoca en el funcionamiento de los organismos, siendo m\xe1s inductiva que deductiva en sus inicios.","El estudio de las enfermedades.",""]),t.s)
B.a_v=new A.c("5","\xbfQu\xe9 es la 'fisiolog\xeda' en el contexto de la ciencia biol\xf3gica?",B.RT,"B","La fisiolog\xeda se centra en el estudio de c\xf3mo funcionan los sistemas vivos, y sus avances fueron cruciales para el desarrollo de la psicolog\xeda.")
B.RR=A.a(s(["Un enfoque matem\xe1tico.","Un enfoque descriptivo, clasificatorio e inductivo de las experiencias inmediatas, con los m\xednimos prejuicios cient\xedficos posibles, que tend\xeda a producir hechos psicol\xf3gicos y sent\xf3 bases para la fisiolog\xeda de la sensaci\xf3n.","Un m\xe9todo experimental.",""]),t.s)
B.a5C=new A.c("5","\xbfQu\xe9 es la 'fenomenolog\xeda temprana' en la ciencia moderna?",B.RR,"B","La fenomenolog\xeda temprana se centr\xf3 en la descripci\xf3n directa de la experiencia, lo que fue importante para el estudio de la sensaci\xf3n y la percepci\xf3n.")
B.RU=A.a(s(["Una teor\xeda conductista.","Una gran influencia en la cl\xednica que fortaleci\xf3 la utilizaci\xf3n de ciertos modelos conceptuales (como el modelo m\xe9dico) para el an\xe1lisis del comportamiento anormal, centr\xe1ndose en identificar s\xedntomas, diagnosticar problemas y patolog\xedas como causas directas.","Una terapia de grupo.",""]),t.s)
B.a72=new A.c("5","\xbfQu\xe9 es el 'psicoan\xe1lisis' y c\xf3mo influy\xf3 en la cl\xednica?",B.RU,"B","El psicoan\xe1lisis, con Freud, introdujo conceptos como el inconsciente y la importancia de la infancia, influyendo en el diagn\xf3stico y tratamiento de los trastornos mentales.")
B.N8=A.a(s(["Una escuela que estudia las partes de la mente, Watson.","Una escuela de psicolog\xeda cuyo fundador fue Max Wertheimer, interesada en el estudio del movimiento aparente y que postul\xf3 que la percepci\xf3n es una organizaci\xf3n activa y que el todo es m\xe1s que la suma de sus partes.","Una teor\xeda de la personalidad, Freud.",""]),t.s)
B.a_d=new A.c("5","\xbfQu\xe9 es la 'Gestalt' y qui\xe9n fue su fundador?",B.N8,"B","La Gestalt revolucion\xf3 el estudio de la percepci\xf3n al enfatizar que la experiencia se organiza en totalidades significativas, no en elementos aislados.")
B.Jo=A.a(s(["Una postura que se enfoca en la patolog\xeda.","Una postura que reivindica las particularidades del psiquismo humano como objeto de estudio, procurando m\xe9todos propios adecuados a \xe9l, y que se opone a la tendencia experimentalista.","Una corriente que solo estudia la conducta observable.",""]),t.s)
B.a9y=new A.c("5","\xbfQu\xe9 es la 'psicolog\xeda humanista'?",B.Jo,"B","La psicolog\xeda humanista se centra en el potencial humano, el crecimiento personal y la autorrealizaci\xf3n, buscando comprender la experiencia subjetiva.")
B.Lm=A.a(s(["Una postura que prioriza la observaci\xf3n.","Una postura que surge de la oposici\xf3n sujeto-objeto y que prioriza la raz\xf3n y las ideas innatas como fuente de conocimiento, desconfiando de la experiencia sensorial.","Una corriente que niega la existencia de la mente.",""]),t.s)
B.abg=new A.c("5","\xbfQu\xe9 es el 'racionalismo idealista' (Plat\xf3n, Descartes, Berkeley) en la oposici\xf3n sujeto-objeto?",B.Lm,"B","El racionalismo idealista enfatiza el papel de la raz\xf3n y las ideas en la construcci\xf3n del conocimiento, a menudo relegando la experiencia sensorial a un segundo plano.")
B.Qx=A.a(s(["Una postura que prioriza la raz\xf3n.","Una postura que surge de la oposici\xf3n sujeto-objeto y que sostiene que todo conocimiento proviene de la experiencia sensorial, y que la mente es una 'tabula rasa' al nacer.","Una corriente que niega la existencia del mundo externo.",""]),t.s)
B.a8i=new A.c("5","\xbfQu\xe9 es el 'realismo emp\xedrico' (Hume) en la oposici\xf3n sujeto-objeto?",B.Qx,"B","El realismo emp\xedrico, con Hume, postula que la experiencia es la \xfanica fuente de conocimiento y que la mente se forma a partir de las impresiones sensoriales.")
B.Px=A.a(s(["Un objeto f\xedsico.","Una nueva realidad creada por el avance tecnol\xf3gico, la inform\xe1tica y los observadores, que produce un impacto en los modos de manejo y utilizaci\xf3n de la imagen, y en nuestra capacidad para representarnos el mundo.","Un objeto imaginario.",""]),t.s)
B.a3g=new A.c("5","\xbfQu\xe9 es el 'objeto virtual' en el contexto de la psicolog\xeda y la tecnolog\xeda?",B.Px,"B","El objeto virtual se refiere a las realidades creadas por la tecnolog\xeda digital, que transforman nuestra percepci\xf3n y relaci\xf3n con el mundo.")
B.RV=A.a(s(["Un camino sin reglas.","Un procedimiento \xfanico, un camino hacia el conocimiento para la obtenci\xf3n del saber, que establece firmemente los procedimientos a seguir, el orden de las observaciones, experimentaciones y razonamientos, y que implica una indagaci\xf3n gnoseol\xf3gica y metaf\xedsica.","Un conjunto de datos.",""]),t.s)
B.aaG=new A.c("5","\xbfQu\xe9 es el 'm\xe9todo' en la investigaci\xf3n cient\xedfica y filos\xf3fica?",B.RV,"B","El m\xe9todo es el conjunto de pasos sistem\xe1ticos y rigurosos que gu\xedan la investigaci\xf3n para alcanzar el conocimiento, tanto en la ciencia como en la filosof\xeda.")
B.SZ=A.a(s(["Su popularidad.","Lo que hace digna a la informaci\xf3n, indispensable para que el estudiante o cient\xedfico presten atenci\xf3n, siendo el criterio de validez equivalente al conocimiento verdadero en filosof\xeda, y debiendo ser comprobable seg\xfan el momento hist\xf3rico.","Su antig\xfcedad.",""]),t.s)
B.a_8=new A.c("5","\xbfQu\xe9 es la 'validez' de un conocimiento en ciencia?",B.SZ,"B","La validez se refiere a la fiabilidad y veracidad de un conocimiento, que debe ser fundamentado y comprobado seg\xfan los criterios de cada \xe9poca.")
B.K2=A.a(s(["Enfermedades del cuerpo.","Enfermedades del alma, atribuidas a posesiones demon\xedacas o brujer\xeda, que llevaban a la persecuci\xf3n y quema en la hoguera.","Enfermedades f\xedsicas sin causa conocida.",""]),t.s)
B.aaI=new A.c("5","\xbfQu\xe9 son las 'enfermedades sobrenaturales' en la Edad Media?",B.K2,"B","En la Edad Media, las enfermedades mentales eran interpretadas desde una perspectiva religiosa, como castigo divino o posesi\xf3n demon\xedaca.")
B.JV=A.a(s(["Un movimiento para unificar la iglesia.","Un movimiento que critic\xf3 los lujos y el abuso de poder de la iglesia, llevando al quiebre de la unidad religiosa y la coexistencia de diversas iglesias (cat\xf3lica, luterana, calvinista, anglicana).","Un per\xedodo de paz religiosa.",""]),t.s)
B.a9d=new A.c("5","\xbfQu\xe9 fue la 'Reforma Religiosa' en la Modernidad?",B.JV,"B","La Reforma Religiosa fue un movimiento que fragment\xf3 la unidad de la Iglesia Cat\xf3lica y dio origen a diversas ramas del cristianismo.")
B.MX=A.a(s(["Un sistema de ideas filos\xf3ficas basado en la metaf\xedsica.","Un sistema de ideas filos\xf3ficas basado en la experiencia y el conocimiento emp\xedrico de los fen\xf3menos naturales, considerando la metaf\xedsica y la teolog\xeda como sistemas imperfectos, y que comenz\xf3 con Cop\xe9rnico, Galileo, Bacon, Descartes y Newton.","Una corriente que niega la importancia de la experiencia.",""]),t.s)
B.Yp=new A.c("5","\xbfQu\xe9 es el 'Positivismo' en la Revoluci\xf3n Cient\xedfica?",B.MX,"B","El positivismo fue una corriente filos\xf3fica que enfatiz\xf3 la observaci\xf3n y la experimentaci\xf3n como las \xfanicas fuentes v\xe1lidas de conocimiento, impulsando el desarrollo de la ciencia moderna.")
B.Lp=A.a(s(["Una concepci\xf3n del mundo como una m\xe1quina.","Una visi\xf3n donde las personas viv\xedan en comunidades solidarias y sent\xedan la naturaleza en t\xe9rminos de relaciones org\xe1nicas, con interdependencia de fen\xf3menos materiales y espirituales, y subordinaci\xf3n de necesidades individuales a las comunitarias.","Una visi\xf3n individualista del mundo.",""]),t.s)
B.a8t=new A.c("5","\xbfQu\xe9 es la 'visi\xf3n org\xe1nica del mundo' que predominaba antes de la Modernidad?",B.Lp,"B","La visi\xf3n org\xe1nica del mundo conceb\xeda la naturaleza como un organismo vivo y espiritual, donde todo estaba interconectado, en contraste con la visi\xf3n mecanicista de la Modernidad.")
B.Oj=A.a(s(["Un modelo que explica el universo de forma espiritual.","La s\xedntesis de un largo proceso hist\xf3rico que concibi\xf3 el mundo como una m\xe1quina, donde los fen\xf3menos f\xedsicos se reducen al movimiento de part\xedculas de materia por la fuerza de gravedad, y que fue aplicado a diversas ciencias.","Un modelo que niega la existencia de leyes naturales.",""]),t.s)
B.a6u=new A.c("5","\xbfQu\xe9 es el 'modelo mecanicista de Newton'?",B.Oj,"B","El modelo mecanicista de Newton revolucion\xf3 la ciencia al explicar el universo en t\xe9rminos de leyes f\xedsicas y el movimiento de part\xedculas, sentando las bases de la f\xedsica cl\xe1sica.")
B.T0=A.a(s(["Un movimiento que prioriz\xf3 el teocentrismo.","Un movimiento cultural que busc\xf3 romper con el per\xedodo anterior, rescatar la inspiraci\xf3n grecolatina, y pasar del teocentrismo al antropocentrismo, privilegiando el talento, la inteligencia y las artes.","Un per\xedodo de oscurantismo.",""]),t.s)
B.YF=new A.c("5","\xbfQu\xe9 es el 'Renacimiento/Humanismo' en la Modernidad?",B.T0,"B","El Renacimiento y el Humanismo marcaron un cambio de enfoque hacia el hombre como centro del universo, valorando la raz\xf3n, la creatividad y el conocimiento.")
B.R7=A.a(s(["La expansi\xf3n de la cultura asi\xe1tica.","La expansi\xf3n de la cultura europea a trav\xe9s de los avances tecnol\xf3gicos de navegaci\xf3n y el descubrimiento de nuevas tierras, imponiendo su cultura en cada lugar al que fue.","La unificaci\xf3n de todas las culturas.",""]),t.s)
B.a7Q=new A.c("5","\xbfQu\xe9 es la 'Europeizaci\xf3n del mundo' en la Modernidad?",B.R7,"B","La europeizaci\xf3n se refiere al proceso de expansi\xf3n colonial y cultural de Europa, que impuso su influencia en gran parte del mundo.")
B.O7=A.a(s(["Un per\xedodo de estancamiento cient\xedfico.","Un per\xedodo de importantes descubrimientos y experimentaciones en los siglos XVI y XVII, donde la ciencia se separ\xf3 de la fe, se puso al servicio del hombre para modificar la naturaleza, y se caracteriz\xf3 por la experimentaci\xf3n cient\xedfica y el lenguaje matem\xe1tico.","Un movimiento art\xedstico.",""]),t.s)
B.a9V=new A.c("5","\xbfQu\xe9 es la 'Revoluci\xf3n Cient\xedfica' y qu\xe9 la caracteriz\xf3?",B.O7,"B","La Revoluci\xf3n Cient\xedfica fue un per\xedodo de profundos cambios en la forma de entender el mundo, marcando el nacimiento de la ciencia moderna basada en la observaci\xf3n y la experimentaci\xf3n.")
B.Sq=A.a(s(["El estudio de la mente sin relaci\xf3n con el cuerpo.","Un campo que buscaba relacionar los aspectos psicol\xf3gicos del hombre con sus manifestaciones f\xedsicas, investigando c\xf3mo se produce la percepci\xf3n de los est\xedmulos externos y buscando una relaci\xf3n registrable y cuantificable entre el mundo f\xedsico y el de la mente.","El estudio de la f\xedsica del sonido.",""]),t.s)
B.YV=new A.c("5","\xbfQu\xe9 es la 'psicof\xedsica' y qu\xe9 buscaban sus investigadores?",B.Sq,"B","La psicof\xedsica fue un campo pionero que busc\xf3 establecer relaciones cuantitativas entre los est\xedmulos f\xedsicos y las sensaciones psicol\xf3gicas.")
B.NO=A.a(s(["El primer laboratorio de qu\xedmica.","El primer laboratorio dedicado exclusivamente al estudio de los fen\xf3menos mentales, fundado en 1875, que se convirti\xf3 en modelo para los primeros psic\xf3logos experimentales y sus investigaciones inclu\xedan an\xe1lisis de sensaciones, atenci\xf3n, memoria y asociaci\xf3n de ideas.","Un laboratorio de fisiolog\xeda.",""]),t.s)
B.a8w=new A.c("5","\xbfQu\xe9 es el 'laboratorio de Leipzig' de Wundt?",B.NO,"B","El laboratorio de Wundt en Leipzig es considerado el lugar de nacimiento de la psicolog\xeda experimental, donde se realizaron los primeros estudios sistem\xe1ticos de la conciencia.")
B.Kf=A.a(s(["La creencia en un solo Dios.","La idea de que todos los objetos est\xe1n compuestos por \xe1tomos infinitesimalmente peque\xf1os, y que solo existen los \xe1tomos materiales en el espacio vac\xedo, sin Dios ni alma, y el libre albedr\xedo es una ilusi\xf3n.","La teor\xeda de los cuatro elementos.",""]),t.s)
B.a8k=new A.c("5","\xbfQu\xe9 es el 'atomismo' en la antig\xfcedad (Dem\xf3crito)?",B.Kf,"B","El atomismo de Dem\xf3crito propuso que la realidad se compone de part\xedculas indivisibles (\xe1tomos) y el vac\xedo, sentando las bases del materialismo.")
B.KQ=A.a(s(["La b\xfasqueda de la riqueza.","La felicidad o el florecimiento humano, considerada la meta natural apropiada para la vida humana, que se alcanza a trav\xe9s de la virtud y la vida en sociedad.","El placer f\xedsico.",""]),t.s)
B.a7V=new A.c("5","\xbfQu\xe9 es la 'eudaemonia' en la filosof\xeda griega?",B.KQ,"B","La eudaemonia es un concepto central en la \xe9tica griega, que se refiere a una vida plena y virtuosa, no solo a la ausencia de dolor.")
B.RH=A.a(s(["Objetos f\xedsicos.","Entidades incorp\xf3reas, suprasensibles e inteligibles que son la causa de las cosas sensibles y el conocimiento genuino, eternas e inmutables, que existen en un reino del Ser puro.","Im\xe1genes mentales.",""]),t.s)
B.a5O=new A.c("5","\xbfQu\xe9 son las 'Formas' para Plat\xf3n?",B.RH,"B","Las Formas son las ideas perfectas y eternas que existen en un reino separado, y de las cuales los objetos del mundo sensible son meras copias imperfectas.")
B.M3=A.a(s(["El prop\xf3sito de un objeto.","Los procesos que conducen a la construcci\xf3n del objeto o que posibilitan que funcione, siendo la \xfanica causa que interesa a la ciencia moderna.","La materia de la que est\xe1 hecho algo.",""]),t.s)
B.a2f=new A.c("5","\xbfQu\xe9 es la 'causa eficiente' en las cuatro formas de explicaci\xf3n de Arist\xf3teles?",B.M3,"B","La causa eficiente es el agente o proceso que produce un cambio o la existencia de algo, y es el foco principal de la ciencia moderna.")
B.LG=A.a(s(["La realidad tal como se presenta.","El conjunto de capacidades o posibilidades de la sustancia para llegar a ser algo distinto de lo que es en acto.","La fuerza f\xedsica.",""]),t.s)
B.a_y=new A.c("5","\xbfQu\xe9 es la 'potencia' en la concepci\xf3n aristot\xe9lica?",B.LG,"B","La potencia es la capacidad de una sustancia para cambiar y convertirse en algo diferente, mientras que el acto es su estado actual.")
B.JW=A.a(s(["La materia de la que est\xe1 hecho algo.","El prop\xf3sito o fin para el que existe un objeto o un proceso.","La forma de un objeto.",""]),t.s)
B.a4i=new A.c("5","\xbfQu\xe9 es la 'causa final' en las cuatro formas de explicaci\xf3n de Arist\xf3teles?",B.JW,"B","La causa final es el telos o prop\xf3sito de algo, un concepto central en la teleolog\xeda aristot\xe9lica.")
B.Jf=A.a(s(["El prop\xf3sito de un objeto.","La materia de la que est\xe1 hecho algo, es decir, el sustrato f\xedsico.","La forma de un objeto.",""]),t.s)
B.a5U=new A.c("5","\xbfQu\xe9 es la 'causa material' en las cuatro formas de explicaci\xf3n de Arist\xf3teles?",B.Jf,"B","La causa material es la sustancia o el material del que est\xe1 compuesto un objeto.")
B.Q4=A.a(s(["El prop\xf3sito de un objeto.","La forma o esencia de un objeto, lo que lo hace ser lo que es.","La materia de la que est\xe1 hecho algo.",""]),t.s)
B.a3s=new A.c("5","\xbfQu\xe9 es la 'causa formal' en las cuatro formas de explicaci\xf3n de Arist\xf3teles?",B.Q4,"B","La causa formal es la estructura o el dise\xf1o que define la naturaleza de un objeto.")
B.O6=A.a(s(["El conjunto de capacidades o posibilidades de la sustancia.","La realidad tal como se presenta, el estado actual de una sustancia, en contraste con su potencial.","Un evento futuro.",""]),t.s)
B.a44=new A.c("5","\xbfQu\xe9 es el 'acto' en la concepci\xf3n aristot\xe9lica?",B.O6,"B","El acto es la realizaci\xf3n de la potencia, el estado actual y completo de una sustancia.")
B.PG=A.a(s(["El problema de distinguir entre ciencia y no-ciencia (o pseudociencia).","El problema de c\xf3mo se descubren nuevas teor\xedas cient\xedficas.","El problema de c\xf3mo se financia la investigaci\xf3n cient\xedfica.",""]),t.s)
B.ZV=new A.c("5","\xbfQu\xe9 es el 'problema de la demarcaci\xf3n' en la filosof\xeda de la ciencia?",B.PG,"A","El problema de la demarcaci\xf3n es un tema central en la filosof\xeda de la ciencia, que busca establecer criterios para diferenciar el conocimiento cient\xedfico de otras formas de conocimiento.")
B.PA=A.a(s(["Un per\xedodo de crisis en la ciencia.","La actividad cient\xedfica que se lleva a cabo dentro de un paradigma establecido, resolviendo 'enigmas' y acumulando conocimiento de forma incremental.","Un per\xedodo de revoluciones cient\xedficas.",""]),t.s)
B.a85=new A.c("5","\xbfQu\xe9 es la 'ciencia normal' seg\xfan Thomas Kuhn?",B.PA,"B","La ciencia normal es el per\xedodo en el que la mayor\xeda de los cient\xedficos trabajan, aplicando y refinando el paradigma existente, sin cuestionar sus fundamentos.")
B.NR=A.a(s(["Un cambio gradual en una teor\xeda cient\xedfica.","Un cambio fundamental en el paradigma dominante de una disciplina, que implica una ruptura con las formas anteriores de entender y practicar la ciencia.","Un descubrimiento menor en un campo cient\xedfico.",""]),t.s)
B.aab=new A.c("5","\xbfQu\xe9 es una 'revoluci\xf3n cient\xedfica' seg\xfan Thomas Kuhn?",B.NR,"B","Las revoluciones cient\xedficas son eventos transformadores que redefinen los problemas, los m\xe9todos y las soluciones aceptables en un campo cient\xedfico.")
B.Q1=A.a(s(["Un m\xe9todo para confirmar teor\xedas cient\xedficas.","Un criterio para distinguir la ciencia de la pseudociencia, que sostiene que una teor\xeda es cient\xedfica si puede ser refutada por la experiencia.","Una teor\xeda que niega la posibilidad de error en la ciencia.",""]),t.s)
B.a1A=new A.c("5","\xbfQu\xe9 es el 'falsacionismo' de Karl Popper?",B.Q1,"B","El falsacionismo de Popper propone que la ciencia avanza al refutar hip\xf3tesis, no al confirmarlas, y que una teor\xeda es m\xe1s cient\xedfica cuanto m\xe1s f\xe1cil es refutarla.")
B.SK=A.a(s(["Una teor\xeda aislada que se prueba de forma independiente.","Una secuencia de teor\xedas relacionadas, con un 'n\xfacleo firme' protegido de la refutaci\xf3n y un 'cintur\xf3n protector' de hip\xf3tesis auxiliares que pueden ser modificadas.","Un conjunto de experimentos sin conexi\xf3n entre s\xed.",""]),t.s)
B.YD=new A.c("5","\xbfQu\xe9 es un 'programa de investigaci\xf3n cient\xedfica' seg\xfan Imre Lakatos?",B.SK,"B","Los programas de investigaci\xf3n de Lakatos son estructuras m\xe1s complejas que las teor\xedas individuales, que gu\xedan la investigaci\xf3n y el desarrollo de nuevas hip\xf3tesis.")
B.Rz=A.a(s(["Un factor que facilita el progreso cient\xedfico.","Un conjunto de ideas, h\xe1bitos o prejuicios que impiden la adquisici\xf3n de nuevo conocimiento cient\xedfico y requieren ser superados.",u.h9,""]),t.s)
B.a1v=new A.c("5","\xbfQu\xe9 es el 'obst\xe1culo epistemol\xf3gico' seg\xfan Gaston Bachelard?",B.Rz,"B","Los obst\xe1culos epistemol\xf3gicos son barreras mentales que dificultan el avance del conocimiento, y su superaci\xf3n es esencial para el progreso cient\xedfico.")
